var book = {
	"name": "ယီရှုၫအ့ၫ.",
	"numChapters": 24,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ယဟိဝၩအခ့ၫအၡၩစမိစ့ၭ ၥံၫဝ့ၫအလးခဲၫ့နီၪ,ဆၧ မၩအၥၭလၧယဟိဝၩ ချဲၩ့ဆၧလၧစမိစ့ၭအခ့ၫအၡၩ",
			"2": "<sup>2</sup> စနိၫ့အဖိၪခွၫစယီရှုၫအ့ၫတၭ, စံၭဝ့ၫဒၪ,- ယခ့ၫယၡၩ စမိစ့ၭၥံၫယူၭဝ့ၫယူၭတၭ, ဘိၩ့နဲၪ့ယီၩ ဂဲထုၪ့လ့ၩခၫ့ ဂၬယီၫဒၫ့ယီၩ, နဝ့ၫဒၪ, ဒဲၦခမျၧးထီးအလူၬယီၩထီၩ့ လၧခးလၧယဖ့ၪလၫ့လဘံၪ့ လၧၦအံၫစရ့လၭဖိၪနီၪ",
			"3": "<sup>3</sup> ဆံၭ.- ကယဲဆၧအလးလၧနၥံၪအခၪ့ယၫၥၭယဲးလၩ့ ဝ့ၫလစီၪ့လါလါနီၪ ယဖ့ၪလၫ့ယူၭနၥံၪ, ဘဲၫယစံၭစမိ",
			"4": "<sup>4</sup> စ့ၭအၥိၭနီၪလီၫ.- လၧၡါမုနၧၫ့ဖၫ ဒဲလ့ၭဘနၧၫ့ယီၩ ထီၩ့လၧထံၫမိၡါဖၭဒိၪ ယုၫဖ့တံၫ, ၦဟံၥၭဖိၪအခး ထၧၫ့ဘံၪ့ယၫဒဲထီၩ့လၧမၫဆမံၭဖၭဒိၪ လၧမုနုၬလခီၫ",
			"5": "<sup>5</sup> မိကဲၪထၪ့နၥံၪအခးအနဲၩ့ထံၭလဖၪနီၪလီၫ.- လဆိၩ ဒၪနၧၩ,ၦဆၧၫ့ထုၪ့လၧနမ့ၬယၫၥ့ၪ အီၪနးဂၩအ့ၬး ဘဲၫ ယအီၪလၧစမိစ့ၭအၥိၭနီၪ ယမိအီၪလၧနၥိၭလီၫ. ယ",
			"6": "<sup>6</sup> လၩ့ဆါလၧနဂးအ့ၬး ယစဲၪ့ဒၪနၧၩဆ့အ့ၬ.- အီၪက့ၪ ဆီၪ့နဂဲးနဘၭဒဲမၩဒူၩနၥၭဘီၪး အဂဲးဘဲၫယီၩနမိအၪ့ နၩ့ဖၭထံၫၥံၪခးၥံၪ လၧယဆိၪလၩ့ယၥၭ လၧအဝ့ၫၥံၪ အဖါလဖၪ လၧယမိဖ့ၪလၫ့ဝ့ၫလၧ ၦခမျၧးယီၩအန့ၥၫ ဆၧအဂးလီၫ.",
			"7": "<sup>7</sup> မွဲလါနၫ့အီၪက့ၪဆီၪ့နဂဲးနဘၭ ဒဲမၩဒူၩနၥၭအ့ၪဆီၪ့ ဘီၪ. ဘဲၫၥိၭနမိထီးလၩ့နၥၭ, ဒဲမၩဘဲၫကယဲဆၧၥီၪ့ ဆၧၥၫ့လၧယခ့ၫယၡၩစမိစ့ၭ မၪလူၬနၧၩနီၪဆံၭ. လၧ နစူၪထွ့ၪလခီၫမွဲဂ့ၩ, လၧနစူၪစ့ၪလခီၫမွဲဂ့ၩ, ထီးကၠၪ ပဲၩနၥၭလဂ့ၩ, ဘဲၫၥိၭထီးနလ့ၩဆၧလစီၪ့လါလါနီၪ,",
			"8": "<sup>8</sup> နမိဘီၪထၪ့ယီၫထၪ့အဂဲးလီၫ.- လံၬဆၧၥီၪ့ဆၧၥၫ့ယီၩ မိစဲၪ့ထၪ့ခွံၬလၧနနိၭအ့ၬ. အ့ၪမွဲနဘၪဆီၫ့မီၪ့ဆၧလၧ အဖၧၩ့လၧမုဆၫဆၫ, ဒဲလၧမုနၩနၩ, ဘဲၫၥိၭနမိထီးလၩ့ နၥၭ, ဒဲမၩဆၧဘဲၫကယဲဆၧကွ့ၭအၥၭလၧအဖၧၩ့ထီး အလူၬလီၫ. အဂဲးဘဲၫယီၩ ထီးနီၪလဖၧၫ့ နမိဒုၭဘီၪ ထၪ့ယီၫထၪ့နဖၧၩ့ၥၭ ဒဲထီးနီၪလဖၧၫ့ နမိမၩဆၧကိၪ့",
			"9": "<sup>9</sup> ၥ့ၪလီၫ.- ယမၪလူၬနၧၩယူၭမွဲအ့ၬဧၪ, အီၪက့ၪဆီၪ့နဂဲး နဘၭဒဲမၩဒူၩနၥၭဘီၪး ထီးၥၭမဲၪဆၧလဂ့ၩ, ဒဲထီးမၩ ဂၭဂီၩ့နၥၭလဂ့ၩ, အဂဲးဘဲၫယီၩ ထီးဒၪနလ့ၩဆၧလ စီၪ့လါလါနီၪ, ယဟိဝၩနယွၩအီၪလၧနၥိၭကိၭစီၪ့ဒ့ၭ လီၫ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့ စယီရှုၫအ့ၫမၪလူၬၦခမျၧးအၦဒိၪလ",
			"11": "<sup>11</sup> ဖၪတၭ, စံၭဝ့ၫဒၪ,- လ့ၩခၫ့ဂၬၦၥုၪ့တဲၩအလး, ဒဲမၪ လူၬၦခမျၧးတၭ, စံၭ,တဲၩ့ဝဲၩနၥံၪအဆၧအၪ့ဆၧအီၩ ဆံၭ,အဂဲးဘဲၫယီၩ လၧၥၧၫ့နံၩအထးဖၧၩ့နီၪနၥံၪမိခၫ့ ဂၬထံၫယီၫဒၫ့ယီၩ, ဘဲၫၥိၭနၥံၪမိလ့ၩနုၬမၩန့ထံၫၥံၪ ခးၥံၪလၧယဟိဝၩ နၥံၪအယွၩဖ့ၪလၫ့နၥံၪ လၧနၥံၪမိ မၩန့ဝ့ၫလီၫ.",
			"12": "<sup>12</sup> စယီရှုၫအ့ၫချဲၩ့ဆၧလၧၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪ, ဒဲၦ",
			"13": "<sup>13</sup> မနၭစ့ၫဖိၪလခီၫဒီၪ့တၭ, စံၭဝ့ၫဒၪ,- နၪ့ထၪ့ထဲၩ့ဆၧချဲၩ့ လၧယဟိဝၩအခ့ၫအၡၩ စမိစ့ၭမၪလူၬနၥံၪး တၭစံၭ ဝ့ၫ,ယဟိဝၩနၥံၪအယွၩ ဖ့ၪလၫ့နၥံၪလၧဆၧအီၪပွံၭ,",
			"14": "<sup>14</sup> ဒဲဖ့ၪလၫ့နၥံၪလၧအခးလဘံၪ့ယီၩလီၫ.- နၥံၪအမိအ ဖါ,နၥံၪအဖိၪအလံၩ, ဒဲနၥံၪအဆၧဖိၪဆၧဎါအဒိၩ့လ ဖၪနီၪ, မိအီၪလၩ့ထးလၧခးလဘံၪ့အဖၧၩ့ လၧစမိစ့ၭ ဖ့ၪလၫ့နၥံၪ လၧယီၫဒၫ့အယီၩလခီၫလီၫ. အ့ၪမွဲနၥံၪ ဝ့ၫယီၩနၥံၪမိဘၪ လ့ၩခၫ့ဂၬ ဆၧလၧနၥံၪအထၧၫ့ဖုဝဲ အမ့ၬယၫအီၪလၧနၥံၪအစူၪဝဲၩ, ကယဲၦၥုၭဖိၪ, ၦအ",
			"15": "<sup>15</sup> ဆီၪ့ထီးအလူၬ ဒဲမၩဆၧၩ့အဝ့ၫၥံၪး- ထီၩ့လၩ့လၧယ ဟိဝၩ ဖ့ၪလၫ့နၥံၪအထၧၫ့ဖုဝဲအဆၧအီၪပွံၭ ဘဲၫနၥံၪ ဝ့ၫဒၪအၥိၭနီၪ, ဒဲအဝ့ၫၥံၪမၩန့ဆ့ခးလဘံၪ့လၧယဟိ ဝၩနယွၩဖ့ၪလၫ့ဝ့ၫနီၪဆံၭ. ထီးနီၪလဖၧၫ့ နၥံၪမိထဲၩ့ ထဲၩ့လၧနၥံၪအခးလၧနၥံၪမၩန့ဝ့ၫလဘံၪ့တၭ, နၥံၪမိ အီၪမုၬလၩလၧအဖၧၩ့, လၧယဟိဝၩအခ့ၫအၡၩ စမိ စ့ၭဖ့ၪလၫ့နၥံၪလၧယီၫဒၫ့မုထၪ့အယီၩလခီၫလီၫ.",
			"16": "<sup>16</sup> အဝ့ၫၥံၪစံၭဆၧၫ့စယီရှုၫအ့ၫတၭ, စံၭဝ့ၫဒၪ, ကယဲ ဆၧလၧနမၪလူၬပၧၩထီးအလူၬနီၪပမိမၩတၭ, ထီးဒၪ နအၪ့မၧၫ့လၩ့ပၧၩနီၪ, ပမိလ့ၩလစီၪ့လါလါကိၭစီၪ့ဒ့ၭ",
			"17": "<sup>17</sup> လီၫ.- ဘဲၫပခိၭနၪစမိစ့ၭအလူ လၧဆၧကိၭမံၩ့ဒ့ၭအ ၥိၭနီၪ,ပမိခိၭနၪနလူဘဲၫနီၪၥိၭလီၫ. မွဲန့ၫလၧယဟိဝၩ နယွၩမိအီၪလါလၧနၥိၭ ဘဲၫအအီၪလၧစမိစ့ၭအၥိၭ",
			"18": "<sup>18</sup> နီၪဆံၭ.- ကယဲၦလၧအပိၩ့ထၪ့နဆၧမၪလူၬတၭ, လ ခိၭနၪဘၪနလူ လၧနမၪလူၬ ဆၧထီးအလူၬနီၪ, မွဲအမိ ဘၪဆၧမၩၥံၫဝ့ၫ ကိၭဂၩဒ့ၭလီၫ. မွဲန့ၫအီၪက့ၪလါန ဂဲးနဘၭအ့ၪဆီၪ့, ဒဲမၩဒူၩနၥၭဘီၪ."
		},
		"2": {
			"1": "<sup>1</sup> တၭစနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫအၪ့မၧၫ့ယူၭၦနံၫဂၩ စဲၪ့ထၪ့ခွံၬလၧၡံၭထံၫ့ဘဲၫၥိၭအမိလ့ၩယိၥူၪဆၧတၭ, စံၭဝ့ၫဒၪ, လ့ၩယိၥူၪခးလဘံၪ့နီၪ, ယ့ၫရခိၫဒၪလ့ၬနီၪ ဘီၪ. အဝ့ၫၥံၪလ့ၩဝ့ၫတၭ, လ့ၩနုၬလၧၦမဲၩဎွဲၩမုၪနးရၫ",
			"2": "<sup>2</sup> ဟၭအဂံၪ့ဖၧၩ့တၭ, အီၪလၧမုနၩထီးနီၪလီၫ.- ၦလီၩ ဘၪယ့ၫရခိၫအစဎွၩတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,လၧမုလနၩ ယီၩၦၡၩလၧၦအံၫစရ့လၭဖိၪအကျၩလဖၪ ဂဲၫနုၬဘဲၫ",
			"3": "<sup>3</sup> ၥိၭအမိအၪ့ဎၬယိခးယီၩလီၫ.- ယ့ၫရခိၫအစဎွၩအၪ့ မၧၫ့လၩ့ၦၡၩလၧနးရၫဟၭအအီၪတၭ, စံၭဝ့ၫဒၪ,ဂဲၫ ဆိၬထၪ့ၦလဖၪ လၧအဂဲၫလၧနအီၪ, လၧအလ့ၩနုၬ လၧနဂံၪ့ဖၧၩ့နီၪဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဂဲၫအၪ့ ဎၬယိခးထၧၫ့ဘံၪ့ယၫယီၩလီၫ.",
			"4": "<sup>4</sup> ၦမုၪနီၪမၩန့ယူၭၦနံၫဂၩနီၪတၭ, အီၪက့ၪၥူၪဝ့ၫတၭ, စံၭဝ့ၫဘဲၫယီၩ, ၦနံၫဂၩဂဲၫလၧယအီၪ, မွဲလါနၫ့ဂဲၫထၪ့",
			"5": "<sup>5</sup> အထံၭခီၫခီၫလဲၪနီၪ, ယၥ့ၪယၫအ့ၬ.- တၭလၧဆၧခံၭ လၩ့ၦကၭဘံၭထၬဒိၩ့အတရၫ့အထီနီၪ, ဆၧမၩအၥၭ လၧၦလဖၪနီၪစဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ. ထီးဒၪအလးလၧၦ လဖၪနီၪလ့ၩဆၧတၭ, ယၥ့ၪယၫဆ့အ့ၬ. လီၩ့ဆီးအ",
			"6": "<sup>6</sup> ဝ့ၫၥံၪချဲၫ့ချဲၫ့ဘီၪ, မွဲနၥံၪမိချႃၭန့ဝ့ၫလီၫ.- မွဲလါနၫ့အ ဝ့ၫဒၪဒုၭလ့ၩထၪ့ယူၭ ၦလဖၪနီၪ လၧအဂံၪ့ခိၪတၭ, ချႃၬဘံၭဝ့ၫလၧၥီၪကဘၩ့အဘီၩ့လဖၪ လၧအအီၪက့ၪ",
			"7": "<sup>7</sup> တဲၩ့ဝဲၩယူၭလၧဂံၪ့ခိၪနီၪလီၫ.- တၭၦလဖၪနီၪလီၩ့ဆီး အဝ့ၫၥံၪလၧဖၧၩ့ၥၭ လီၩ့လၧယီၫဒၫ့ ဖိးလၧဆၧခၫ့ဂၬ အလးနီၪလီၫ. တၭထီးၦလီၩ့ဆီးဝ့ၫလဖၪစဲၪ့ထၪ့ခွံၬ",
			"8": "<sup>8</sup> တၭ,အဝ့ၫၥံၪကၭဘံၭထၬဒိၩ့အတရၫ့လီၫ.- ၦနံၫဂၩ နီၪဘိၩ့အလချႃၭမံၫနၩ့ဒံၭဘၪတၭ, ၦမုၪနီၪလ့ၩထၪ့",
			"9": "<sup>9</sup> လၧအအီၪလၧဂံၪ့ခိၪ,- တၭစံၭၦလဖၪနီၪ, ယၥ့ၪယၫ လၧယဟိဝၩ ဖ့ၪလၫ့ယူၭနၥံၪလၧထံၫၥံၪခးၥံၪ, ဒဲဆၧ ၥၭမဲၪနၥံၪနီၪလၩ့ဘၪပၧၩတၭ, ၦခးဖိၪထီးအလူၬအ",
			"10": "<sup>10</sup> ၥၭလၩ့ဘဲၩလၧနၥံၪအကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ပနါ ဂၧၫ့လၧနၥံၪဂဲၫထၪ့လၧအံဇံၭနီၪ ယဟိဝၩမၩလၩ့ၥံၭ ခွံၬမၫဆမံၭဝီၩအထံၫလၧနၥံၪအဂး, ဒဲဆၧလၧနၥံၪမၩ ၦအၫမိၫဖိၪအစဎွၩနံၫဂၩ လၧအအီၪလၧယီၫဒၫ့ဝါလ ခီၫ,စစဲဟၫ့,ဒဲစအီၭ, လၧနၥံၪမၩဂၭဂီၩ့ဝ့ၫတၡါလီၫ.",
			"11": "<sup>11</sup> ထီးပနါဂၧၫ့နီၪ ပၥၭဖံၪထၪ့ခွံၬချဲၫ့မၬတၭ, လၧနၥံၪ အကၠီၩ့နီၪ ဆၧၥၭဒူၩအီၪလၧၩ့လၧပဖၧၩ့ နးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ ယဟိဝၩနၥံၪအယွၩနီၪ မွဲယွၩလၧမူၭ ခိၪဖၧၩ့လၧထၭလခီၫ, ဒဲလၧဂၪ့ခိၪချိၫ့ လၧလၬလခီၫ",
			"12": "<sup>12</sup> လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ဆိၪလၩ့နၥံၪအၥၭလၧယၧၩ လၧယဟိဝၩအမ့ၬယၫ, မွဲလၧယမၩယူၭနၥံၪ လၧဆၧ အခိးအတၩ အကၠီၩ့တၭ, နၥံၪမိမၩဆၧအခိးအတၩ လၧယဖါအၡၩဂံၪ့ဖိၪ, ဒဲဖ့ၪလၫ့ယၧၩ လၧဆၧမၩနဲၪ့",
			"13": "<sup>13</sup> အမွဲအတီၩ,- လၧနၥံၪမိဒုၭမၧၫ့ဒံၭ ယမိဒဲယဖါ, ဒဲယ ထၧၫ့ဖုဝဲခွၫ, ဒဲယထၧၫ့ဖုဝဲမုၪ, ဒဲကယဲအဆၧထီးအ",
			"14": "<sup>14</sup> လူၬ,ဒဲမၩဖီၩ့မၩဖျ့ၭပၥၭလၧဆၧၥံၫနီၪဘီၪ.- ၦလဖၪ နီၪစံၭဆၧၫ့ဝ့ၫ, ပဆၧလဖၪယီၩ နအ့ၪလဒုၭနဲၪဘၪ တၭ,ပၥၭမၧၫ့မွဲလၧနၥံၪအၥၭမၧၫ့အဂးလီၫ. တၭထီး ယဟိဝၩအ့ၪဖ့ၪလၫ့ပၧၩ လၧထံၫၥံၪခးၥံၪတၭ, ဆၧမိ မၩအၥၭလၧပမိမၩနၧၩလၧဆၧအခိးအတၩ, ဒဲဆၧမွဲ ဆၧတီၩလီၫ.",
			"15": "<sup>15</sup> ထီးနီၪလဖၧၫ့ ၦမုၪနီၪဆဲၩလၩ့အဝ့ၫၥံၪလၧဖျံၩလၧ တရၫ့ဖိးအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ အဂံၪ့အီၪဝ့ၫလၧ ဒိၩ့ခိၪဒၧၩ့အဖၫ့ခိၪ, ဒဲအဝ့ၫအီၪလၧဒိၩ့ခိၪဒၧၩ့အဖၫ့",
			"16": "<sup>16</sup> ခိၪနီၪလီၫ.- တၭၦမုၪစံၭအဝ့ၫၥံၪလ့ၩထၪ့လၧခိၪလီၩ့ ထိၩ့ချိၬဘီၪ, ဘဲၫၥိၭၦလီၩ့ဆီးဆၧနီၪ, ထီးဘၪခီၩ့လၧ နၥံၪလဂ့ၩ, တၭအီၪက့ၪၥူၪနၥံၪအၥၭထီးနီၪၥၧၫ့နံၩ, ထီးၦလီၩ့ဆီးဆၧလဖၪ ဂဲၫထဲၩ့ထဲၩ့နီၪဘီၪ, လၧခဲၫ့",
			"17": "<sup>17</sup> ထဲၩ့တၭ, နၥံၪမိလ့ၩဖိၬဘၪနၥံၪအဖၧၩ့ၥၭလီၫ.- တၭ ၦလဖၪနီၪစံၭအဝ့ၫ, ဆၧအမၪဘၪဆဲၫ့လၧနဒုၭဆိၪလၩ့",
			"18": "<sup>18</sup> ပၥၭယီၩမိအီၪဘၪလၧပလီၩ့အ့ၬ.- ယိခွါ, ထီးပအ့ၪ ဂဲၫနုၬလၧထံၫၥံၪခးၥံၪအဖၧၩ့တၭ, နမိဘၪစၧၩ့ထၬဖျံၩ ဝီၩလဘီၩ့ယီၩလၧတရၫ့အဖိး လၧနဆဲၩလၩ့ပၧၩလၧ အဖၧၩ့တၭ, နမိဘၪဂဲၫဆိၬနမိ, ဒဲနဖါ, ဒဲနထၧၫ့ဖုဝဲၥံၪ ဒဲနဖါအၡၩဂံၪ့ဖိၪ ထီးအလူၬ လၧနအီၪလၧနဂံၪ့ဖၧၩ့",
			"19": "<sup>19</sup> လီၫ.- တၭဆၧမိမၩအၥၭ လၧကယဲၦလၧအစဲၪ့ထၪ့ခွံၬ လၧနဂံၪ့အတရၫ့ဖၧၩ့လဂၩလါလါနီၪ အၥွံၪမိအီၪလၧ အခိၪဒၪဝ့ၫအလီၩ့, ဒဲပဝ့ၫဒၪယီၩပဆၧဒဲၩဘၭအီၪအ့ၬ. တၭၦလၧအအီၪလၧနၥိၭ လၧဂံၪ့ဖၧၩ့ ကိၭဂၩဒ့ၭနီၪ, ၦအစူၪအ့ၪအီၪလၧအလီၩ့တၭ, အၥွံၪမိအီၪလၧပခိၪ",
			"20": "<sup>20</sup> အလီၩ့လီၫ.- နအ့ၪဒုၭနဲၪပဆၧမၩလဖၪယီၩတၭ,",
			"21": "<sup>21</sup> ပဖီၩ့ဖျ့ၭဆၧလၧနဒုၭဆိၪလၩ့ပၥၭယီၩလီၫ.- တၭၦမုၪ နီၪစံၭဝ့ၫဒၪ, မွဲဆၧမၩအၥၭ ဘဲၫနၥံၪအဆၧချဲၩ့အၥိၭ နီၪဘီၪ. ၦမုၪဒုၭစဲၪ့ထၪ့ခွံၬအဝ့ၫၥံၪတၭ, ၦလဖၪနီၪစဲၪ့ ထၪ့ခွံၬတၭ, ၦမုၪနီၪစၧၩ့ထၬဖျံၩဝီၩလဘီၩ့လၧတရၫ့",
			"22": "<sup>22</sup> ဖိးနီၪလီၫ.- ၦလဖၪနီၪလ့ၩဆၧတၭ, ထီၩ့ဝ့ၫလၧခိၪ လီၩ့ထိၩ့ချိၬတၭ, အီၪဝ့ၫထီးနီၪၥၧၫ့နံၩ ထီးၦလီၩ့ဆီး ဆၧနီၪထဲၩ့ထဲၩ့ဝ့ၫတၭ, ၦလီၩ့ဆီးဆၧလဖၪနီၪအၪ့ ဎူၫအၪ့ဎၬဝ့ၫလၧဖၧၩ့ၥၭထၧၫ့ဘီၩ့ယၫတၭ, ဒၪဘၪဝ့ၫ အ့ၬ.",
			"23": "<sup>23</sup> ၦနံၫဂၩနီၪ ထဲၩ့ထဲၩ့တၭ, ထဲၩ့လၩ့ခွံၬ လၧခိၪလီၩ့ တၭ,ခၫ့ဂၬဆၧတၭ, လ့ၩထီၩ့လၧစနိၫ့အဖိၪခွၫစယီရှုၫ အ့ၫအအီၪတၭ, လီၩဘၪဝ့ၫလၧကယဲဆၧလၧအဘၪ",
			"24": "<sup>24</sup> အဝ့ၫၥံၪလီၫ.- တၭစံၭစယီရှုၫအ့ၫ, မွဲမၬယဟိဝၩဖ့ၪ လၫ့ယူၭခးထၧၫ့ဘံၪ့ယၫလၧပစူၪဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩၦခးဖိၪထီးအလူၬနီၪ အၥၭလၩ့ဘဲၩဒၪလ့ၬလၧပ ကၠီၩ့လီၫ."
		},
		"3": {
			"1": "<sup>1</sup> တၭဆၧဖၩ့ထၪ့နီၪ စယီရှုၫအ့ၫ ဂဲထုၪ့ဂီၩဂီၩတၭ, အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧၡံၭတံၫ့တၭ, ဂဲၫထီၩ့လၧယီၫ ဒၫ့အနဲၩ့, အဝ့ၫဒၪဒဲၦအံၫစရ့လၭဖိၪ ထီးအလူၬတၭ, မံၫဝ့ၫထီးနီၪဘိၩ့အလချႃၭခၫ့ဂၬဒံၭဘၪလီၫ.",
			"2": "<sup>2</sup> တၭလၧအလးခဲၫ့ၥၧၫ့နံၩနီၪ ဆၧမၩအၥၭလၧၦဒိၪ လဖၪလ့ၩခၫ့ဂၬ ၦၥုၪ့တဲၩအလးနီၪတၭ, မၪလူၬၦခ",
			"3": "<sup>3</sup> မျၧးစံၭဝ့ၫဒၪ,- ထီးနၥံၪဒၪဘၪ ယဟိဝၩ နၥံၪအယွၩ အဆၧအုၩ့လၩ့အတလၫ, လၧၦလုဆၧလဖၪဒဲၦလံဝဲၫ ဖိၪလဖၪဆိၬဝ့ၫတၭ, နၥံၪမိဘၪစဲၪ့ထၪ့လၧနၥံၪအလး",
			"4": "<sup>4</sup> တၭ,လ့ၩဖိၬအခဲၫ့လီၫ.- မွဲလါနၫ့ဆၧအလးမိဘၪအီၪ လၧနၥံၪဒဲအဝ့ၫၥံၪအဘိၩ့ဆၧၩ့နီၪ ထိၪဝ့ၫတၭ မိဘၪ အီၪအဖျါနံၫထီၫ့ကၪလီၫ. ၥုၭဘူၭနၥံၪအၥၭ လၧအ အီၪလဂ့ၩ, ဘဲၫၥိၭနၥံၪမိၥ့ၪယၫဖၧၩ့ၥၭလၧနၥံၪမိလ့ၩ အဂဲးလီၫ. အဂဲးဘဲၫယီၩ နၥံၪဖိၬဘၪဖၧၩ့ၥၭလဘီၩ့ ယီၩနးဖၧၫ့ဒံၭအ့ၬ.",
			"5": "<sup>5</sup> တၭစယီရှုၫအ့ၫ စံၭၦခမျၧးနီၪ, မၩဆံၫ့ဎံၪနၥံၪအ ၥၭဆံၭ, အဂဲးဘဲၫယီၩကဲဂီၩခိၬနီၪ ယဟိဝၩမိမၩဆၧ လၩ့လၭလဖၪလၧနၥံၪအကျၩလီၫ.",
			"6": "<sup>6</sup> စယီရှုၫအ့ၫ ချဲၩ့ဆၧလၧၦလုဆၧလဖၪတၭ, စံၭဝ့ၫ ဒၪ, ဆိၬထၪ့ဆၧအုၩ့လၩ့ အတလၫတၭ, ခၫ့ဂၬဆၧ လၧၦခမျၧးအမ့ၬယၫဆံၭ. တၭအဝ့ၫၥံၪဆိၬထၪ့ဆၧ အုၩ့လၩ့အတလၫတၭ, လ့ၩဝ့ၫလၧၦခမျၧးအမ့ၬယၫ လီၫ.",
			"7": "<sup>7</sup> တၭယဟိဝၩ စံၭစယီရှုၫအ့ၫ, ဆၧလၧမုဆၫလနံၩ ယီၩယမိအီၪက့ၪဒိၪၥၫ့နၧၩ လၧၦအံၫစရ့လၭဖိၪအ မ့ၬယၫ,ဘဲၫၥိၭအဝ့ၫၥံၪ မိၥ့ၪယၫဘဲၫယအီၪလၧစမိစ့ၭ",
			"8": "<sup>8</sup> အၥိၭနီၪ ယမိအီၪလၧနၥိၭဆ့လီၫ.- တၭနမိဘၪမၪ လူၬၦလုဆၧလဖၪလၧအဆိၬဆၧအုၩ့လၩ့ အတလၫ တၭ,စံၭ, ထီးနၥံၪလ့ၩထီၩ့လၧယီၫဒၫ့ အနဲၩ့ထံၭတၭ နၥံၪမိဘၪအီၪဆၧၫ့ထုၪ့ဂုး လၧယီၫဒၫ့အဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> စယီရှုၫအ့ၫစံၭ ၦအံၫစရ့လၭဖိၪ, ဂဲၫလၧယီၩဘီၪ,",
			"10": "<sup>10</sup> ခိၭနၪယဟိဝၩနၥံၪအယွၩအလူနီၪဆံၭ.- တၭစယီရှုၫ အ့ၫစံၭဝ့ၫဒၪ, လၧဆၧယီၩလမံၩ့နၥံၪမိၥ့ၪယၫလၧယွၩ အမၧၫ့အီၪဝ့ၫလၧနၥံၪအကျၩ, ဒဲလၧအမိနၫ့ထၪ့ခွံၬတ ၡါၦကၫနအၫ့ဖိၪ, ဒဲၦဟံၥၭဖိၪ, ဒဲၦဟံဝဲဖိၪ, ဒဲပၧရစဲၭ ဖိၪ, ဒဲၦဂၧဂၫဖိၪ, ဒဲၦအၫမိၫဖိၪ, ဒဲၦယ့ဘုၫဖိၪလၧနၥံၪ",
			"11": "<sup>11</sup> အမ့ၬယၫနီၪလီၫ.- ယိခွါ, ဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫ အက ဆါအဆၧအုၩ့လၩ့ အတလၫနီၪ လ့ၩခၫ့ဂၬဆၧလၧန",
			"12": "<sup>12</sup> ၥံၪအမ့ၬယၫလၧယီၫဒၫ့အဖၧၩ့လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ မၩန့ၦလဆံၫနံၫဂၩ လၧၦအံၫစရ့လၭဖိၪ အဒီၪ့လဖၪ",
			"13": "<sup>13</sup> အကျၩနီၪ, လဒီၪ့လဂၩလဒီၪ့လဂၩဆုၬဆုၬဆံၭ.- တၭ ထီးၦလုဆၧလဖၪ လၧအဆိၬယဟိဝၩဂၪ့ခိၪထၧၫ့ဖျိၪ့ ယၫအကဆါအတလၫနီၪ, အခၪ့ယၫၥၭအီၪထီဝ့ၫလၧ ယီၫဒၫ့အထံၫကျၩတၭ, ဆၧမိမၩအၥၭ လၧယီၫဒၫ့အ ထံၫမိဒၪ့ထ့ၬခွံၬအၥၭတၭ, ထံၫလၧအဂဲၫလၩ့လၧထၭ လခီၫ,မိအီၪဆၧၫ့ထုၪ့လပိၩ့လီၫ.",
			"14": "<sup>14</sup> ထီးၦခမျၧးစဲၪ့ထၪ့ခွံၬ ဘဲၫၥိၭအမိခၫ့ဂၬယီၫဒၫ့တၭ, ၦလုဆၧလဖၪဆိၬဆၧအုၩ့လၩ့အတလၫ လၧၦခမျၧး",
			"15": "<sup>15</sup> အမ့ၬယၫ,- ထီးၦလၧအဆိၬတလၫအခၪ့လဖၪလၩ့ ဘၧၩ့လၧထံၫကျၩတၭ, (အဂဲးဘဲၫယီၩ ဆၧကူၭဘုၪ အထီနီၪယီၫဒၫ့ အထံၫလုၬဘံၭ အနဲၩ့ထံၭ ထီးအ",
			"16": "<sup>16</sup> လူၬ,)- ထံၫလၧအဂဲၫလၩ့နီၪ ဆၧၫ့ထုၪ့ဝ့ၫလၧအထၪ့ ပိၩ့အီၪယဲၩ့ယဲၩ့လ့ၬထီၩ့လၧဒိၩ့အၫဒၫ့လၧအအီၪဘူၭ လၧဇၫရတၫ့တၭ, ထံၫလၧအလ့ၩလၩ့လၧဆၧပျၩ့ဖၧၩ့ အမၫဆမံၭ, မၫဆမံၭထံၫလၪနီၪလူၬခွံၬဝ့ၫတၭ, ဘၪ ဆၧဒၪ့ထ့ၬခွံၬအၥၭတၭ ၦခမျၧးခၫ့ဂၬဆၧဆဲၫဎၩ့လၧ ယ့ၫရခိၫနီၪလီၫ.",
			"17": "<sup>17</sup> တၭၦလုဆၧလဖၪ လၧအဆိၬယဟိဝၩ အဆၧအုၩ့ လၩ့အတလၫနီၪ ဆၧၫ့ထုၪ့အီၪခၧၫ့ဝ့ၫလၧခီၫ့လၧယီၫဒၫ့ အၥၭကျၩတၭ, အံၫစရ့လၭထီးအလူၬခၫ့ဂၬဆၧလၧ ခီၫ့လီၫ. တၭၦခမျၧးနီၪခၫ့ဂၬယီၫဒၫ့ထီးအလူၬလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ထီးၦခမျၧးခၫ့ဂၬယီၫဒၫ့ထီးအလူၬတၭ, ဆၧမၩအ ၥၭလၧယဟိဝၩ ချဲၩ့ဆၧလၧစယီရှုၫအ့ၫတၭ, စံၭဝ့ၫ",
			"2": "<sup>2</sup> ဒၪ,- မၩန့ၦလဆံၫနံၫဂၩလၧၦခမျၧးအကျၩနီၪ, လဒီၪ့ လဂၩလဒီၪ့လဂၩဆုၬဆုၬဆံၭ, ဒဲမၪလူၬအဝ့ၫၥံၪတၭ,",
			"3": "<sup>3</sup> စံၭ,- မၩန့ထၪ့လိးလဆံၫနံၫဖျိၪ့ ထီးနီၪလၧယီၫဒၫ့အ ၥၭကျၩလၧအလးထီးၦလုဆၧလဖၪ အခၪ့ဆၧၫ့ထုၪ့ အီၪခၧၫ့အလးနီၪဆံၭ. တၭနၥံၪဘၪဆိၬန့ဝ့ၫလၧနၥံၪ ခၫ့ဂၬတၭ, အီၪက့ၪလၩ့ထးဝ့ၫ လၧဆၧမံၫအလးဖၧၩ့",
			"4": "<sup>4</sup> ထီးနၥံၪမိမံၫလနၩယီၩလီၫ.- တၭစယီရှုၫအ့ၫကိၭန့ၦ လဆံၫနံၫဂၩ, လၧအတဲၩ့ဝဲၩဝ့ၫလၧၦအံၫစရ့လၭဖိၪအ",
			"5": "<sup>5</sup> ကျၩလဒီၪ့လဂၩ လဒီၪ့လဂၩဆုၬဆုၬ,- တၭစယီရှုၫ အ့ၫစံၭအဝ့ၫၥံၪခၫ့ဂၬဆၧ လၧယဟိဝၩနၥံၪအယွၩအ တလၫအမ့ၬယၫလၧယီၫဒၫ့အၥၭကျၩတၭ, မၩန့နၥံၪ လၧလိးလဂၩလဖျိၪ့လဂၩလဖျိၪ့တၭ, ဆိၬထၪ့လၧနၥံၪ အခိၬထံၭခိၪဘဲၫၦအံၫစရ့လၭဖိၪ အဆၧဝံထၪ့နၬထၪ့",
			"6": "<sup>6</sup> အဒီၪ့လဖၪအၥိၭနီၪဆံၭ.- ဘဲၫၥိၭ အမိကဲၪထၪ့ဆၧ မၩနဲၪ့လၧနၥံၪအကျၩ ဘဲၫၥိၭထီးနၥံၪအဖိၪအလံၩအ့ၪ အၪ့စၪ့ဆၧကဲခိၬတၭ, စံၭဝ့ၫ, လိးလဖၪယီၩမွဲဘဲၫၥ့ၪ",
			"7": "<sup>7</sup> လဲၪနီၪ,- ထီးနီၪလဖၧၫ့နၥံၪမိဘၪလီၩဆၧၫ့အဝ့ၫၥံၪ, လၧယီၫဒၫ့အထံၫဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧယဟိဝၩ အဆၧအုၩ့လၩ့အတလၫအမ့ၬယၫ, ထီးအခၫ့ဂၬယီၫ ဒၫ့တၭ, ယီၫဒၫ့အထံၫဘၪဆၧဒၪ့ထ့ၬအၥၭတၭ, လိး လဖၪယီၩ မိကဲၪထၪ့ဆၧနၪ့ထၪ့ထဲၩ့လၧၦအံၫစရ့လၭ",
			"8": "<sup>8</sup> ဖိၪအဂးလၩ့ဆိၩလၩ့ကၠၪလီၫ.- တၭၦအံၫစရ့လၭဖိၪ မၩဝ့ၫဘဲၫစယီရှုၫအ့ၫမၪလူၬ ဆၧအၥိၭမၩန့ထၪ့လိး လဆံၫနံၫဖျိၪ့ လၧယီၫဒၫ့အၥၭကျၩနီၪ, ဘဲၫယဟိဝၩ ချဲၩ့ဆၧလၧစယီရှုၫအ့ၫတၭ, ဘဲၫၦအံၫစရ့လၭဖိၪအ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫအၥိၭတၭ, ဆိၬထၪ့န့အဝ့ၫၥံၪလၧ အခၫ့ဂၬခွံၬဝ့ၫ ထီၩ့လၧဆၧအလး လၧအမံၫဝ့ၫတၭ,",
			"9": "<sup>9</sup> အီၪက့ၪလၩ့ဆၧလဖၪထီးနီၪလီၫ.- တၭစယီရှုၫအ့ၫ အီၪက့ၪပိၩ့လိးလဆံၫနံၫဖျိၪ့ လၧဆၧမၩန့ယူၭဝ့ၫလၧ ယီၫဒၫ့အၥၭကျၩ ထီးအလးလၧၦလုဆၧလဖၪ လၧအ ဆိၬဆၧအုၩ့လၩ့အတလၫအခၪ့လဖၪ မိအီၪဆၧၫ့ထုၪ့",
			"10": "<sup>10</sup> တၭ, အီၪဝ့ၫထီးနီၪထီးမုဆၫလနံၩယီၩလီၫ.- အဂဲး ဘဲၫယီၩၦလုဆၧလဖၪ လၧအဆိၬတလၫနီၪ ဆၧၫ့ထုၪ့ လၧယီၫဒၫ့အၥၭကျၩ ထီးၦမၩဂီၩ့ကယဲဆၧလၧယဟိ ဝၩမၪလူၬစယီရှုၫအ့ၫ လၧအဘၪလီၩဘၪၦခမျၧး, ဘဲၫ ကယဲဆၧလၧစမိစ့ၭ မၪလူၬစယီရှုၫအ့ၫ အၥိၭနီၪတၭ,",
			"11": "<sup>11</sup> ၦခမျၧးမၩချဲၫ့ချဲၫ့တၭ, ခၫ့ဂၬဝ့ၫလီၫ.- ထီးၦခမျၧးထီး အလူၬ ခၫ့ဂၬခွံၬဂီၩ့တၭ, ဆၧမၩအၥၭလၧယဟိဝၩ အတလၫဒဲၦလုဆၧလဖၪခၫ့ဂၬ ဆၧလၧၦခမျၧးနီၪအ မ့ၬယၫလီၫ.",
			"12": "<sup>12</sup> တၭၦရုဘံၫ့ဖိၪ,ဒဲၦဂၭဖိၪ, ဒဲၦမနၭစ့ၫဖိၪလခီၫဒီၪ့ခၫ့ ဂၬဆၧအီၪဝ့ၫလၧအစူၪဝဲၩ လၧၦအံၫစရ့လၭဖိၪအမ့ၬ ယၫ, ဘဲၫစမိစ့ၭချဲၩ့ဆၧ လၧအဝ့ၫၥံၪအၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> ၦလံလၬလၧအတဲၩ့ဝဲၩအၥၭ လၧဆၧဒုၭၥုၭအဂးနီၪ ခၫ့ဂၬဆၧလၧ ယဟိဝၩအမ့ၬယၫ လၧဆၧဒုၭၥုၭအ ဖၧၩ့လၧယ့ၫရခိၫအဆၧပျၩ့ဖၧၩ့နီၪလီၫ.",
			"14": "<sup>14</sup> ဆၧလၧမုလနံၩနီၪ ယဟိဝၩအီၪက့ၪဒိၪ စယီရှုၫ အ့ၫလၧအံၫစရ့လၭ ထီးအလူၬအမ့ၬယၫတၭ, အဝ့ၫ ၥံၪၥၭမဲၪဝ့ၫ, ဘဲၫအၥၭမဲၪစမိစ့ၭအၥိၭနီၪ လဆိၩဒၪ အၥၭလီၫ.",
			"15": "<sup>15</sup> ယဟိဝၩချဲၩ့ဆၧလၧ စယီရှုၫအ့ၫတၭ, စံၭဝ့ၫဒၪ,",
			"16": "<sup>16</sup> မၪလူၬၦလုဆၧလဖၪ လၧအဆိၬဆၧအုၩ့လၩ့အတလၫ နီၪဘဲၫၥိၭအမိဂဲၫထၪ့ခွံၬ လၧယီၫဒၫ့အဖၧၩ့နီၪဆံၭ.",
			"17": "<sup>17</sup> အခိးမွဲစယီရှုၫအ့ၫမၪလူၬၦလုဆၧလဖၪနီၪ, စံၭဝ့ၫဒၪ, ဂဲၫထၪ့ခွံၬနၥံၪဝ့ၫလၧယီၫဒၫ့အဖၧၩ့နီၪဘီၪ.",
			"18": "<sup>18</sup> ထီးၦလုဆၧလဖၪ လၧအဆိၬယဟိဝၩအဆၧအုၩ့ လၩ့အတလၫဂဲၫထၪ့ခွံၬ လၧယီၫဒၫ့အၥၭကျၩဂီၩ့,ဒဲၦ လုဆၧလဖၪအခၪ့ယၫၥၭခၫထၪ့လခီၫတၭ, ဆၧမၩအ ၥၭလၧယီၫဒၫ့အထံၫဂဲၫထဲၩ့လၩ့ လၧအလးတၭ, လုၬ ဘံၭထံၫနဲၩ့ဘဲၫလၧအခၪ့ထံၭလၧမီခိၬအၥိၭနီၪလီၫ.",
			"19": "<sup>19</sup> တၭလၧလၩခၪ့ထံၭ လၩထၪ့ဆံၫနံၩလနံၩနီၪ,ၦခ မျၧးဂဲၫထၪ့ခွံၬ လၧယီၫဒၫ့အဖၧၩ့တၭ, ၥုၪ့အတဲၩလၧ ဂံလဂၫလၭအဖၧၩ့ လၧယ့ၫရခိၫ အနဲၩ့ထံၭလၧမုထၪ့",
			"20": "<sup>20</sup> လခီၫနီၪလီၫ.- တၭလိးလဆံၫနံၫဖျိၪ့ လၧအမၩန့ထၪ့ ဝ့ၫလၧယီၫဒၫ့အဖၧၩ့နီၪ စယီရှုၫအ့ၫအီၪက့ၪဝ့ၫလၧဂံ",
			"21": "<sup>21</sup> လဂၫလၭအဖၧၩ့နီၪလီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧလၧၦအံၫ စရ့လၭဖိၪတၭ, စံၭဝ့ၫဒၪ, ထီးနၥံၪအဖိၪအလံၩမိအၪ့ စၪ့အဖါကဲခိၬတၭ, စံၭဝ့ၫ,လိးလဖၪယီၩမွဲဘဲၫၥ့ၪလဲၪ",
			"22": "<sup>22</sup> နီၪ,- တၭနၥံၪမိဘၪလီၩထဲၩ့ မၩၥ့ၪယၫနၥံၪအဖိၪအ လံၩတၭ, စံၭ,အံၫစရ့လၭ ခၫ့ဂၬယီၫဒၫ့ယီၩ လၧခီၫ့",
			"23": "<sup>23</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩနၥံၪအယွၩမၩလၩ့ၥံၭ ခွံၬယီၫဒၫ့အထံၫလၧနၥံၪအမ့ၬယၫ ထီးနၥံၪခၫ့ဂၬဆၧ ဘဲၫယဟိဝၩနၥံၪအယွၩမၩဝ့ၫ လၧမၫဆမံၭဝီၩအၥိၭ နီၪ,လၧအမၩလၩ့ၥံၭခွံၬ လၧပမ့ၬယၫထီးပခၫ့ဂၬခွံၬ,",
			"24": "<sup>24</sup> ဘဲၫၥိၭၦဂၪ့ခိၪဖိၪထီးအလူၬ မိၥ့ၪယၫယဟိဝၩအစူၪ အဂဲးအကၠီၪ့လၧအဆီၪ့ဝ့ၫ, ဘဲၫၥိၭနၥံၪမိၥၭမဲၪယဟိ ဝၩနၥံၪအယွၩအဆိၩအကၠၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ထီးၦအၫမိၫဖိၪ အစဎွၩၥံၪထီးအလူၬ, လၧအအီၪ လၧယီၫဒၫ့အမုနုၬလခီၫ, ဒဲၦကၫနအၫ့ဖိၪအစဎွၩၥံၪ လၧအအီၪ လၧမၫဆမံၭအနဲၩ့ထံၭထီးအလူၬလဖၪနါ ဂၧၫ့ဝ့ၫလၧယဟိဝၩမၩလၩ့ၥံၭခွံၬ ယီၫဒၫ့အထံၫလၧ ၦအံၫစရ့လၭဖိၪ အမ့ၬယၫထီးအခၫ့ဂၬခွံၬ ဆၧတၭ, ဆၧမၩအၥၭ လၧအဝ့ၫၥံၪအၥၭဖံၪထၪ့ခွံၬဝ့ၫတၭ, အ ၥၭလအီၪလၧၩ့ဘၪလၧအဖၧၩ့ လၧၦအံၫစရ့လၭဖိၪ အကၠီၩ့နီၪလီၫ.",
			"2": "<sup>2</sup> အထီနီၪယဟိဝၩစံၭ စယီရှုၫအ့ၫ, တဲၩ့ဝဲၩဒီၩလိး မ့ၪလဖၪလၧနဂးတၭ, ကူၭတရံၭဒီၭၦအံၫစရ့လၭဖိၪ",
			"3": "<sup>3</sup> နံၫဘျၩ့လဘျၩ့ဆံၭ.- တၭစယီရှုၫအ့ၫ တဲၩ့ဝဲၩဒီၩလိး မ့ၪလၧအဂးတၭ, ကူၭတရံၭၦအံၫစရ့လၭဖိၪလၧဆၧ",
			"4": "<sup>4</sup> စီၩ့ခိၪအဆၧခိၪဖံၭလဖၪလီၫ.- တၭစယီရှုၫအ့ၫကူၭ တရံၭဆၧ, အဂဲးဘဲၫယီၩကယဲၦခမျၧးအခွၫလၧအဂဲၫ ထၪ့လၧအံဇံၭ, ၦၥုၭဖိၪထီးအလူၬ ၥံၫဝ့ၫလၧၡါမုနၧၫ့ ဖၫလၧဖၧၩ့ၥၭ လၧအစဲၪ့ထၪ့ လၧအံဇံၭအလးခဲၫ့နီၪ",
			"5": "<sup>5</sup> လီၫ.- တၭကယဲၦလၧအဂဲၫထၪ့ ထီးအလူၬနီၪဒိၭ ဆၧကူၭတရံၭလီၫ. အ့ၪမွဲၦလၧအအီၪဖျဲၪ လၧၡါမု နၧၫ့ဖၫအဖၧၩ့ၥၭ, လၧအစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭအလး",
			"6": "<sup>6</sup> ခဲၫ့နီၪဒိၭဘၪ ဆၧကူၭတရံၭနးဂၩအ့ၬ.- အဂဲးဘဲၫ ယီၩၦအံၫစရ့လၭဖိၪ လ့ၩဆၧအနံၪ့လံဆံၫ လၧၡါမု နၧၫ့ဖၫထီးကယဲၦၥုၭဖိၪ လၧအစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭ လူၬဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪခိၭနၪယဟိဝၩအ လူအ့ၬး မွဲၦလၧယဟိဝၩဆိၪလၩ့အၥၭ လၧအဝ့ၫၥံၪ လၧအလဒုၭနဲၪဘၪဝ့ၫခးလဘံၪ့ လၧယဟိဝၩဆိၪလၩ့ အၥၭလၧအဖါလဖၪ လၧအမိဖ့ၪလၫ့ပၧၩ ခးလဘံၪ့",
			"7": "<sup>7</sup> လၧအယွၩလၩ့ဝ့ၫလၧဆၧနူထံၫ, ဒဲန့ၫစၩ့လီၫ.- တၭ အဝ့ၫၥံၪအဖိၪလဖၪ လၧအဒုၭဂဲထုၪ့ လၧအဝ့ၫၥံၪအ လးနီၪစယီရှုၫအ့ၫကူၭတရံၭဝ့ၫ ၦလၧအလဒိၭဒံၭဘၪ ဆၧကူၭတရံၭအကၠီၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအဒိၭ",
			"8": "<sup>8</sup> ဆၧကူၭတရံၭလၧဖၧၩ့ၥၭအ့ၬ.- ထီးအကူၭတရံၭၦခ မျၧးထီးအလူၬဂီၩ့တၭ, ဆၧမၩအၥၭလၧအဝ့ၫၥံၪအီၪ လၧအလးဒၪဝ့ၫ လၧၦၥုၪ့တဲၩအလးဖၧၩ့နီၪ ထီးအ",
			"9": "<sup>9</sup> ဘျၪထဲၩ့ဝ့ၫလီၫ.- တၭယဟိဝၩစံၭစယီရှုၫအ့ၫ,လၧမု ဆၫလနံၩယီၩ, ယပၠၪလၩ့ခွံၬ ၦအံဇံၭဖိၪအဆၧဒုၪဒွ့ၪ လၧနၥံၪအလီၩ့လီၫ. တၭဆၧအလးလစီၪ့နီၪ အမံၩ့မွဲ ဂံလဂၫလၭ ထီးမုဆၫလနံၩယီၩလီၫ.",
			"10": "<sup>10</sup> ၦအံၫစရ့လၭဖိၪ ၥုၪ့တဲၩလၧဂံလဂၫလၭအဖၧၩ့တၭ, မၩဘိၪ့လ့ၩဖၬလၧလၩထၪ့လဆံၫလံနံၩ လၧမုဂၪလၩ့ လၧယ့ၫရခိၫအဆၧပျၩ့ဖၧၩ့နီၪလီၫ.",
			"11": "<sup>11</sup> တၭအဝ့ၫၥံၪအၪ့ဝ့ၫလၧ ခးအဘုၪလးလံၩလၧမုဆဲၪ့ ထၪ့လနံၩလၧဘိၪ့လ့ၩဖၬ အလးခဲၫ့နီၪ, ကိၪပၪပဲၪၥံၪ",
			"12": "<sup>12</sup> လအီၪဘၪလၧမံၪဒဲဘုၪဝ့ၬဝ့ၫ လၧမုလနံၩဎးလီၫ.-တၭ အဝ့ၫၥံၪအၪ့ခးအဘုၪလးလံၩအလးခဲၫ့, လၧဆၧဖၩ့ ထၪ့လနံၩနီၪမၪ့နၫအီၪထီဝ့ၫလီၫ. တၭၦအံၫစရ့လၭ ဖိၪန့လၧၩ့မၪ့နၫအ့ၬ. အ့ၪမွဲအအၪ့ခးကၫနအၫ့အဆၧ ၥၪလၧလနံၪ့နီၪလီၫ.",
			"13": "<sup>13</sup> တၭထီးစယီရှုၫအ့ၫအီၪဝ့ၫ လၧယ့ၫရခိၫအနဲၩ့ထံၭ နီၪ,ဆၧမၩအၥၭ လၧအကျဲၪ့ထၪ့အမ့ၬ ယိဆၧတၭ, ယိခွါ,ၦဆၧၫ့ထုၪ့ လၧအမ့ၬယၫလၧအနၭထုၭထၪ့အ ၥၭအီၪဝ့ၫလၧအစူၪဖၧၩ့တၭ, စယီရှုၫအ့ၫလ့ၩထၪ့လၧ အအီၪတၭစံၭဝ့ၫ, မွဲနအီၪလၧပဂး, နအီၪလၧပဒုၪပဒၩ",
			"14": "<sup>14</sup> အဂးလဲၪ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ, မွဲအ့ၬး မွဲယဂဲၫဘိၩ့နဲၪ့ ယီၩ, ယဟိဝၩအဆၧၥုၭမုအခိၪလီၫ. တၭစယီရှုၫအ့ၫ ထိၪလၩ့ထံၩဖါအၥၭ လၧဂၪ့ခိၪတၭ, ဘၩထၪ့ဆၧတၭ,",
			"15": "<sup>15</sup> စံၭအဝ့ၫ, ယကဆါမိစံၭအခ့ၫအၡၩဘဲၫၥ့ၪလဲၪ.- တၭ ယဟိဝၩအၥုၭမုအခိၪလဂၩနီၪစံၭ စယီရှုၫအ့ၫဘဲၪ့ လၩ့ခွံၬနခၪ့ဖံၭလၧနခၪ့ဆံၭ. အဂဲးဘဲၫယီၩ ဆၧအလး ထီးနဆၧၫ့ထုၪ့နီၪ မွဲဆံၫ့ဎံၪဝ့ၫလီၫ. တၭစယီရှုၫအ့ၫ မၩဝ့ၫဘဲၫနီၪလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> (တၭယ့ၫရခိၫနီၪ ဘၪဆၧကၭဘံၭထၬဝ့ၫလၧၦအံၫ စရ့လၭဖိၪအကၠီၩ့လီၫ. ၦၡၩစဲၪ့ထၪ့နးဂၩအ့ၬ, ဒဲဂဲၫ",
			"2": "<sup>2</sup> နုၬနးဂၩဆ့အ့ၬ.)- တၭယဟိဝၩစံၭစယီရှုၫအ့ၫ, ယိ ခွါ,ယဖ့ၪလၫ့ယ့ၫရခိၫဒဲအစဎွၩ, ဒဲအၥုၭဖိၪ, ၦအဂဲး",
			"3": "<sup>3</sup> အဘၭဆီၪ့လဖၪလၧနစူၪဖၧၩ့လီၫ.- တၭနၥံၪဝ့ၫၦၥုၭ ဖိၪထီးအလူၬမိဘၪလ့ၩဝၩ့ထဲၩ့ဒိၩ့, တၭ,လ့ၩဎဲၪ့ဒိၩ့ လဘျၩ့လီၫ. နၥံၪမိဘၪမၩဘဲၫနီၪ ဎူၫနံၩအထးဖၧၩ့",
			"4": "<sup>4</sup> လီၫ.- တၭၦလုဆၧလဖၪနွ့ၫဂၩ မိဘၪဆိၬယုဘလံၫအ ခွ့ၩနွ့ၫဖျိၪ့လၧတလၫအမ့ၬယၫတၭ, နွ့ၫနံၩလနံၩနီၪန ၥံၪမိဘၪလ့ၩဎဲၪ့ဒိၩ့နီၪ နွ့ၫဘျၩ့တၭ, ၦလုဆၧလဖၪမိ",
			"5": "<sup>5</sup> ဘၪအူၪထၪ့ခွ့ၩလီၫ.- ထီးအအူၪၡိၫဆၧယံၬယံၬလၧ ယုဘလံၫအခွ့ၩနီၪ, ထီးနၥံၪနါဂၧၫ့အၥီၫတၭ, ဆၧမိမၩ အၥၭလၧၦခမျၧး မိဘၪကိၭၡၭထၪ့ လၧအၥီၫဖၭဒိၪ တၭ,ဒိၩ့အခိၪဒၧၩ့မိလၩ့ဎီးခွံၬလၩ့ဒၩဝ့ၫတၭ, ၦခမျၧး မိဘၪလ့ၩထၪ့, လဂၩထီးအလးလီၩ့ လၧအမ့ၬယၫ ဆုၬဆုၬကိၭဂၩဒ့ၭလီၫ.",
			"6": "<sup>6</sup> တၭစနိၫ့အဖိၪခွၫစယီရှုၫအ့ၫကိၭန့ ၦလုဆၧလဖၪ တၭစံၭအဝ့ၫၥံၪ, မၩန့ထၪ့ဆၧအုၩ့လၩ့အတလၫ, ဒဲၦ လုဆၧနွ့ၫဂၩဘၪဆိၬ ယုဘလံၫအခွ့ၩနွ့ၫဖျိၪ့လၧယဟိ",
			"7": "<sup>7</sup> ဝၩအတလၫအမ့ၬယၫလီၫ.- စံၭၦခမျၧးနီၪ, လ့ၩဒၪခ လူၬတၭ, လ့ၩဎဲၪ့ဒိၩ့နီၪဆံၭ. တၭၦလၧအအီၪလၧအ စူၪဝဲၩနီၪမွဲအလ့ၩကဒၪ လၧယဟိဝၩအတလၫအမ့ၬ ယၫနီၪဆံၭ.",
			"8": "<sup>8</sup> ထီးစယီရှုၫအ့ၫချဲၩ့ဆၧ လၧၦခမျၧးဂီၩ့တၭ, ဆၧ မၩအၥၭလၧၦလုဆၧလဖၪ နွ့ၫဂၩဆိၬယုဘလံၫအခွ့ၩ နွ့ၫဖျိၪ့လဖၪနီၪလ့ၩဝ့ၫဒၪ လၧယဟိဝၩအမ့ၬယၫ,အူၪ ထၪ့ခွ့ၩတၭ, ယဟိဝၩအဆၧအုၩ့လၩ့အတလၫနီၪဖိၬ",
			"9": "<sup>9</sup> အခဲၫ့လီၫ.- ၦအီၪလၧအစူၪဝဲၩလဖၪနီၪ လ့ၩဝ့ၫလၧၦ လုဆၧလဖၪလၧအအူၪထၪ့ခွ့ၩအမ့ၬယၫတၭ, ၦၥုၭဖိၪ လၧခဲၫ့လဒီၪ့လ့ၩဝ့ၫလၧတလၫအလးခဲၫ့နီၪ, ၦလုဆၧလ",
			"10": "<sup>10</sup> ဖၪလ့ၩဆၧ, ဒဲအူၪထၪ့ခွ့ၩလဖၪနီၪလီၫ.- စယီရှုၫအ့ၫ မၪလူၬၦခမျၧးတၭ, စံၭဝ့ၫဒၪ, နၥံၪကိၭၡၭထၪ့ဘၪအ့ၬ, ဒဲနၥံၪမၩၥီၫဘၪဆၧ လၧနၥံၪအလူနးမံၩ့အ့ၬး ဒဲဆၧ ချဲၩ့ထၪ့ဖျ့ၭဘၪလၧနၥံၪအနိၭနးမံၩ့ဆ့အ့ၬ, ထီၩ့လၩ့ လၧမုလနံၩ လၧယမၪလူၬနၥံၪဘဲၫၥိၭ နၥံၪမိကိၭၡၭ ထၪ့နီၪလီၫ. ထီးနီၪလဖၧၫ့နၥံၪမိဘၪကိၭၡၭထၪ့လီၫ.",
			"11": "<sup>11</sup> တၭယဟိဝၩအတလၫနီၪ လ့ၩဎဲၪ့လဘျၩ့တၭ,ဂဲၫထဲၩ့ ထဲၩ့လၧၦၥုၪ့တဲၩအလးတၭ, အီၪလၧမုနၩလခီၫလၧ ၦၥုၪ့တဲၩအလးဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> တၭဆၧဖၩ့ထၪ့နီၪ စယီရှုၫအ့ၫ ဂဲထုၪ့ဂီၩဂီၩတၭ,",
			"13": "<sup>13</sup> ၦလုဆၧလဖၪ မၩန့ထၪ့ယဟိဝၩအတလၫ,- ဒဲၦလု ဆၧနွ့ၫဂၩဆိၬယုဘလံၫအခွ့ၩနွ့ၫဖျိၪ့ လၧယဟိဝၩအ တလၫအမ့ၬယၫနီၪ လ့ၩဆၧဘီၩ့ဎးတၭး အူၪထၪ့ခွ့ၩ တၭၦအီၪလၧအစူၪဝဲၩလဖၪနီၪ လ့ၩဝ့ၫလၧအမ့ၬယၫ လီၫ. အ့ၪမွဲၦၥုၭဖိၪလၧခဲၫ့လဒီၪ့လ့ၩဝ့ၫ လၧယဟိဝၩ အတလၫအလးခဲၫ့လီၫ. ၦလ့ၩဝ့ၫတၭ, အူၪထၪ့ခွ့ၩနီၪ",
			"14": "<sup>14</sup> လီၫ.- တၭနံၫနံၩလနံၩနီၪ အဝ့ၫၥံၪလ့ၩဎဲၪ့ဒိၩ့နီၪလ ဘျၩ့တၭ, ဂဲၫထဲၩ့ထဲၩ့လၧၦၥုၪ့တဲၩအလးဖၧၩ့လီၫ. တၭမၩဝ့ၫဘဲၫနီၪၥိၭဎူၫနံၩ အထးဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> ဆၧမၩအၥၭ လၧနွ့ၫနံၩလနံၩနီၪ လၧအဝ့ၫၥံၪ ဂဲ ထုၪ့ဂီၩဂီၩလ့ၬ လၧမုဆဲၪ့ထၪ့နီၪတၭ, လ့ၩဎဲၪ့ဒိၩ့နီၪ ဘဲၫနီၪၥိၭနွ့ၫဘျၩ့လီၫ. တၭအဝ့ၫၥံၪလ့ၩဎဲၪ့ဒိၩ့နွ့ၫ",
			"16": "<sup>16</sup> ဘျၩ့လနံၩဎးနီၪ မွဲန့ၫအနီၪလနံၩလီၫ.- တၭဆၧမၩ အၥၭလၧနွ့ၫဘျၩ့လဘျၩ့နီၪ, ထီးၦလုဆၧလဖၪအူၪ ထၪ့ခွ့ၩတၭ, စယီရှုၫအ့ၫစံၭၦခမျၧး, ကိၭၡၭထၪ့ဘီၪး အဂဲးဘဲၫယီၩ ယဟိဝၩဖ့ၪလၫ့ယူၭနၥံၪ လၧဒိၩ့ယူၭ,",
			"17": "<sup>17</sup> တၭဒိၩ့နီၪမိဘၪဆၧဆိၪအၧၩ့, ဒဲကယဲဆၧအီၪလၧအ ဖၧၩ့လၧယဟိဝၩအဂးလီၫ. ၦမိမၧၫ့ဒံၭန့ၫ ၦမဲၩဎွဲၩ မုၪနးရၫဟၭ, ဒဲကယဲၦလၧအအီၪဝ့ၫ လၧအဂံၪ့ဖၧၩ့ နီၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအအီၪက့ၪၥူၪ အၥီၫ့လဖၪ",
			"18": "<sup>18</sup> လၧပအၪ့မၧၫ့လၩ့ဝ့ၫနီၪလီၫ.- တၭထီးလၩ့ နၥံၪအ ၥၭလၧဆၧဘၪဆိၪအၧၩ့တၡါဆံၭ. ထီးနၥံၪမၩန့ဆၧ ဆိၪအၧၩ့, ဒဲအၪ့မၧၫ့အံၫစရ့လၭထၧၫ့ဒီၪ့ယၫကဲၪထၪ့ ဆၧအၧၩ့ ဒဲမၩခိမၩဝီၩဝ့ၫတၭ, နၥံၪမိကဲၪထၪ့ဘၪခိၬ",
			"19": "<sup>19</sup> ဆၧဆိၪအၧၩ့နၥံၪဝ့ၫလီၫ.- အ့ၪမွဲကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ ၥံၪလွ့ၫၥံၪ, ဒဲထွ့ၫထီးဂီၩဒဲထွ့ၫထၭ ထီးအလူၬနီၪဘၪ ဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫလၧယဟိဝၩအဂးလီၫ. အဝ့ၫ ၥံၪနီၪမိဘၪဂဲၫနုၬလၧယဟိဝၩ အဆၧအီၪက့ၪကီၪ့အ လးဖၧၩ့နီၪလီၫ.",
			"20": "<sup>20</sup> ၦကိၭၡၭထၪ့, ဒဲအူၪထၪ့ခွ့ၩတၭ, ထီးၦခမျၧးနါဂၧၫ့ ခွ့ၩအၥီၫတၭ, ၦခမျၧးကိၭၡၭထၪ့ လၧဆၧၥီၫဖၭဒိၪ တၭ,ဆၧမၩအၥၭလၧဒိၩ့ခိၪဒၧၩ့လၩ့ဎီးလၩ့ဒၩတၭ, ၦခမျၧးလ့ၩနုၬ လၧဒိၩ့ဖၧၩ့, လဂၩလီၩ့ လၧဆၧအီၪ လၧအမ့ၬယၫဆုၬဆုၬကိၭအဂၩဒ့ၭတၭ, အဝ့ၫၥံၪမၩ",
			"21": "<sup>21</sup> န့ဒိၩ့လီၫ.- တၭအဝ့ၫၥံၪ မၩဂၭဂီၩ့ကယဲဆၧအီၪလၧ ဒိၩ့ဖၧၩ့ လၧၦခွၫဖိးလၧၦမုၪ, လၧၦအၥၭဘၪ့ဖိးလၧၦ အၥၭၡါ, ဒဲချီ, ဒဲၥိၪဒဲဘ့ၪ, ဒဲကၥ့ၪယီၩ့နီၪလၧနၭအနါ ထီးအလူၬလီၫ.",
			"22": "<sup>22</sup> အ့ၪမွဲစယီရှုၫအ့ၫစံၭဝဲၩၦနံၫဂၩ, လၧအယိၥူၪခးနီၪ လ့ၩနုၬလၧၦမဲၩဎွဲၩမုၪအဂံၪ့ဖၧၩ့ ဒဲဂဲၫထဲၩ့ဆိၬန့ခွံၬၦ မုၪ,ဒဲကယဲဆၧအီၪဝ့ၫလၧအၥိၭ, ဘဲၫနၥံၪဆိၪလၩ့န",
			"23": "<sup>23</sup> ၥံၪအၥၭအၥိၭနီၪဆံၭ.- ဖိၪၥၪခွၫလၧအယိၥူၪဆၧလ ဖၪနီၪလ့ၩနုၬတၭ, ဂဲၫထဲၩ့ဆိၬနးရၫဟၭ, ဒဲအဖါ, ဒဲ အမိ,ဒဲအထၧၫ့ဖုဝဲလဖၪ, ဒဲကယဲဆၧလၧအအီၪလၧအ ၥိၭတၭ, ဂဲၫထဲၩ့ဆိၬအဘူၭအထံးထီးအလူၬတၭ, အီၪ က့ၪလၩ့ထးဝ့ၫ လၧအံၫစရ့လၭ ၥုၪ့တဲၩအလးလၧခီၫ့ လီၫ.",
			"24": "<sup>24</sup> တၭအဝ့ၫၥံၪဆူၭထၪ့ခွံၬဒိၩ့, ဒဲကယဲဆၧအီၪလၧအ ဖၧၩ့လၧမ့ၪလီၫ. အ့ၪမွဲအဒုၭနုၬ ကျိၪၥံၪစ့ၩၥံၪ, ဒဲထီၫ့ ၥံၪလွ့ၫၥံၪ, ဒဲထွ့ၫထီးဝီၩ, ဒဲထွ့ၫထၭ, လၧယဟိဝၩအ ဂံၪ့အဆၧအီၪက့ၪကီၪ့အလးဖၧၩ့နီၪလီၫ.",
			"25": "<sup>25</sup> တၭစယီရှုၫအ့ၫ ဒုၭမၧၫ့ဒံၭ မဲၩဎွဲၩမုၪ နးရၫဟၭ,ဒဲ အဖါအၡၩဂံၪ့ဖိၪ, ဒဲကယဲအဆၧအီၪထီးအလူၬလီၫ. တၭၦမုၪနီၪအီၪဝ့ၫလၧအံၫစရ့လၭအကျၩ ထီးမုဆၫ လနံၩယီၩလီၫ. အဂဲးဘဲၫယီၩ မွဲအအီၪက့ၪၥူၪအၥီၫ့ လဖၪလၧစယီရှုၫအ့ၫအၪ့မၧၫ့လၩ့ဝ့ၫ ဘဲၫၥိၭအမိယိခွါ ယ့ၫရခိၫနီၪလီၫ.",
			"26": "<sup>26</sup> အထီထီးနီၪစယီရှုၫအ့ၫဒုၭဆိၪလၩ့ အဝ့ၫၥံၪအၥၭ တၭ,စံၭဝ့ၫဒၪ, ၦလၧအဂဲထုၪ့မၩကဲၪထၪ့ထဲၩ့ဒိၩ့ယ့ၫ ရခိၫလဒိၩ့ယီၩ, မွဲအဘၪဆၧဆိၪအၧၩ့ လၧယဟိဝၩ အမ့ၬယၫဆံၭ, မွဲအမိအီၪက့ၪအခၪ့ထံၭလဖၪလၧအ ဖိၪဝဲၡါအဖၫ့ခိၪ, ဒဲမိမၩထၪ့ အတရၫ့ လၧအဖိၪဒၪ ဘၨၩအဖၫ့ခိၪလီၫ.",
			"27": "<sup>27</sup> ယဟိဝၩအီၪလၧစယီရှုၫအ့ၫအၥိၭတၭ, အမံၩ့ဂၧၫ့ ထၪ့ၥၩလၩ့ လၧခးထၧၫ့ဘံၪ့ယၫ အဖၧၩ့နီၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> အ့ၪမွဲၦအံၫစရ့လၭဖိၪ မၩမၪဆၧလၧဆၧဆိၪအၧၩ့ လၧအဖၧၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩ ၦယုဒၫအဒီၪ့ဖိၪ,စ ကၫမဲၫအဖိၪခွၫ,စဇၭဘဒံၫအဖိၪခွၫ, စဇံရၫအဖိၪခွၫ, စအၫခၫ့လဂၩ မၩန့ဆၧ ဘၪဆၧဆိၪအၧၩ့နီၪလီၫ. တၭယဟိဝၩ အၥၭထၪ့ ခဲၩထၪ့ဘၪ ၦအံၫစရ့လၭဖိၪ လီၫ.",
			"2": "<sup>2</sup> တၭစယီရှုၫအ့ၫအၪ့မၧၫ့ ၦစဲၪ့ထၪ့ခွံၬလၧယ့ၫရခိၫ လ့ၩထီၩ့လၧဟဲၫလၧအအီၪဝ့ၫ လၧဘ့ၭၥအ့ဝံၫ့အနဲၩ့ ထံၭလၧဘ့ၫၥလၭ မုထၪ့လခီၫနီၪ, ချဲၩ့ဆၧလၧအဝ့ၫ ၥံၪတၭ,စံၭဝ့ၫဒၪ, လ့ၩထၪ့တၭယိၥူၪထံၫၥံၪခးၥံၪနီၪ ဘီၪးၦလဖၪနီၪ လ့ၩထၪ့ဝ့ၫတၭ ယိၥူၪဟဲၫနီၪလီၫ.",
			"3": "<sup>3</sup> အဝ့ၫၥံၪဂဲၫထဲၩ့ထဲၩ့ လၧစယီရှုၫအ့ၫအအီၪတၭ, စံၭ အဝ့ၫဒၪ, ဒုၭလ့ၩထၪ့ၦခမျၧးထီးအလူၬလဂ့ၩ, အ့ၪမွဲ ဒုၭလ့ၩၦနံၫထီၫ့ ၥၧၫ့ထီၫ့ ဘဲၫၥိၭအမိဖ့ၬခွံၬ ဟဲၫနီၪ ဆံၭ,ဒုၭမၩၦခမျၧး ထီးအလူၬနီၪလဂ့ၩး အဂဲးဘဲၫ",
			"4": "<sup>4</sup> ယီၩအဝ့ၫၥံၪမွဲၦၡၩခိၬဂၩလီၫ.- ၦၥၧၫ့ထီၫ့ကၪယူၭ လၧၦခမျၧးအကျၩနီၪလ့ၩထၪ့ဝ့ၫတၭ, အဝ့ၫၥံၪစဲၪ့ခွံၬ",
			"5": "<sup>5</sup> ဝ့ၫလၧၦဟဲၫဖိၪအမ့ၬယၫလီၫ.- တၭၦဟဲၫဖိၪဖ့ၬခွံၬ ၦၥၧၫ့ဆံၫဎူၫဂၩလၧအကျၩလီၫ. အဂဲးဘဲၫယီၩမွဲအ လီၩ့ဆီးဝ့ၫလၧဒိၩ့အတရၫ့ အမ့ၬယၫဖိးလၧၡ့ဘရံၫ့ တၭ,ဖ့ၬခွံၬအဝ့ၫၥံၪ ဖိးလၧဆၧလၩ့ဆိၬ အဖၧၩ့လီၫ. ၦခမျၧးအၥၭဖံၪထၪ့ခွံၬတၭ, မၩအၥၭဘဲၫထံၫအၥိၭ နီၪလီၫ.",
			"6": "<sup>6</sup> စယီရှုၫအ့ၫ ၡၫ့အကီၩ့အၥိၭတၭ, ထိၪလၩ့ထံၩဖါ အၥၭလၧဂၪ့ခိၪလၧယဟိဝၩ အတလၫအမ့ၬယၫထီး မုဂၪလၩ့လီၫ. အဝ့ၫဒၪ ဒဲၦအံၫစရ့လၭဖိၪ အၥုၪ့က့ၭ ၥၭၡါနီၪ,အီၪက့ၪဂၪ့ခိၪအမုၬ လၧအခိၪအလီၩ့လီၫ.",
			"7": "<sup>7</sup> တၭစယီရှုၫအ့ၫစံၭဝ့ၫဒၪ, အၩလါၬ ယဟိဝၩယွၩဧ့, နဒုၭခၫ့ဂၬ ၦခမျၧးလၧယီၫဒၫ့ ဘဲၫၥိၭနမိဖ့ၪလၫ့ပၧၩ လၧၦအၫမိၫဖိၪအစူၪဖၧၩ့ လၧအမိမၩဂၭဂီၩ့ပၧၩယီၩ, မွဲဘၪလဲၪ. မွဲလၧပမံၫ့ၥုၪ့မံၫ့ၥၭယူၭ, ဒဲပအီၪဝဲၩလၧ",
			"8": "<sup>8</sup> ယီၫဒၫ့ဝါလခီၫနီၪဂ့ၩဒၪဆၧဒံၭ.- ကဆါဧ့, ထီးအံၫစ ရ့လၭကၠၪဒိၭချိၫ့အၥၭ လၧအဒုၪအဒၩအမ့ၬယၫတၭ,",
			"9": "<sup>9</sup> ယမိစံၭဘဲၫၥ့ၪလဲၪ!- အဂဲးဘဲၫယီၩၦကၫနအၫ့ဖိၪ,ဒဲ ၦခးဖိၪထီးအလူၬမိနါဂၧၫ့တၭ, မိဝၩ့ထဲၩ့ပၧၩတၭ,မိ ဒၪ့ထ့ၬခွံၬ ပမံၩ့လၧဂၪ့ခိၪချိၫ့တၭ, မွဲနမိမၩဆၧနီၪလၫ လၧနမံၩ့ဖၭဒိၪနီၪလမံၩ့လဲၪ.",
			"10": "<sup>10</sup> တၭယဟိဝၩစံၭစယီရှုၫအ့ၫ, ဂဲထုၪ့နဝ့ၫ,နထိၪလၩ့",
			"11": "<sup>11</sup> ထံၩဖါနၥၭနီၪမွဲဘၪလဲၪ.- အံၫစရ့လၭမၩယူၭဆၧဒဲၩ ဘၭတၭ, မွဲအလၨၪခၫ့ဖၬယူၭယဆၧအုၩ့လၩ့လၧယမၪ လူၬဝ့ၫယူၭး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမၩန့ဆၧဘၪဆိၪ အၧၩ့တၭ, အၪ့ဂူၪဆၧ, ဒဲအၪ့လီၫဆၧဆ့တၭ, အီၪက့ၪ",
			"12": "<sup>12</sup> ဝ့ၫလၧအဆၧဖိၪဆၧလံၩ ဒၪဝ့ၫအကျၩလီၫ.- အခိးမွဲ ဘဲၫနီၪတၭ ၦအံၫစရ့လၭဖိၪဆၧၫ့ထုၪ့လၧအဒုၪအဒၩ အမ့ၬယၫၥ့ၪအ့ၬး ကၠၪဒိၭချိၫ့အၥၭလၧအဒုၪအဒၩအ မ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩ ဘၪဆၧဆိၪအၧၩ့ဝ့ၫလီၫ. တၭနၥံၪအ့ၪလမိမၩဂၭဂီၩ့ဘၪ ဆၧဆိၪအၧၩ့ လမံၩ့ လၧနၥံၪအကျၩတၭ, ယအီၪလၧၩ့ လၧနၥံၪ အၥိၭ",
			"13": "<sup>13</sup> အ့ၬ.- ဂဲထုၪ့ဘီၪ, မၩဆံၫ့ဎံၪၦခမျၧးတၭ, စံၭ,မၩဆံၫ့ ဎံၪထၪ့ နၥံၪအၥၭ လၧကဲဂီၩခိၬ အဂးနီၪဆံၭ. အဂဲး ဘဲၫယီၩယဟိဝၩအံၫစရ့လၭအယွၩ စံၭဝ့ၫဘဲၫယီၩ, ဆၧဘၪဆိၪအၧၩ့အီၪဝ့ၫ လၧနၥံၪအကျၩလမံၩ့, အံၫ စရ့လၭဧ့, ဘိၩ့နၥံၪလချႃၭမၩထၪ့ခွံၬဒံၭဘၪဆၧဆိၪ အၧၩ့လၧနၥံၪအကျၩနီၪတၭ, နဆၧၫ့ထုၪ့လၧနဒုၪနဒၩ",
			"14": "<sup>14</sup> အမ့ၬယၫၥ့ၪအ့ၬ.- တၭလၧဆၧဖၩ့ထၪ့နီၪ ဆၧမိဒုၭ ဂဲၫနၥံၪဝ့ၫဘဲၫနၥံၪ အဒီၪ့လဖၪအၥိၭနီၪတၭ, ဆၧမိ မၩအၥၭလၧၦလဒီၪ့ လၧယဟိဝၩမၩန့ဝ့ၫနီၪ မိဘၪဂဲၫ ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭတၭ, ၦအဂံၪ့ဒီၪ့လၧယဟိဝၩ မိမၩန့ဝ့ၫနီၪ မိဘၪဂဲၫဘဲၫ အၡၩဂံၪ့ဒီၪ့ဖိၪအၥိၭနီၪ လီၫ. အၡၩဂံၪ့ဖိၪလၧယဟိဝၩ မိမၩန့ဝ့ၫနီၪမိဘၪဂဲၫ",
			"15": "<sup>15</sup> လဂၩဘၪလဂၩလီၫ.- တၭဆၧမိမၩအၥၭလၧ ၦလၧ အဘၪဆၧမၩန့ဝ့ၫအီၪလၧ ဆၧဘၪဆိၪအၧၩ့လမံၩ့လ ဂၩနီၪ,မိဘၪဆၧဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪ, အဝ့ၫဒၪ, ဒဲက ယဲအဆၧအီၪ ထီးအလူၬလီၫ. အဂဲးဘဲၫယီၩ မွဲအလၨၪ ခၫ့ဖၬယဟိဝၩအဆၧအုၩ့လၩ့လီၫ. ဒဲမၩဆၧဂၭဂီၩ့ လၧအံၫစရ့လၭအကျၩလီၫ.",
			"16": "<sup>16</sup> ထီးဆၧဖၩ့ထၪ့နီၪ စယီရှုၫအ့ၫဂဲထုၪ့ဂီၩဂီၩလ့ၬတၭ ဒုၭဂဲၫၦအံၫစရ့လၭဘဲၫအဒီၪ့လဖၪအၥိၭနီၪတၭ, ဆၧ မၩန့စယုဒၫအဒီၪ့လီၫ.",
			"17": "<sup>17</sup> ဒုၭဂဲၫစယုဒၫအဂံၪ့လဒီၪ့တၭ, ဆၧမၩန့ၦဇၫဟဲၭ ဖိၪအဂံၪ့ဒီၪ့လီၫ. တၭမွဲအဒုၭဂဲၫၦဇၫဟဲၭဖိၪအဂံၪ့ဒီၪ့ လဂၩဘၪလဂၩ, လဂၩဘၪလဂၩတၭ, ဆၧမၩန့စဇၭ",
			"18": "<sup>18</sup> ဘဒံၫလီၫ.- တၭအဝ့ၫဒၪဂဲၫဆိၬအၡၩဂံၪ့ဖိၪလဂၩဘၪ လဂၩတၭ, ဆၧမၩန့ၦယုဒၫအဒီၪ့ဖိၪ, စကၫမဲၫအဖိၪ ခွၫစဇၭဘဒံၫအဖိၪခွၫ စဇံရၫအဖိၪခွၫ စအၫခၫ့လဂၩ နီၪလီၫ.",
			"19": "<sup>19</sup> တၭစယီရှုၫအ့ၫစံၭစအၫခၫ့, ယဖိၪခွၫဧ့, ဖ့ၪလၩဖၩ့ ယဟိဝၩအံၫစရ့လၭအယွၩတၭ, လီၩလၩ့ဆၧလၧအ ဝ့ၫအမ့ၬယၫတၭ, လီၩဘၪလါယၧၩဆၧလၧနမၩန့နီၪ",
			"20": "<sup>20</sup> ဘီၪ,ထီးအီၪက့ၪၥူၪဆၧလၧယၧၩလဂ့ၩ,- စအၫခၫ့စံၭ ဆၧၫ့စယီရှုၫအ့ၫတၭ, စံၭဝ့ၫဒၪ, မွဲမၬ, ယမၩမၪဘၪ ယူၭယဟိဝၩအံၫစရ့လၭအယွၩယူၭတၭ, ယမၩဘဲၫ",
			"21": "<sup>21</sup> အံၩဘဲၫအိၩလီၫ.- တၭယဒၪဘၪဆဲၫ့ ဘၭဘလၧၫ့အ ဂ့ၩလဘံၪ့ လၧဆၧအၪ့ဂူၬန့အကျၩ ဒဲစ့ၩၡက့လၭနံၫ ယၩ,ဒဲထီၫ့လလီၪ့လၩ့လယၧးၡက့လၭ ယဲဆံၫတၭ, ယၥၭကွံၩဝ့ၫတၭ ယမၩန့ဝ့ၫလီၫ. ယိခွါ, အီၪၥူၪဝ့ၫ လၧဂၪ့ခိၪဖၧၩ့ လၧယတဲၩအၥၭကျၩတၭ, စ့ၩနီၪအီၪ လၧအဖၫ့လၬလီၫ.",
			"22": "<sup>22</sup> စယီရှုၫအ့ၫအၪ့မၧၫ့လၩ့ အၥီၫ့လဖၪတၭ အဝ့ၫၥံၪ စဲၪ့ထီၩ့လၧတဲၩဖၧၩ့တၭ, ယိခွါ, မွဲအအီၪက့ၪၥူၪဝ့ၫ လၧတဲၩဖၧၩ့တၭ, စ့ၩအီၪလၧအဖၫ့လၬလီၫ.",
			"23": "<sup>23</sup> တၭအဝ့ၫၥံၪမၩန့ဝ့ၫလၧတဲၩအၥၭကျၩတၭ, ဂဲၫထဲၩ့ ဆိၬအဝ့ၫၥံၪလၧစယီရှုၫအ့ၫ ဒဲအံၫစရ့လၭထီးအလူၬ အအီၪတၭ, အီၪက့ၪလၩ့အဝ့ၫၥံၪ လၧယဟိဝၩအမ့ၬ ယၫလီၫ.",
			"24": "<sup>24</sup> တၭစယီရှုၫအ့ၫ ဒဲအံၫစရ့လၭ ထီးအလူၬစီၪ့ဎးနီၪ မၩန့စဇံရၫအဖိၪခွၫစအၫခၫ့ ဒဲကျိၪၥံၪစ့ၩၥံၪ, ဒဲဆဲၫ့ လဘံၪ့နီၪ,ဒဲထီၫ့လလီၪ့နီၪ, ဒဲအဖိၪခွၫလဖၪ, ဒဲအဖိၪ မုၪလဖၪ, ဒဲအချီ, ဒဲအကၥ့ၪယီၩ့, ဒဲအၥိၪဒဲအဘ့ၪ,ဒဲ အတဲၩ,ကယဲအဆၧထီးအလူၬတၭ, ဂဲၫဆိၬဝ့ၫလၧခိၪ",
			"25": "<sup>25</sup> လီၩ့ဆူၭအၫခီၫနီၪလီၫ.- တၭစယီရှုၫအ့ၫစံၭဝ့ၫဒၪ, နမၩခိမၩဝီၩပၧၩမွဲဘၪလဲၪ, ယဟိဝၩမိမၩခိမၩဝီၩ နၧၩလၧမုဆၫလနံၩယီၩလီၫ. တၭအံၫစရ့လၭထီးအ လူၬခွံၬဝ့ၫလၧလိးတၭ, ခွံၬဝ့ၫလၧလိးဂီၩ့နီၪဆူၭထၪ့ခွံၬ",
			"26": "<sup>26</sup> ဝ့ၫလၧမ့ၪလီၫ.- တၭအဝ့ၫၥံၪအီၪက့ၪကီၪ့လိးလပိၩ့ဖၭ ဒိၪလၧအဖၫ့ခိၪ ထီးမုဆၫလနံၩယီၩလီၫ. တၭယဟိ ဝၩကၠၪထဲၩ့အၥၭလၧအၥၭထၪ့ဆီၪ့နီၪလီၫ. မၩအၥၭ ဘဲၫနီၪတၭ, ဆၧကိၭအလးထီးနီၪ အမံၩ့လၧခိၪလီၩ့ ဆူၭအၫခီၫနီၪ ထီးမုဆၫလနံၩယီၩလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစယီရှုၫအ့ၫ, ထီးၥၭမဲၪဆၧလဂ့ၩ, အၪ့ယိၪဆၧလဂ့ၩ, မၩန့ၦၥုၭဖိၪထီးအလူၬ လၧနၥိၭတၭ, ဂဲထုၪ့လ့ၩလၧဟဲၫနီၪဆံၭ, ယိခွါ,ယဖ့ၪလၫ့ဟဲၫ အစဎွၩ, ဒဲအၡၩခမျၧး, ဒဲအဒိၩ့, ဒဲအထံၫအခးလၧန",
			"2": "<sup>2</sup> စူၪဖၧၩ့လီၫ.- နမိဘၪမၩဟဲၫဒဲအစဎွၩ, ဘဲၫနမၩယ့ၫ ရခိၫဒဲအစဎွၩအၥိၭနီၪလီၫ. အ့ၪမွဲအဆၧဖိၪဆၧလံၩ ဒဲအဆၧဖိၪဆၧဎါအဒိၩ့လဖၪနီၪ နၥံၪမိမၩန့ဘၪဆၧ အၪ့ဂူၬန့ လၧနၥံၪအဂး ဒၪနၥံၪဝ့ၫလီၫ. အီၪက့ၪနဝ့ၫ လၧၦခိၭၥူၪဆၧ လၧအထၫ့ဒၩဒိၩ့နီၪ လၧအချိၫ့လခီၫ ဆံၭ.",
			"3": "<sup>3</sup> စယီရှုၫအ့ၫဂဲထုၪ့, ဒဲၦၥုၭဖိၪထီးအလူၬဘဲၫၥိၭအမိ လ့ၩထၪ့ထၫ့ဒၩဟဲၫတၭ, စယီရှုၫအ့ၫရွံန့ၦၥုၭဖိၪၦအ",
			"4": "<sup>4</sup> ဆီၪ့ၥၧၫ့လၬတၭ,- အၪ့မၧၫ့လၩ့အဝ့ၫၥံၪ လၧမုနၩလ ခီၫတၭမၪလူၬအဝ့ၫၥံၪတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,နၥံၪမိ ဘၪအီၪခိၭၥူၪလၧဒိၩ့အနဲၩ့ထံၭ, ဒဲလၧအချိၫ့လခီၫနီၪ လီၫ. လ့ၩဆၧယဲၩ့လၧဒိၩ့နီၪလဂ့ၩတၭ, အီၪတဲၩ့ဝဲၩ နၥံၪအၥၭထီးအလူၬဆံၭ.",
			"5": "<sup>5</sup> ယဝ့ၫဒၪဒဲကယဲၦလၧအအီၪ လၧယၥိၭထီးအလူၬ မိၥုၭဘူၭပၥၭလၧဒိၩ့တၭ, ဆၧမိမၩအၥၭထီးအဝ့ၫၥံၪ ဂဲၫထၪ့ထၫ့ဒၩပၧၩဘဲၫလၧ အၥၫ့အၥိၭတၭ, ပမိစဲၪ့လၧ",
			"6": "<sup>6</sup> အမ့ၬယၫ,- (အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမိဂဲၫဆီးပၧၩ) ထီးပထုၭထၪ့ခွံၬအဝ့ၫၥံၪ လၧဒိၩ့အဖၧၩ့နီၪလီၫ. အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪမိစံၭဝ့ၫ, ၦလဖၪနီၪစဲၪ့လၧပမ့ၬယၫ ဘဲၫလၧအခၪ့ထံၭအၥိၭနီၪတၭ, ပမိစဲၪ့လၧအမ့ၬယၫ",
			"7": "<sup>7</sup> ဆ့လီၫ.- ထီးနီၪလဖၧၫ့နၥံၪဘၪဂဲထုၪ့လၧဆၧအီၪခိၭ ၥူၪအလးဖၧၩ့တၭ, မၩန့ဆီၪ့ဒိၩ့နီၪလီၫ. အဂဲးဘဲၫ",
			"8": "<sup>8</sup> ယီၩယဟိဝၩနၥံၪအယွၩ မိဖ့ၪလၫ့ခွံၬဝ့ၫလၧနၥံၪအစူၪ ဖၧၩ့လီၫ.- ထီးနၥံၪအ့ၪမၩန့ဒိၩ့ဂီၩ့တၭ, ဆၧမိမၩအၥၭ လၧနၥံၪမိဘၪဆူၭထၪ့ခွံၬ ဒိၩ့လၧမ့ၪလီၫ. ဘဲၫယဟိ ဝၩအဆၧမၪလူၬအၥိၭနီၪ, နၥံၪမိဘၪမၩလီၫ. ယိခွါ,",
			"9": "<sup>9</sup> ယမၪလူၬယူၭနၥံၪယူၭ.- မၩအၥၭဘဲၫနီၪတၭ, စယီ ရှုၫအ့ၫအၪ့မၧၫ့လၩ့အဝ့ၫၥံၪတၭ, ၦလဖၪနီၪလ့ၩအီၪ ဝ့ၫလၧဆၧအီၪခိၭၥူၪအလးတၭ, အီၪဝ့ၫလၧဘ့ၫၥလၭ ဒဲဟဲၫအဘိၩ့ဆၧၩ့ လၧဟဲၫအမုနုၬလခီၫလီၫ. အ့ၪမွဲ စယီရှုၫအ့ၫအီၪဝ့ၫၥၫ့နၩချီၩ့ လၧမုနၩလနၩနီၪ လၧၦ ခမျၧးအကျၩလီၫ.",
			"10": "<sup>10</sup> တၭဆၧဖၩ့ထၪ့နီၪ စယီရှုၫအ့ၫဂဲထုၪ့ဂီၩဂီၩလ့ၬတၭ, ဝံထၪ့နၬထၪ့ၦခမျၧးတၭ, လ့ၩထၪ့ဝ့ၫ, အဝ့ၫဒၪဒဲၦအံၫ စရ့လၭဖိၪအၥုၪ့က့ၭၥၭၡါ လၧၦဟဲၫဖိၪအမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> တၭၦခမျၧးထီးအလူၬ, ၦၥုၭဖိၪလၧအအီၪလၧအၥိၭ လ့ၩထၪ့, ဒဲၥုၭဘူၭအၥၭတၭ, လ့ၩထီၩ့လၧဒိၩ့အမ့ၬ ယၫတၭ, အီၪပထုၬဝ့ၫလၧဟဲၫအမုဖၩလခီၫလီၫ. တၭ လၧအဝ့ၫၥံၪဒဲဟဲၫအဘိၩ့ဆၧၩ့နီၪ ခိၪလီၩ့ဆူၭအီၪဝ့ၫ",
			"12": "<sup>12</sup> လီၫ.- အဝ့ၫဒၪမၩန့ၦယဲထီၫ့တၭ, အီၪက့ၪလၩ့ဝ့ၫဘဲၫ ၥိၭအမိအီၪခိၭၥူၪဆၧလၧဘ့ၫၥလၭ ဒဲဟဲၫအဘိၩ့ဆၧၩ့",
			"13": "<sup>13</sup> လၧဒိၩ့အမုနုၬလခီၫလီၫ.- တၭအီၪက့ၪလၩ့ၦခမျၧး, ၦၥုၭမုထီးအလူၬလၧအအီၪလၧဒိၩ့ အမုဖၩလခီၫဒဲၦ အီၪခိၭၥူၪလၧဒိၩ့အမုနုၬလခီၫလီၫ. တၭစယီရှုၫအ့ၫ လ့ၩဝ့ၫလၧမုနၩလနၩနီၪ လၧခိၪလီၩ့ဆူၭအၥၭကျၩနီၪ လီၫ.",
			"14": "<sup>14</sup> ထီးဟဲၫအစဎွၩဒၪဘၪဝ့ၫတၭ, ဆၧမၩအၥၭလၧအ မၩချဲၫ့ချဲၫ့တၭ, ဆၧဖၩ့ထၪ့နီၪအဝ့ၫၥံၪဂဲထုၪ့ဂီၩဂီၩလ့ၬ တၭ,ၦဒိၩ့ဖိၪစဲၪ့ထၪ့ ဘဲၫၥိၭအမိဒုၭဆၧထၫ့ဒၩ အံၫ စရ့လၭထီးအထီ လၧအဖၭဝဲၩဝ့ၫဘၪနီၪ, အဝ့ၫဒၪဒဲ အၡၩခမျၧးထီးအလူၬ လၧဆၧပျၩ့အမ့ၬယၫလီၫ. မွဲ လါနၫ့လၧၦခိၭၥူၪဆၧလဖၪ လၧအထၫ့ဒၩဝ့ၫအီၪလၧ",
			"15": "<sup>15</sup> ဒိၩ့အချိၫ့နီၪၥ့ၪယၫဝ့ၫအ့ၬ.- တၭစယီရှုၫအ့ၫဒဲအံၫစရ့ လၭထီးအလူၬအီၪက့ၪအၥၭ ဘဲၫအစၪလၧအမ့ၬယၫ အၥိၭနီၪတၭ, စဲၪ့ဝ့ၫလၧၡါမုနၧၫ့ဖၫ အဖၧၩ့ၥၭလဘီၩ့",
			"16": "<sup>16</sup> လီၫ.- တၭဆၧကိၭန့ ကယဲၦအီၪလၧဟဲၫဖၧၩ့ ဘဲၫၥိၭ အမိလီၩ့ဆီးဝ့ၫတၭ, အဝ့ၫၥံၪလီၩ့ဆီးစယီရှုၫအ့ၫတၭ,",
			"17": "<sup>17</sup> ဘၪဆၧထုၭန့ခွံၬဝ့ၫလၧဒိၩ့ဖၧၩ့လီၫ.- တၭၦၡၩလၧ အလစဲၪ့ထၪ့လီၩ့ဆီးဘၪ အံၫစရ့လၭနီၪ လအီၪဘၪ လၧဖၧၩ့ၥၭလၧဘ့ၫၥလၭအဖၧၩ့မွဲဂ့ၩ, လၧဟဲၫအဖၧၩ့ မွဲဂ့ၩ, အီၪနးဂၩအ့ၬး တၭအဝ့ၫၥံၪအီၪက့ၪလၩ့ထးဒိၩ့ အီၪဝဲထၪ့အၥၭတၭ, လီၩ့ဆီးအံၫစရ့လၭလီၫ.",
			"18": "<sup>18</sup> တၭယဟိဝၩစံၭစယီရှုၫအ့ၫ ယၩ့ထၪ့ဖၩ့လၧအအီၪ လၧနစူၪဖၧၩ့ လဘံၪ့တီၩတီၩလၧဟဲၫနီၪဆံၭ. အဂဲး ဘဲၫယီၩယမိဖ့ၪလၫ့ဝ့ၫလၧနစူၪဖၧၩ့လီၫ. တၭစယီရှုၫ အ့ၫယၩ့ထၪ့ဖၩ့ လၧအအီၪလၧအစူၪဖၧၩ့ လဘံၪ့နီၪ",
			"19": "<sup>19</sup> တီၩတီၩလၧဒိၩ့နီၪလီၫ.- တၭၦအီၪခိၭၥူၪဆၧဂဲထုၪ့ ချဲၫ့ချဲၫ့လၧအလးဖၧၩ့တၭ, ထီးအဆၧယၩ့ထၪ့အစူၪ တၭ,အဝ့ၫၥံၪစဲၪ့ဝ့ၫတၭ, လ့ၩနုၬလၧဒိၩ့ဖၧၩ့တၭ, မၩ",
			"20": "<sup>20</sup> န့ဝ့ၫဒဲဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪချဲၫ့ချဲၫ့လီၫ.- ထီးၦဟဲၫဖိၪ ကၠၪအၥၭလၧအလးခဲၫ့တၭ, ယိဆၧနီၪ, ယိခွါ, ဒိၩ့အ မ့ၪခူၪထၪ့လၧမူၭခိၪတၭ, အဝ့ၫၥံၪစဲၪ့ဝ့ၫလၧအယီၩလ ခီၫမွဲဂ့ၩ, လၧအနီၪလခီၫမွဲဂ့ၩ, မၩၥ့ၪအ့ၬး ၦလၧအစဲၪ့ လၧၡါမုနၧၫ့ဖၫလဖၪနီၪ ကၠၪထဲၩ့ဝ့ၫတၭထၫ့ဒုၪဒၩၦလၧ",
			"21": "<sup>21</sup> အလီၩ့ဆီးဝ့ၫလီၫ.- တၭထီးစယီရှုၫအ့ၫဒဲအံၫစရ့ လၭ ထီးအလူၬဒၪဘၪဝ့ၫလၧ ၦခိၭၥူၪဆၧမၩန့ယူၭဒိၩ့ တၭ, ဒိၩ့အမ့ၪခူၪထၪ့ဝ့ၫတၭ, အဝ့ၫၥံၪကၠၪထဲၩ့အၥၭတၭ,",
			"22": "<sup>22</sup> မၩၥံၫၦဟဲၫဖိၪလီၫ.- တၭၦဂူၫဂၩၥံၪနီၪစဲၪ့ထၪ့လၧဒိၩ့ ဖၧၩ့ထၫ့ဒၩဝ့ၫလီၫ. တၭၦလဖၪနီၪအီၪဝ့ၫ လၧအံၫစရ့ လၭအကျၩတၭ, လနၩ့နၩ့အီၪလၧအယီၩလခီၫ, ဒဲလ နၩ့နၩ့အီၪလၧအနီၪလခီၫတၭ, အဝ့ၫၥံၪဖ့ၬခွံၬဝ့ၫထီး",
			"23": "<sup>23</sup> ၦလအီၪလၩ့ထးဘၪ, ဒဲဖီၩ့ဖျ့ၭနးဂၩအ့ၬ.- တၭအဝ့ၫ ၥံၪဖီၪ့န့မၧၫ့ဟဲၫအစဎွၩတၭ, ဂဲၫဆိၬဝ့ၫလၧစယီရှုၫအ့ၫ အအီၪလီၫ.",
			"24": "<sup>24</sup> ဆၧမၩအၥၭလၧအံၫစရ့လၭမၩၥံၫ ၦဟဲၫဖိၪထီးအ လူၬလၧဆၧပျၩ့ဖၧၩ့, လၧၡါမုနၧၫ့ဖၫ ထီးအလီၩ့ဆီး ဝ့ၫတၭ, ထီးလၩ့ထံၩဖါလၧအနၭအနါအဖၫ့ခိၪထီးအ လူၬတၭ, ၦအံၫစရ့လၭထီးအလူၬထဲၩ့ထဲၩ့လၧဟဲၫအ",
			"25": "<sup>25</sup> ဖၧၩ့တၭ, ဖ့ၬဝ့ၫလၧနၭအနါလီၫ.- တၭၦလၧအလၩ့ ထံၩဖါလၧမုလနံၩနီၪထီးအလူၬ, ၦမုၪမွဲဂ့ၩ,ၦခွၫမွဲဂ့ၩ,",
			"26": "<sup>26</sup> အီၪလလၬနံၫထီၫ့,ၦဟဲၫဖိၪထီးအလူၬလီၫ.- အဂဲးဘဲၫ ယီၩစယီရှုၫအ့ၫလထုၭထဲၩ့ဘၪအစူၪ လၧအယၩ့ထၪ့ ဖၩ့လဘံၪ့နီၪ, ထီးအမၩဂၭဂီၩ့ခွံၬ ၦဟဲၫဖိၪထီးအလူၬ",
			"27": "<sup>27</sup> လီၫ.- အ့ၪမွဲန့ၫဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲဒိၩ့အဆၧဖိၪဆၧ လံၩနီၪအံၫစရ့လၭမၩန့ဝ့ၫ လၧဆၧအၪ့ဂူၬန့ဘၪလၧအ ဂးဒၪဝ့ၫ,ဘဲၫယဟိဝၩအလူ လၧအမၪလူၬစယီရှုၫအ့ၫ",
			"28": "<sup>28</sup> အၥိၭနီၪလီၫ.- စယီရှုၫအ့ၫဆူၭထၪ့ခွံၬ ဟဲၫလၧမ့ၪတၭ, အီၪက့ၪဝ့ၫလၧဆၧပိၩ့အဆိၩအကၠၪ, ဆၧအီၪယူထီး",
			"29": "<sup>29</sup> မုဆၫလနံၩယီၩလီၫ.- တၭအဝ့ၫစၧၩ့လၩ့ဆဲၩ ဟဲၫအ စဎွၩလၧၥံၪ့လီၩ့ထီးမုဂၪလၩ့လီၫ. ထီးမုလၩ့နုၬတၭ, စယီရှုၫအ့ၫမၪလူၬဝ့ၫ လၧၦမိမၩန့အစွၪ လၧၥံၪ့လီၩ့ တၭ, ခွံၬၡိၭဝ့ၫလၧဒိၩ့အတရၫ့အခၪ့ထံၭ, ဒဲမၩထၪ့ လိးအပိၩ့ဖၭဒိၪလပိၩ့ထီးနီၪလီၫ. အီၪဝ့ၫထီးမုဆၫလ နံၩယီၩလီၫ.",
			"30": "<sup>30</sup> ထီးနီၪလဖၧၫ့စယီရှုၫအ့ၫ မၩထၪ့ဆၧလုလးလၧယ ဟိဝၩအံၫစရ့လၭအယွၩအဂး, လၧခိၪလီၩ့အံဘလၭ",
			"31": "<sup>31</sup> အလီၩ့,- ဘဲၫယဟိဝၩအခ့ၫအၡၩစမိစ့ၭမၪလူၬၦအံၫ စရ့လၭဖိၪအၥိၭနီၪ, ဘဲၫဆၧကွ့ၭအၥၭ လၧစမိစ့ၭအ လံၬဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့အၥိၭနီၪ, ဆၧလုလးလၧလိး ထၧၫ့ဖျိၪ့ယၫလဖၪ, လၧၦလမၩဘၪလၧထၭတၭ, အ ဝ့ၫၥံၪလုထၪ့ဆၧလုမ့ၪလၧယဟိဝၩအဖၫ့ခိၪ, ဒဲလုထၪ့",
			"32": "<sup>32</sup> ဆၧလုမၩဘၪလိၬအိၭလိၬလီၫ.- တၭစမိစ့ၭအဆၧၥီၪ့ ဆၧၥၫ့လၧအကွ့ၭဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ အမ့ၬယၫ",
			"33": "<sup>33</sup> နီၪအဝ့ၫဒၪကွ့ၭဆဲၫဝ့ၫလၧလိးအလီၩ့လီၫ.- တၭအံၫစ ရ့လၭထီးအလူၬ, ဒဲၦၥုၪ့က့ၭၥၭၡါ, ဒဲၦကွ့ၭလံၬဒဲၦစ့ၩ ရၫ့ခွးလဖၪနီၪဆၧၫ့ထုၪ့ဝ့ၫ လၧတလၫအနဲၩ့ထံၭလၧ အယီၩလခီၫ,ဒဲလၧအနီၪလခီၫ, လၧၦလုဆၧလဖၪဒဲၦ လံဝဲၫဖိၪလဖၪ လၧအဆိၬယဟိဝၩအဆၧအုၩ့လၩ့အ တလၫအမ့ၬယၫ, ၦလခီၫဘၩ့မုးဖိၪမွဲဂ့ၩ, ဒဲၦအီၪဖျဲၪ လၧအကျၩမွဲဂ့ၩတၭး ၦလဖၪနီၪဖိၭဖၫ့အီၪဝ့ၫလၧခိၪ လီၩ့ဂ့ၫရဇံၫ့အမ့ၬယၫ, ဒဲဖိၭဖၫ့နီၪအီၪဝ့ၫ လၧခိၪလီၩ့ အံဘလၭအမ့ၬယၫ ဘဲၫယဟိဝၩအခ့ၫအၡၩ စမိစ့ၭ မၪလူၬဝဲၩဝ့ၫလၧအခၪ့ထံၭ, ဘဲၫၥိၭအမိဆိၪဂ့ၩအံၫစ",
			"34": "<sup>34</sup> ရ့လၭအၡၩခမျၧးလီၫ.- လၧခဲၫ့ထဲၩ့တၭ အဝ့ၫဒၪဖီ ထၪ့ဝ့ၫလၧကယဲဆၧၥီၪ့ဆၧၥၫ့ အဆၧချဲၩ့ထီးအလူၬ, ဆၧဆိၪဂ့ၩလဖၪ, ဒဲဆၧဆိၪအၧၩ့လဖၪ, ဒဲကယဲဆၧ",
			"35": "<sup>35</sup> ကွ့ၭအၥၭလၧလံၬဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့နီၪလီၫ.- ဆၧ ချဲၩ့လၧစမိစ့ၭမၪလူၬလဖၪ, လၧစယီရှုၫအ့ၫလဖီဘၪ ဝ့ၫလၧအံၫစရ့လၭအဆၧအီၪကီၪ့အမ့ၬယၫနီၪ, ဒဲလၧ ၦမုၪၦမၧၩ့ဖိၪဒံၩဖိၪၥၪ, ဒဲၦလခီၫဘၩ့မုးဖိၪလၧအလ့ၩ ဆၧလၧအကျၩလဖၪအမ့ၬယၫနီၪ အီၪနးထံၪအ့ၬ."
		},
		"9": {
			"1": "<sup>1</sup> တၭထီးစဎွၩၥံၪထီးအလူၬ အီၪလၧယီၫဒၫ့အယီၩ လခီၫ, လၧခိၪလီၩ့ထိၩ့ချိၬ, ဒဲလၧခိၪလီၩ့ဆူၭ, ဒဲလၧမၫ ဆမံၭဖၭဒိၪအနဲၩ့ထံၭထီးအလူၬဆဲၫဎၩ့ လၧလ့ၭဘ နၧၫ့ၦဟံၥၭဖိၪ, ဒဲၦအၫမိၫဖိၪ, ဒဲၦကၫနအၫ့ဖိၪ, ဒဲၦပံ ရ့ၭဖိၪ, ဒဲၦဟံဝဲၫဖိၪ, ဒဲၦယ့ဘုၫဖိၪလဖၪနီၪနါဂၧၫ့ဆၧ",
			"2": "<sup>2</sup> တၭ,- ဆၧမၩအၥၭလၧအအီၪကိၩ့အီၪကီၪ့အၥၭလ ဖျိၪ့ဎး, ဘဲၫၥိၭအမိဒုၭၥုၭ လၧစယီရှုၫအ့ၫ ဒဲအံၫစရ့ လၭလီၫ.",
			"3": "<sup>3</sup> တၭထီးၦဂံဘအၧၫ့ဖိၪ နါဂၧၫ့ဆၧလၧ စယီရှုၫအ့ၫ",
			"4": "<sup>4</sup> မၩယ့ၫရခိၫ ဒဲဟဲၫတၭ,- အဝ့ၫၥံၪမၩဝ့ၫ လၧအၪ့လီၫ ဆၧတၭ,လ့ၩဝ့ၫတၭ အီၪက့ၪအၥၭဘဲၫအမွဲဆၧအၥီၫ့ အၥိၭတၭ, ဆိၬထိၪ့လးလံၩလၧအကၥ့ၪယီၩ့အလီၩ့, ဒဲစဘံၭထံၫအထိၪ့ဆၧဖံၭ လးလံၩယၬဝ့ၫ, ဒဲစၧၩ့ထၬ",
			"5": "<sup>5</sup> ဝ့ၫနီၪ,- ဒဲခၪ့ဖံၭလးလံၩဆၭကျၭအၥၭလၧအခၪ့လီၩ့ တၭ,ကီၩ့ၥိၭဝ့ၫလၧ အကီၩ့အၥိၭလးလံၩတၭ, ကယဲ ကိၪ ဒဲအဆၧအၪ့အဂးနီၪ ဎဲၫ့ဝ့ၫ, ဒဲဎၧၩ့ထၪ့ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> တၭအဝ့ၫၥံၪလ့ၩဝ့ၫ ထီၩ့လၧစယီရှုၫအ့ၫအအီၪလၧၦ ၥုၪ့တဲၩအလးလၧ ဂံလဂၫလၭအဖၧၩ့တၭ, စံၭအဝ့ၫ ဒၪ,ဒဲလၧၦအံၫစရ့လၭအၡၩလဖၪ, ပဝ့ၫဒၪပဂဲၫလၧ ထံၫယဲၩ့ခးယဲၩ့တၭ, ဘိၩ့နဲၪ့ယီၩ အုၩ့လၩ့လၧပၥိၭ ဘီၪ.",
			"7": "<sup>7</sup> တၭအံၫစရ့လၭအၡၩစံၭၦဟံဝဲၫဖိၪ, ဘၪလဘၪန ၥံၪအီၪလၧပကျၩလီၫ. တၭပမိအုၩ့လၩ့ဆၧအုၩ့လၩ့",
			"8": "<sup>8</sup> လၧနၥံၪဘဲၫၥ့ၪလဲၪ,- တၭအဝ့ၫၥံၪ စံၭ စယီရှုၫအ့ၫ, ပဝ့ၫဒၪယီၩပမွဲနဎီးနၡၩလီၫ. တၭစယီရှုၫအ့ၫစံၭဝ့ၫ, နၥံၪမွဲၦလဖၪလဲၪး တၭမွဲနၥံၪ ဂဲၫထၪ့အထံၭခီၫခီၫ",
			"9": "<sup>9</sup> လဲၪ.- တၭအဝ့ၫၥံၪစံၭအဝ့ၫ, နဎီးနၡၩဂဲၫလၧခးလ ဘံၪ့ယဲၩ့ယဲၩ့လ့ၬ လၧယဟိဝၩ နယွၩ အမံၩ့ အကၠီၩ့ လီၫ. အဂဲးဘဲၫယီၩ ပနါဂၧၫ့အပရၧၫ့, ဒဲကယဲအမၩ",
			"10": "<sup>10</sup> ဆၧလၧအံဇံၭအဖၧၩ့, ဒဲကယဲအမၩၦအၫမိၫဖိၪအစ ဎွၩနံၫဂၩ လၧအအီၪလၧယီၫဒၫ့ဝါလခီၫ, လၧဟ့ၭၡ ဘၫ့အစဎွၩစဲဟၫ့, ဒဲဘၫၡၫ့အစဎွၩအီၭ လၧအအီၪဝ့ၫ",
			"11": "<sup>11</sup> လၧအၭၡတြီၭနီၪလီၫ.- တၭၦၥုၪ့က့ၭၥၭၡါ, ဒဲကယဲ ၦထံၫဖိၪခးဖိၪထီးအလူၬ ချဲၩ့ဆၧလၧပၧၩတၭ, စံၭဝ့ၫ ဒၪ,မၩန့ဆၧအၪ့ဆၧအီၩ လၧနၥံၪလ့ၩဆၧအဂးတၭ, လ့ၩစိၩလၧအဝ့ၫၥံၪအအီၪတၭ, စံၭ, ပဝ့ၫဒၪယီၩပမွဲန ၥံၪအဎီးအၡၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ",
			"12": "<sup>12</sup> အုၩ့လၩ့ဆၧလၧပၥိၭဘီၪ.- ပကိၪယီၩ လၧပမၩန့ လၧပဂံၪ့ဖၧၩ့လၧပဆၧအၪ့အဂး, လၧမုလနံၩလၧပ စဲၪ့ထၪ့, ဘဲၫၥိၭပမိဂဲၫလၧနၥံၪအအီၪခိဝ့ၫလီၫ. အ့ၪမွဲ",
			"13": "<sup>13</sup> ဘိၩ့နဲၪ့ယီၩ, ယိခွါ, ဎဲၫ့ဝ့ၫဒဲဎၧၩ့ထၪ့ဝ့ၫလီၫ.- စဘံၭ ထံၫထိၪ့ဆၧဖံၭယီၩ မွဲအၥၫ့တၭ, ပမၩဎွ့ၩပဝ့ၫလီၫ. တၭယိခွါ,ယၬဝ့ၫလီၫ. တၭပကီၩ့ပၥိၭ, ပခၪ့ဖံၭယီၩ လၩ့လံၩဝ့ၫလၧပဖၧၩ့ၥၭယဲၩ့မၬအကၠီၩ့လီၫ.",
			"14": "<sup>14</sup> တၭၦၡၩလဖၪနီၪ ထိးဆၧၫ့အဝ့ၫၥံၪလၧအဆၧအၪ့ အကၠီၩ့တၭ, အၪ့စၪ့ဆၧ လၧယဟိဝၩအနိၭအ့ၬ.",
			"15": "<sup>15</sup> တၭစယီရှုၫအ့ၫ မၩဆၧဘၪလိၬအိၭလိၬလၧအဝ့ၫၥံၪ တၭအုၩ့လၩ့လၧအဝ့ၫၥံၪ လၧအမိဒုၭမၧၫ့ဒံၭဝ့ၫလီၫ. တၭဆၧအီၪကီၪ့အၦဒိၪလဖၪနီၪ ဆိၪလၩ့အၥၭလၧအ ဝ့ၫၥံၪလီၫ.",
			"16": "<sup>16</sup> အဝ့ၫၥံၪအုၩ့လၩ့ဆၧလၧၦလဖၪနီၪ အလးခဲၫ့ဖီၩ့ ခွံၬၥၧၫ့နံၩတၭ, ဆၧမၩအၥၭလၧအနါဂၧၫ့ဝ့ၫလၧအ",
			"17": "<sup>17</sup> မွဲၦအီၪလၧအနဲၩ့ထံၭ ဒဲအီၪဝ့ၫ လၧအကျၩလီၫ.- ၦ အံၫစရ့လၭဖိၪလ့ၩဆၧတၭ, ၥၧၫ့နံၩလနံၩနီၪထီၩ့ဝ့ၫ လၧအဝ့ၫၥံၪအဒိၩ့လဖၪနီၪလီၫ, တၭအဒိၩ့လဖၪနီၪမွဲ ဂံဘအၧၫ့, ဒဲခ့ၭပဲရၫ, ဒဲဘံၫအံရီၭ, ဒဲကၧၫယၭယံအ",
			"18": "<sup>18</sup> ရံၫ့နီၪလီၫ.- တၭၦအံၫစရ့လၭဖိၪဖ့ၬၥံၫဝ့ၫအ့ၬး အဂဲး ဘဲၫယီၩဆၧအီၪကီၪ့အၦဒိၪလဖၪ ဆိၪလၩ့အၥၭလၧ အဝ့ၫၥံၪလၧယဟိဝၩ အံၫစရ့လၭအယွၩ အမ့ၬယၫ လီၫ. တၭဆၧအီၪကီၪ့ ထီးအလူၬၥူၭဝံၪ ၥူၭလၩဆၧ လၧၦဒိၪလဖၪအလီၩ့လီၫ.",
			"19": "<sup>19</sup> တၭကယဲၦဒိၪလဖၪနီၪ စံၭဆၧအီၪကီၪ့ထီးအလူၬ, ပဆိၪလၩ့ပၥၭလၧအဝ့ၫၥံၪ လၧယဟိဝၩအံၫစရ့လၭ အယွၩအမ့ၬယၫလီၫ. တၭဘိၩ့နဲၪ့ယီၩ ပထိၭဘၪ",
			"20": "<sup>20</sup> အဝ့ၫၥံၪၥ့ၪအ့ၬ.- တၭပမိမၩဝ့ၫလၧဆၧယီၩ, ပမိဒုၭ မၧၫ့ဒံၭအဝ့ၫၥံၪဘဲၫၥိၭဆၧၥၭထၪ့ ထီးဘၪပၧၩလဂ့ၩ, လၧဆၧဆိၪလၧပဆိၪလၩ့ပၥၭ လၧအဝ့ၫၥံၪအကၠီၩ့နီၪ",
			"21": "<sup>21</sup> လီၫ.- တၭၦဒိၪလဖၪနီၪ စံၭလၧအဂဲးအကၠီၪ့, မွဲအဝ့ၫ ၥံၪမိမၧၫ့ဒံၭဒၪဝ့ၫဆံၭ. မွဲလါနၫ့မွဲအမိကဲၪထၪ့ၦဖ့ၬၥံၪ့ မု,ဒဲၦအၪ့ဒုၪ့ထံၫလၧဆၧအီၪကီၪ့ ထီးအလူၬအဂးနီၪ ဆံၭ,ဘဲၫၦဒိၪလဖၪ ချဲၩ့ဝဲၩဝ့ၫအၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> တၭစယီရှုၫအ့ၫ ကိၭန့အဝ့ၫၥံၪတၭ, စံၭအဝ့ၫၥံၪ, လၧနၥံၪအီၪလၧပကျၩတၭ, နၥံၪစံၭ, ပအီၪယဲၩ့ယဲၩ့",
			"23": "<sup>23</sup> လ့ၬလၧနၥံၪနီၪ, နၥံၪအၪ့လီၫန့ပၧၩမွဲဘၪလဲၪ,- တၭ ဘိၩ့နဲၪ့ယီၩ နၥံၪဘၪ ဆၧဆိၪအၧၩ့လီၫ. တၭနၥံၪမိ ကဲၪဎီး, ၦဖ့ၬၥံၪ့မု, ၦအၪ့ဒုၪ့ထံၫ လၧယယွၩအဂံၪ့အ",
			"24": "<sup>24</sup> ဂးနီၪနၥံၪဖီၩ့ဖျ့ၭဘၪနးဂၩအ့ၬ.- အဝ့ၫၥံၪစံၭဆၧၫ့ စယီရှုၫအ့ၫတၭ, စံၭဝ့ၫဒၪ, အဂဲးဘဲၫယီၩ ၦလီၩဘၪ တၡါနဎီးနၡၩလၧယဟိဝၩနယွၩမၪလူၬ အခ့ၫအၡၩ စမိစ့ၭလၧအမိဖ့ၪလၫ့နၥံၪ လၧခးထၧၫ့ဘံၪ့ယၫ,ဒဲလၧ အမိမၩဂၭဂီၩ့ ၦခးဖိၪထီးအလူၬ လၧနၥံၪအမ့ၬယၫ လီၫ. တၭပအၪ့ယိၪဆၧလၧပၥၭမၧၫ့အဂးဒိၪဒိၪလ့ၬ",
			"25": "<sup>25</sup> လၧနၥံၪအကၠီၩ့တၭ, ပမၩဆၧယီၩလမံၩ့လီၫ.- တၭ ဘိၩ့နဲၪ့ယီၩ, ယိခွါ, ပအီၪလၧနစူၪဖၧၩ့, ဘဲၫၥိၭနမိမၩ ပၧၩဘဲၫဆၧအဂ့ၩအတီၩ လၧနမ့ၬယၫအၥိၭနီၪလီၫ.",
			"26": "<sup>26</sup> အဝ့ၫဒၪမၩဝ့ၫဘဲၫနီၪတၭ, မၩဖီၩ့ဖျ့ၭဝ့ၫလၧၦအံၫ စရ့လၭဖိၪအစူၪဖၧၩ့တၭ, အဝ့ၫၥံၪမၩၥံၫဝ့ၫအ့ၬ.",
			"27": "<sup>27</sup> တၭဆၧလၧမုလနံၩနီၪ စယီရှုၫအ့ၫ အီၪက့ၪအဝ့ၫၥံၪ လၧၦဖ့ၬၥံၪ့မု, ဒဲၦအၪ့ဒုၪ့ထံၫ လၧဆၧအီၪကီၪ့အဂး, ဒဲလၧယဟိဝၩ အဆၧလုလးအဂး လၧအလးထီးဒၪ အမိရွံန့ဝ့ၫလၧမုဆၫလနံၩယီၩလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> တၭထီးယရုစလံၫ့ အစဎွၩ အဒိၫနဲၫဇံၫဒ့ၭနါဂၧၫ့ ဝ့ၫလၧစယီရှုၫအ့ၫမၩန့ဟဲၫ, ဒဲမၩဂၭဂီၩ့ခွံၬဝ့ၫ, ဘဲၫအ မၩယ့ၫရခိၫဒဲအစဎွၩအၥိၭနီၪ, မွဲအမၩဟဲၫအစဎွၩ ဘဲၫနီၪအၥိၭး ဒဲလၧၦဂံဘအၧၫ့ဖိၪ မၩဘၪလိၬအိၭ လိၬအၥၭလၧၦအံၫစရ့လၭဖိၪ, ဒဲအီၪဝ့ၫလၧအကျၩ",
			"2": "<sup>2</sup> နီၪတၭ,- ဆၧမၩအၥၭ လၧအၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫဒိၪမၬ လီၫ. အဂဲးဘဲၫယီၩ ဂံဘအၧၫ့မွဲဒိၩ့ဖၭဒိၪလဖျိၪ့, ဘဲၫ စဎွၩအဒိၩ့လဒိၩ့အၥိၭဒဲဒိၪနဲၪ့ဟဲၫဒံၭ, ဒဲအၦၡၩထီး",
			"3": "<sup>3</sup> အလူၬနီၪမွဲၦအဆီၪ့လီၫ.- တၭယရုစလံၫ့အစဎွၩအ ဒိၫနဲၫဇံၫဒ့ၭအၪ့မၧၫ့လၩ့ဆၧလၧ ဟံဘြၧၫ့အစဎွၩဟိ ဟၫ့,ဒဲယၫမုၫၥၫအစဎွၩပဲရၫ့, ဒဲလၫခံၭအစဎွၩယၫဖဲၫ",
			"4": "<sup>4</sup> အၫ,ဒဲအ့ၭဂလၫ့အစဎွၩဒံဘၧၫတၭ, စံၭဝ့ၫဒၪ,- ဂဲၫထၪ့ လၧယအီၪဘီၪး တၭမၩဆၧၩ့ယၧၩ ဘဲၫၥိၭပမိဖ့ၬခွံၬ ဂံဘအၧၫ့နီၪဆံၭး အဂဲးဘဲၫယီၩ အဝ့ၫမၩဘၪလိၬအိၭ",
			"5": "<sup>5</sup> လိၬလၧစယီရှုၫအ့ၫ ဒဲၦအံၫစရ့လၭဖိၪလီၫ.- တၭၦ အၫမိၫဖိၪ အစဎွၩယဲဂၩ, ယရုစလံၫ့အစဎွၩလဂၩ, ဟံဘြၧၫ့အစဎွၩလဂၩ, ယၫမုၫၥၫအစဎွၩလဂၩ, လၫ ခံၭအစဎွၩလဂၩ, အ့ၭဂလၫ့အစဎွၩလဂၩ, အီၪကိၩ့ အီၪကီၪ့, ဒဲလ့ၩထၪ့ဝ့ၫဒၪ, အဝ့ၫၥံၪဒဲအၡၩၥုၭဖိၪထီး အလူၬတၭ, ၥုၪ့တဲၩလၧဂံဘအၧၫ့အမ့ၬယၫ, ဒဲဒုၭဆၧ ထၫ့ဒၩဝ့ၫလီၫ.",
			"6": "<sup>6</sup> ဂံဘအၧၫ့အၡၩအၪ့မၧၫ့လၩ့ ဆၧလၧစယီရှုၫအ့ၫအ အီၪ, ထီးၦၥုၪ့တဲၩအလးလၧဂံလဂၫလၭတၭ, စံၭဝ့ၫ ဒၪ,အီၪက့ၪလၩ့ဆါနစူၪလၧနခ့ၫနၡၩအဂးလဂ့ၩ, ဂဲၫ ထၪ့လၧပအီၪချဲၫ့ချဲၫ့, ဒဲမၩဖီၩ့မၩဖျ့ၭပၧၩ, ဒဲမၩဆၧၩ့ ပၧၩဆံၭ,အဂဲးဘဲၫယီၩ, ၦအၫမိၫဖိၪအစဎွၩ ထီးအ လူၬလၧအအီၪလၧခိၪလီၩ့ထိၩ့ချိၬနီၪ အီၪကိၩ့အီၪကီၪ့",
			"7": "<sup>7</sup> ထၫ့ဒၩယူၭပၧၩယူၭ.- တၭစယီရှုၫအ့ၫ လ့ၩထၪ့ခွံၬ လၧဂံလဂၫလၭ, အဝ့ၫဒၪ, ဒဲၦၥုၭဖိၪထီးအလူၬဒဲကယဲ ၦၡၩၥံၪလၧအဂဲးဆီၪ့ထီးအလူၬလီၫ.",
			"8": "<sup>8</sup> တၭယဟိဝၩစံၭစယီရှုၫအ့ၫ, ထီးၥၭမဲၪအဝ့ၫၥံၪလ ဂ့ၩး အဂဲးဘဲၫယီၩယဖ့ၪလၫ့ယူၭအဝ့ၫၥံၪ လၧနစူၪဖၧၩ့ ယူၭ, ၦအီၪလၧအဝ့ၫၥံၪအကျၩ မိဆၧၫ့ထုၪ့လၧနမ့ၬ",
			"9": "<sup>9</sup> ယၫနးဂၩအ့ၬ.- အခိးမွဲစယီရှုၫအ့ၫလ့ၩထၪ့ခွံၬလၧဂံ",
			"10": "<sup>10</sup> လဂၫလၭၥၫ့နၩချီၩ့တၭ, ဒုၭရှုၭအဝ့ၫၥံၪလီၫ.- ယဟိ ဝၩမၩစၪအဝ့ၫၥံၪ လၧအံၫစရ့လၭအမ့ၬယၫတၭ, မၩ ၥံၫဝ့ၫလၧဆၧမၩၥံၫဖၭဒိၪ, ထီးဂံဘအၧၫ့ အနဲၩ့ထံၭ နီၪ,ဒဲလီၩ့ဆီးဝ့ၫလၧဖၧၩ့ၥၭ လ့ၩထၪ့လၧဘ့ၭၥဟိရၧၫ့ တၭဖ့ၬခွံၬဝ့ၫဖိးလၧအဇံကၫ ဒဲဖိးလၧမၭကံဒၫလီၫ.",
			"11": "<sup>11</sup> တၭအဝ့ၫၥံၪစဲၪ့လၧအံၫစရ့လၭ အမ့ၬယၫလၧအလ့ၩ လၩ့လၧဘ့ၭၥဟိရၧၫ့အဘိၩ့ဘၭနီၪ, ဆၧမၩအၥၭလၧ ယဟိဝၩခွံၬလၩ့လိးဖၭဒိၪလဖၪ လၧမူၭခိၪလၧအဝ့ၫ ၥံၪအလီၩ့ ထီၩ့လၧအဇံကၫနီၪတၭ, အဝ့ၫၥံၪၥံၫဝ့ၫဒၪ လီၫ. ၦၥံၫလၧမုၥၪအလိးနီၪအၪနဲၪ့ၦလၧၦအံၫစရ့လၭ ဖိၪမၩၥံၫဝ့ၫလၧနၭနီၪဒံၭလီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့မုလနံၩလၧယဟိဝၩဖ့ၪလၫ့ခွံၬ ၦအၫ မိၫဖိၪလၧၦအံၫစရ့လၭဖိၪ အမ့ၬယၫနီၪစယီရှုၫအ့ၫချဲၩ့ ဆၧလၧယဟိဝၩတၭ, စံၭဝ့ၫလၧအံၫစရ့လၭ အမ့ၬ ယၫ, မုဧ့, အီၪထီနဝ့ၫလၧဂံဘအၧၫ့အလီၩ့, ဒဲနဝ့ၫဒၪ, လၩဧ့, လၧအၭဇလၧၫ့အခိၪလီၩ့ဆူၭဖၧၩ့နီၪဆံၭၬ",
			"13": "<sup>13</sup> တၭမုနီၪအီၪထီဝ့ၫ, ဒဲလၩနီၪအီၪဂုးဝ့ၫထီးၦခမျၧး မၩဆၧၫ့ဆၧအၧၩ့ လၧအဒုၪအဒၩအလီၩ့ဂီၩ့လီၫ. အ ယီၩဘၪဆၧကွ့ၭအၥၭ လၧလံၬယၫၡၧၫအဖၧၩ့နီၪမွဲ အ့ၬဧၪ. တၭမုနီၪအီၪထီလၧမူၭခိၪအၥၭကျၩ, လနံၩ",
			"14": "<sup>14</sup> ထၧၫ့နံၩယၫကၪယူၭလၩ့နုၬအ့ၬ.- လၧယဟိဝၩခိၭနၪ ယူၭၦၡၩအလူတၭး လၧအၥၫ့မွဲဂ့ၩ,လၧခဲၫ့မွဲဂ့ၩ,မုနံၩ ဘဲၫနီၪၥိၭအီၪအ့ၬ, အဂဲးဘဲၫယီၩ ယဟိဝၩဒုၭဆၧ လၧအံၫစရ့လၭအဂးလီၫ.",
			"15": "<sup>15</sup> တၭစယီရှုၫအ့ၫထဲၩ့ထဲၩ့ဝ့ၫ, ဒဲအံၫစရ့လၭထီးအ လူၬဆ့, လၧၦၥုၪ့တဲၩအလးလၧဂံလဂၫလၭအဖၧၩ့နီၪ လီၫ.",
			"16": "<sup>16</sup> အ့ၪမွဲစဎွၩယဲဂၩနီၪစဲၪ့ဖျိၭတၭ, အီၪက့ၪၥူၪအၥၭ",
			"17": "<sup>17</sup> လၧဆၧအိၩဖၧၩ့လၧမၭကံဒၫအဖၧၩ့လီၫ.- တၭၦလီၩ ဘၪစယီရှုၫအ့ၫတၭ, စံၭဝ့ၫဒၪ, ၦဒၪန့စဎွၩယဲဂၩအီၪ က့ၪၥူၪအၥၭလၧဆၧအိၩဖၧၩ့ လၧမၭကံဒၫအဖၧၩ့နီၪ",
			"18": "<sup>18</sup> လီၫ.- တၭစယီရှုၫအ့ၫစံၭဝ့ၫဒၪ, ချံးစိၩလိးဖၭဒိၪလဖၪ လၧဆၧအိၩဖၧၩ့အခိၪထိၭနီၪ, ဒဲအီၪက့ၪၦၡၩဘဲၫၥိၭအ",
			"19": "<sup>19</sup> မိခိၭဝ့ၫထီးနီၪဆံၭ.- တၭအီၪထီနၥံၪဝ့ၫလဂ့ၩ,လီၩ့ ဆီးနၥံၪအဒုၪအဒၩကျီၪ့ခွံၬ ၦလၧအအီၪလၧခဲၫ့ထုၬ လဖၪနီၪဆံၭ, ဒုၭလ့ၩနုၬဝ့ၫလၧအဒိၩ့လဖၪနီၪအဖၧၩ့ လဂ့ၩး အဂဲးဘဲၫယီၩ နၥံၪအယွၩဖ့ၪလၫ့ခွံၬ အဝ့ၫၥံၪ",
			"20": "<sup>20</sup> လၧနၥံၪအစူၪဖၧၩ့လီၫ.- တၭထီးစယီရှုၫအ့ၫဒဲၦအံၫ စရ့လၭဖိၪမၩၥံၫဝ့ၫ လၧဆၧမၩၥံၫဖၭဒိၪထီးအလူၬဂီၩ့ တၭ,ဆၧမၩအၥၭလၧၦအီၪလၩ့ထးလဖၪနီၪ လ့ၩနုၬ",
			"21": "<sup>21</sup> လၧဒိၩ့အီၪလၧအခိၪဒၧၩ့လဖၪအဖၧၩ့နီၪလီၫ.- တၭ ၦခမျၧးထဲၩ့ထဲၩ့ လၧၦၥုၪ့တဲၩအလး ထီးစယီရှုၫအ့ၫ အအီၪထီးမၭကံဒၫနီၪမုၬမုၬလီၫ. ၦမၩဂဲၩအဖျ့ၩလၧ အံၫစရ့လၭဖိၪလဂၩလါလါအလီၩ့ နးဂၩအ့ၬ,",
			"22": "<sup>22</sup> ထီးနီၪလဖၧၫ့စယီရှုၫအ့ၫစံၭဝ့ၫဒၪ, ဝဲထၪ့ဆၧအိၩ ဖၧၩ့အခိၪထိၭတၭ, ဂဲၫဆိၬထၪ့ခွံၬစဎွၩယဲဂၩလၧဆၧ",
			"23": "<sup>23</sup> အိၩဖၧၩ့နီၪလၧယအီၪဆံၭ.- အဝ့ၫၥံၪမၩဝ့ၫဘဲၫနီၪ တၭ,ဂဲၫဆိၬထၪ့ခွံၬ စဎွၩယဲဂၩနီၪ လၧဆၧအိၩဖၧၩ့ လၧအအီၪနီၪ, ယရုစလံၫ့အစဎွၩလဂၩ, ဟံဘြၧၫ့အ စဎွၩလဂၩ, ယၫမုၫၥၫအစဎွၩလဂၩ, လၫခံၭအစဎွၩ",
			"24": "<sup>24</sup> လဂၩ,အ့ၭဂလၫ့အစဎွၩလဂၩလီၫ.- ထီးအဝ့ၫၥံၪဂဲၫ ဆိၬစဎွၩလဖၪနီၪလၧစယီရှုၫအ့ၫအအီၪတၭ, ဆၧမၩ အၥၭလၧစယီရှုၫအ့ၫ ကိၭအံၫစရ့လၭအၡၩခွၫထီး အလူၬတၭ, စံၭၦၥုၭမုအခိၪလဖၪ လၧအလ့ၩဖိၬအ ခဲၫ့,ဂဲၫၥုၭဘူၭနၥံၪအၥၭ, အီၪက့ၪနၥံၪအခၪ့လၧစဎွၩ လဖၪယီၩအခိၬလီၩ့နီၪဆံၭ. တၭအဝ့ၫၥံၪၥုၭဘူၭအ ၥၭတၭ,အီၪက့ၪအခၪ့ လၧအဝ့ၫၥံၪ အခိၬအဖၫ့ခိၪ",
			"25": "<sup>25</sup> လီၫ.- တၭစယီရှုၫအ့ၫစံၭဝ့ၫ, ၥၭမဲၪဆၧလဂ့ၩ,ဒဲအၪ့ ယိၪဆၧလဂ့ၩတၭ, အီၪက့ၪဆီၪ့နၥံၪအၥၭ, ဒဲမၩဆီၪ့ နၥံၪအဂဲးဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩမိမၩနၥံၪအ ဒုၪအဒၩ လၧနၥံၪဒုၭၥုၭထၫ့ဒၩဝ့ၫ ထီးအလူၬနီၪဘဲၫ နီၪအၥိၭဆ့လီၫ.",
			"26": "<sup>26</sup> လၧခဲၫ့ထဲၩ့တၭ စယီရှုၫအ့ၫဖ့ၬခွံၬ စဎွၩလဖၪနီၪ တၭ,မၩၥံၫဝ့ၫ, ဒဲစၧၩ့လၩ့ဆဲၩဝ့ၫလၧၥံၪ့ယဲထံၭအ လီၩ့တၭ,အဝ့ၫၥံၪလၩ့ဆဲၩဝ့ၫ လၧၥံၪ့အလီၩ့ထီးမုဂၪ",
			"27": "<sup>27</sup> လၩ့လီၫ.- ထီးမုလၩ့နုၬတၭဆၧမၩအၥၭလၧစယီရှုၫ အ့ၫမၪလူၬဆၧတၭ, ၦမၩန့ခွံၬဝ့ၫလၧၥံၪ့အလီၩ့တၭ, ခွံၬၡိၭခွံၬဝ့ၫလၧဆၧအိၩဖၧၩ့, ထီးအလးလၧအအီၪ က့ၪၥူၪယူၭအၥၭလၧအဖၧၩ့တၭ, အီၪက့ၪလိးဖၭဒိၪ လဖၪလၧဆၧအိၩဖၧၩ့အခိၪထိၭနီၪတၭ, ဆၧအီၪဝ့ၫ ထီးမုဆၫလနံၩယီၩလီၫ.",
			"28": "<sup>28</sup> တၭဆၧလၧမုလနံၩနီၪ စယီရှုၫအ့ၫမၩန့မၭကံဒၫ, ဒဲဖ့ၬခွံၬဝ့ၫလၧနၭအနါ, ဒဲမၩဂၭဂီၩ့ခွံၬအစဎွၩ, အဝ့ၫ ဒၪဒဲကယဲၦအီၪလၧဒိၩ့ဖၧၩ့လီၫ. အီၪက့ၪလၩ့ထးဝ့ၫ နးဂၩအ့ၬ. တၭအဝ့ၫဒၪ မၩမၭကံဒၫအစဎွၩ ဘဲၫအ မၩယ့ၫရခိၫအစဎွၩအၥိၭနီၪလီၫ.",
			"29": "<sup>29</sup> ထီးနီၪလဖၧၫ့ စယီရှုၫအ့ၫ စဲၪ့ထၪ့ခွံၬလၧမၭကံဒၫ နီၪဒဲအံၫစရ့လၭထီးအလူၬ ဖိၬအခဲၫ့ထီၩ့လၧလံဘနၫ",
			"30": "<sup>30</sup> တၭ,ဒုၭဆၧထၫ့ဒၩ လံဘနၫလီၫ.- တၭယဟိဝၩဖ့ၪ လၫ့ဝ့ၫဆ့, ဒဲအစဎွၩလၧအံၫစရ့လၭ အစူၪဖၧၩ့တၭ, မွဲအဖ့ၬဝ့ၫလၧနၭအနါ ဒဲကယဲၦအီၪလၧအဖၧၩ့လီၫ. ဒုၭအီၪလၩ့ထးဝ့ၫလၧအဖၧၩ့နးဂၩအ့ၬ. မွဲအမၩအစ ဎွၩဘဲၫအမၩယ့ၫရခိၫအစဎွၩအၥိၭနီၪလီၫ.",
			"31": "<sup>31</sup> တၭစယီရှုၫအ့ၫ စဲၪ့ထၪ့ခွံၬလၧလံဘနၫ ဒဲအံၫစရ့ လၭထီးအလူၬဖိၬအခဲၫ့ ထီၩ့လၧလၫခံၭတၭ, ၥုၪ့အ",
			"32": "<sup>32</sup> တဲၩထၫ့ဒၩဝ့ၫတၭဒုၭဆၧထၫ့ဒၩဝ့ၫလီၫ.- တၭယဟိ ဝၩဖ့ၪလၫ့ခွံၬ လၫခံၭလၧအံၫစရ့လၭအစူၪဖၧၩ့လၧ အမၩန့ဝ့ၫလၧနံၫနံၩလနံၩ ဒဲဖ့ၬခွံၬဝ့ၫလၧနၭအနါ, ဒဲ ကယဲၦအီၪလၧအဖၧၩ့, ဘဲၫကယဲ ဆၧလၧအမၩယူၭ လံဘနၫအၥိၭနီၪလီၫ.",
			"33": "<sup>33</sup> ထီးနီၪလဖၧၫ့ဂံဇၧၫ အစဎွၩ ဟိရၫ့ဂဲၫထၪ့ဝ့ၫဘဲၫ ၥိၭအမိမၩဆၧၩ့လၫခံၭတၭ, စယီရှုၫအ့ၫဖ့ၬခွံၬအဝ့ၫ ဒဲအၡၩခမျၧးတၭ, အီၪက့ၪလၩ့ထးဝ့ၫနးဂၩအ့ၬ.",
			"34": "<sup>34</sup> စယီရှုၫအ့ၫစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧလၫခံၭထီၩ့လၧအ့ၭဂ လၫ့ဒဲအံၫစရ့လၭထီးအလူၬဖိၬအခဲၫ့တၭ, အဝ့ၫၥံၪ",
			"35": "<sup>35</sup> ၥုၪ့တဲၩထၫ့ဒၩဝ့ၫ, ဒဲဒုၭဆၧထၫ့ဒၩဝ့ၫ,- တၭမၩန့ဝ့ၫ လၧမုလနံၩနီၪ ဒဲဖ့ၬခွံၬဝ့ၫလၧနၭအနါ, ဒဲကယဲၦအီၪ လၧအဖၧၩ့ထီးအလူၬနီၪ မၩဂၭဂီၩ့ဝ့ၫလၧမုလနံၩနီၪ ဘဲၫကယဲဆၧလၧအမၩယူၭ လၫခံၭအၥိၭနီၪလီၫ.",
			"36": "<sup>36</sup> တၭစယီရှုၫအ့ၫစဲၪ့ထၪ့ခွံၬလၧအ့ၭဂလၫ့, ဒဲအံၫစ ရ့လၭထီးအလူၬဖိၬအခဲၫ့ထီၩ့လၧဟံဘြၧၫ့တၭ, ဒုၭ",
			"37": "<sup>37</sup> ဆၧထၫ့ဒၩဝ့ၫ,- ဒဲဖ့ၬခွံၬဝ့ၫလၧနၭအနါ, ဒဲအစဎွၩဒဲ အဒိၩ့လဖၪထီးအလူၬ, ဒဲကယဲၦအီၪလၧအဖၧၩ့ထီး အလူၬတၭ, အီၪက့ၪလၩ့ထးဝ့ၫနးဂၩအ့ၬ. ဘဲၫကယဲ ဆၧလၧအမၩယူၭအ့ၭဂလၫ့အၥိၭနီၪတၭ, မၩဂၭဂီၩ့ ခွံၬဝ့ၫဒဲကယဲၦအီၪလၧအဖၧၩ့ ထီးအလူၬလီၫ.",
			"38": "<sup>38</sup> တၭစယီရှုၫအ့ၫထဲၩ့ထဲၩ့, ဒဲအံၫစရ့လၭထီးအလူၬ",
			"39": "<sup>39</sup> ဖိၬအခဲၫ့ထီၩ့လၧဒံဘၧၫတၭဒုၭဆၧထၫ့ဒၩဝ့ၫး- ဒဲမၩ န့ဝ့ၫ,ဒဲအစဎွၩ, ဒဲအဒိၩ့ထီးအလူၬလဖၪတၭ, ဖ့ၬခွံၬ ဝ့ၫလၧနၭအနါ, ဒဲမၩဂၭဂီၩ့ခွံၬကယဲၦအီၪလၧအဖၧၩ့ ထီးအလူၬလီၫ. အီၪက့ၪလၩ့ထးဝ့ၫနးဂၩအ့ၬ. ဘဲၫအ မၩယူၭဟံဘြၧၫ့အၥိၭနီၪမၩဒံဘၧၫ ဒဲအစဎွၩဘဲၫနီၪ အၥိၭး ဘဲၫအမၩယူၭဆ့လံဘနၫ ဒဲအစဎွၩအၥိၭနီၪ လီၫ.",
			"40": "<sup>40</sup> တၭစယီရှုၫအ့ၫကျီၪ့ခွံၬ ခိၪလီၩ့ထိၩ့ချိၬအခးထၧၫ့ ခးယၫ,ဒဲမုခံၫ့အခး, ဒဲဆၧဒၩဖၧၩ့အခး, ဒဲထံၫထၪ့ဖျိၭ အခး,ဒဲအဝ့ၫၥံၪ အစဎွၩလဖၪထီးအလူၬလီၫ. အီၪ က့ၪလၩ့ထးဝ့ၫနးဂၩအ့ၬ. မၩဂၭဂီၩ့ကယဲဆၧလၧအ ၥၪဝ့ၫ,ဘဲၫယဟိဝၩ အံၫစရ့လၭအယွၩ မၪလူၬဝ့ၫအ",
			"41": "<sup>41</sup> ၥိၭနီၪလီၫ.- တၭစယီရှုၫအ့ၫဖ့ၬခွံၬဆၧလၧကၫဒ့ၭဘၫ န့အၫဖိးလၧဂၫဇၫ, ဒဲဂိၡံၫ့အခးထၧၫ့ခးယၫဖိးလၧဂံ",
			"42": "<sup>42</sup> ဘအၧၫ့လီၫ.- တၭစဎွၩထီးအလူၬလဖၪယီၩ ဒဲအ ထံၫၥံၪခးၥံၪနီၪ စယီရှုၫအ့ၫမၩန့ဝ့ၫလစီၪ့ဎးလီၫ. အ ဂဲးဘဲၫယီၩ ယဟိဝၩအံၫစရ့လၭအယွၩ ဒုၭဆၧလၧ",
			"43": "<sup>43</sup> အံၫစရ့လၭအဂးလီၫ.- တၭစယီရှုၫအ့ၫ ထဲၩ့ထဲၩ့ဒဲ အံၫစရ့လၭထီးအလူၬ ဖိၬအခဲၫ့ထီၩ့လၧၦၥုၪ့တဲၩအ လးလၧဂံလဂၫလၭအဖၧၩ့နီၪလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ထီးဟၫဇၧၫအစဎွၩယၫဘံၫ့နါဂၧၫ့ဝ့ၫတၭ, ဆၧမၩ အၥၭလၧအအၪ့မၧၫ့လၩ့ဆၧလၧမၫဒၧၫ့အစဎွၩယိဘၭ",
			"2": "<sup>2</sup> ဒဲၡံမအၧၫ့အစဎွၩ, ဒဲအၭကၡၭအစဎွၩ,- ဒဲစဎွၩအီၪ လၧခိၪလီၩ့ထိၩ့ချိၬ လၧမုဖၩလခီၫ, ဒဲလၧဆၧဒၩဖၧၩ့ လၧခံၫ့နရ့ၭလၧမုခံၫ့လခီၫ, ဒဲလၧခိၪလီၩ့ဆူၭ, ဒဲလၧ",
			"3": "<sup>3</sup> ဒီၫအနဲၩ့လၧမုနုၬလခီၫ,- ဒဲၦကၫနအၫ့ဖိၪလၧမုထၪ့ ဒဲလၧမုနုၬ, ဒဲၦအၫမိၫဖိၪ, ဒဲၦဟံၥၭဖိၪ, ဒဲၦပံရ့ၭဖိၪ, ဒဲၦယ့ဘုၫဖိၪလၧခိၪလီၩ့ခိၪ, ဒဲၦဟံဝဲၫဖိၪလၧဟၧမၧၫ့",
			"4": "<sup>4</sup> အခၪ့ထံၭလၧခးမံဇပၫအဖၧၩ့နီၪလီၫ.- တၭအဝ့ၫၥံၪ စဲၪ့ထၪ့ဝ့ၫ အဝ့ၫၥံၪဒဲအၥုၭမုထီးအလူၬ ဖိၬထၪ့အခဲၫ့, ၦခမျၧးအၪအၪလ့ၬ, အၪဝ့ၫဘဲၫမ့ၭအီၪလၧမၫဆမံၭ နဲၩ့အၥိၭနီၪ, အီၪလၧကၥ့ၪလဖၪ ဒဲလဲၪ့ၥုၭအၪအၪ",
			"5": "<sup>5</sup> လ့ၬလီၫ.- တၭထီးစဎွၩထီးအလူၬနီၪ အီၪကိၩ့အီၪ ကီၪ့လၧအဖၭနံၩဖၭၥၫ့အထီတၭ, ဂဲၫၥုၪ့တဲၩစီၪ့ဎး လၧမံရိၫ့အထံၫနဲၩ့, ဘဲၫၥိၭအမိဒုၭဆၧထၫ့ဒၩအံၫစရ့ လၭအဂဲးလီၫ.",
			"6": "<sup>6</sup> တၭယဟိဝၩစံၭစယီရှုၫအ့ၫ, ထီးအၪ့ယိၪဆၧလၧ အဝ့ၫၥံၪအကၠီၩ့နီၪလဂ့ၩ, အဂဲးဘဲၫယီၩ, ကဲဂီၩခိၬအ ခၫဘဲၫယီၩ ယမိဖ့ၪလၫ့အဝ့ၫၥံၪဘၪဆၧမၩၥံၫ ထီးအ လူၬလၧအံၫစရ့လၭ အမ့ၬယၫလီၫ. တၭနမိဘၪဖ့ၬ ထ့ၬအကၥ့ၪအခၪ့ထီၪ့, ဒဲဆူၭထၪ့ခွံၬအလဲၪ့ၥုၭလၧမ့ၪ",
			"7": "<sup>7</sup> လီၫ.- စယီရှုၫအ့ၫလ့ၩဝ့ၫတၭ, ၦၥုၭဖိၪထီးအလူၬဖိၬ အခဲၫ့ထၫ့ဒၩရှုၭအဝ့ၫၥံၪ လၧထံၫမံရိၫ့အနဲၩ့တၭ, ဖ့ၬ",
			"8": "<sup>8</sup> ခွံၬဝ့ၫလီၫ.- တၭယဟိဝၩ ဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪလၧအံၫ စရ့လၭအစူၪဖၧၩ့, လၧအဖ့ၬခွံၬဝ့ၫတၭ, လီၩ့ဆီးဝ့ၫဖိး လၧဇဲဒၧၫ့ဖၭဒိၪ, ဒဲဖိးလၧအမံၭစြံၫဖီၭမ့အံၫ့, ဒဲဖိးလၧ ခိၪလီၩ့ဆူၭမံဇပၫလၧမုထၪ့လခီၫတၭ, ဖ့ၬခွံၬအဝ့ၫၥံၪ",
			"9": "<sup>9</sup> ထီးအအီၪလၩ့ထးလၧအဂးနးဂၩအ့ၬ.- တၭစယီရှုၫ အ့ၫမၩဘၪအဝ့ၫၥံၪ ဘဲၫယဟိဝၩ မၪလူၬဝ့ၫအၥိၭနီၪ လီၫ. ဖ့ၬထ့ၬကၥ့ၪအခၪ့ထီၪ့တၭ, ဆူၭထၪ့ခွံၬအလဲၪ့ ၥုၭလၧမ့ၪလီၫ.",
			"10": "<sup>10</sup> အထီထီးနီၪ စယီရှုၫအ့ၫထဲၩ့ထဲၩ့တၭ, မၩန့ဟၫ ဇၧၫဒဲဖ့ၬခွံၬအစဎွၩလၧနၭလီၫ. အဂဲးဘဲၫယီၩ လၧ အခၪ့ထံၭနီၪ ဟၫဇၧၫမွဲဘၩ့မုးထီးအလူၬနီၪ အခိၪ",
			"11": "<sup>11</sup> လီၫ.- အဝ့ၫၥံၪဖ့ၬခွံၬကယဲၦအီၪလၧအဖၧၩ့ လၧနၭအ နါထီးအလူၬတၭ, မၩဂၭဂီၩ့ဝ့ၫလီၫ. ၦလၧအၥၪဝ့ၫနီၪ အီၪလၩ့ထးဘၪနးဂၩအ့ၬ. တၭဆူၭထၪ့ခွံၬ ဟၫဇၧၫ",
			"12": "<sup>12</sup> လၧမ့ၪလီၫ.- စဎွၩလဖၪနီၪအဒိၩ့ထီးအလူၬ ဒဲအစဎွၩ လဖၪထီးအလူၬနီၪစယီရှုၫအ့ၫမၩန့ဝ့ၫတၭ, ဖ့ၬခွံၬဝ့ၫ လၧနၭအနါလီၫ. မၩဂၭဂီၩ့ဝ့ၫလူၬထူၬဆံၫ့ဘၩ့, ဘဲၫ ယဟိဝၩအခ့ၫအၡၩစမိစ့ၭ မၪလူၬဝ့ၫအၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> အ့ၪမွဲဒိၩ့လၧအဂုးခၧၫ့ လၧဆၧစီၩ့ခိၪလဖၪနီၪအံၫစရ့ လၭဆူၭခွံၬအ့ၬ. ဆူၭခွံၬန့ၫဟၫဇၧၫလဒိၩ့နီၪး အဝ့ၫ",
			"14": "<sup>14</sup> နီၪစယီရှုၫအ့ၫဆူၭထၪ့ခွံၬဝ့ၫလီၫ.- တၭဒိၩ့လဖၪအ ဆၧဖိၪဆၧလံၩထီးအလူၬ, ဒဲအဆၧဖိၪဆၧဎါနီၪၦအံၫ စရ့လၭဖိၪမၩန့ဝ့ၫ လၧဆၧအၪ့ဂူၬန့ လၧအဂးဒၪဝ့ၫ လီၫ. အ့ၪမွဲၦၡၩနီၪဖ့ၬခွံၬဝ့ၫ လၧနၭအနါ ထီးအမၩ ဂၭဂီၩ့ဝ့ၫကိၭဂၩဒ့ၭနီၪလီၫး အီၪက့ၪလၩ့ထးၦလၧ",
			"15": "<sup>15</sup> အၥၪဝ့ၫနးဂၩအ့ၬ.- ဘဲၫယဟိဝၩမၪလူၬအခ့ၫအၡၩ စမိစ့ၭအၥိၭနီၪ, စမိစ့ၭမၪလူၬ စယီရှုၫအ့ၫ ဘဲၫနီၪအ ၥိၭတၭ, စယီရှုၫအ့ၫမၩဝ့ၫဘဲၫနီၪအၥိၭဆ့လီၫ. ဆၧ လၧယဟိဝၩမၪလူၬစမိစ့ၭထီးအလူၬနီၪ အဝ့ၫဒၪအီၪ က့ၪလၩ့ထးဆၧလၧအလမၩဘၪနီၪ နးမံၩ့အ့ၬ.",
			"16": "<sup>16</sup> တၭဘဲၫနီၪအၥိၭစယီရှုၫအ့ၫ မၩန့ခးထၧၫ့ဘံၪ့ယၫ နီၪဒဲခိၪလီၩ့ထိၩ့ချိၬ, ဒဲခးလၧမုခံၫ့ထၧၫ့ဘံၪ့ယၫ, ဒဲဂိ ၡံၫ့ထၧၫ့ခးယၫ, ဒဲခိၪလီၩ့ဆူၭ,ဒဲဆၧဒၩဖၧၩ့, ဒဲအံၫစရ့",
			"17": "<sup>17</sup> လၭအခိၪလီၩ့ထိၩ့ချိၬ, ဒဲခိၪလီၩ့ဆူၭနီၪ,- လၧခိၪလီၩ့ ဟၫလၭလၧအလ့ၩထၪ့လၧစံအၫဖိး လၧဘၫအလၭဂၬ လၧလ့ၭဘနၧၫ့အခိၪလီၩ့ဆူၭဖၧၩ့း လၧခိၪလီၩ့ဟၧမၧၫ့ အခၪ့ထံၭလီၫ. တၭမၩန့အဝ့ၫၥံၪအစဎွၩ ထီးအလူၬ",
			"18": "<sup>18</sup> နီၪတၭ, ဖ့ၬခွံၬဝ့ၫ,ဒဲမၩၥံၫဝ့ၫလီၫ.- စယီရှုၫအ့ၫဒုၭၥုၭလၧ",
			"19": "<sup>19</sup> စဎွၩထီးအလူၬနီၪအၪနံၩအၪၥၫ့ ယံၬယံၬလီၫ.- တၭ ဒိၩ့လၧအမၩဘၪလိၬအိၭလိၬအၥၭ လၧၦအံၫစရ့လၭ ဖိၪအီၪနးဒိၩ့အ့ၬ. အီၪန့ၫဟံဝဲၫဖိၪ, ၦအီၪဝ့ၫလၧဂံဘ အၧၫ့အဖၧၩ့နီၪလီၫ. တၭအဝ့ၫၥံၪမၩန့ဂူၫဂၩၥံၪ ထီး အလူၬလၧဆၧဒုၭၥုၭအဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> အဂဲးဘဲၫယီၩ လၧအဝ့ၫၥံၪအၥၭမိဆီၪ့ထၪ့ဘဲၫၥိၭ အမိဂဲၫထၫ့ဒၩ အံၫစရ့လၭ လၧဆၧဒုၭၥုၭအဖၧၩ့နီၪ မွဲအအီၪထၪ့လၧယဟိဝၩလခီၫ, ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ အဝ့ၫၥံၪလူၬထူၬဆံၫ့ဘၩ့ ဘဲၫၥိၭအဝ့ၫၥံၪထီးဘၪခိး ဘၪတၩလဂ့ၩ, အ့ၪမွဲဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခွံၬဝ့ၫ, ဘဲၫ ယဟိဝၩမၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ.",
			"21": "<sup>21</sup> တၭဆၧအထီထီးနီၪစယီရှုၫအ့ၫဂဲၫဒၪ့ထ့ၬခွံၬၦအၫ နၭဖိၪလၧခိၪလီၩ့ထိၩ့ချိၬလၧဟံဘြၧၫ့, လၧဒံဘၧၫ, လၧ အၫနၭ, ဒဲလၧခိၪလီၩ့ယုဒၫထီးအလူၬ, ဒဲလၧခိၪလီၩ့ အံၫစရ့လၭ ထီးအလူၬလီၫ. တၭစယီရှုၫအ့ၫ မၩဂၭ ဂီၩ့ဝ့ၫဒဲအဒိၩ့လဖၪနီၪလီၫ.",
			"22": "<sup>22</sup> တၭၦအၫနၭဖိၪအီၪလၩ့ထးဘၪ လၧၦအံၫစရ့လၭ ဖိၪအကျၩအ့ၬ. အီၪန့ၫလၧဂၫဇၫအဖၧၩ့, ဒဲလၧဂၭၥၭ အဖၧၩ့, ဒဲလၧအၭစဒီၭအဖၧၩ့နီၪ, အီၪလၩ့ထးထီးနီၪ လီၫ.",
			"23": "<sup>23</sup> တၭစယီရှုၫအ့ၫမၩန့ခးထၧၫ့ဘံၪ့ယၫ, ဘဲၫကယဲဆၧ လၧယဟိဝၩစံၭစမိစ့ၭအၥိၭနီၪတၭ, စယီရှုၫအ့ၫဖ့ၪ လၫ့ဝ့ၫလၧအံၫစရ့လၭ လၧဆၧန့ၥၫအလးဘဲၫအဆၧ အၪ့နၩ့ဖၭလစီၪ့လစီၪ့အၥိၭ, ဘဲၫအဒီၪ့လဖၪအၥိၭနီၪ လီၫ. တၭထံၫၥံၪခးၥံၪနီၪ အီၪပွံၭဝ့ၫ လၧဆၧဒုၭၥုၭ လီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭအယီၩမွဲခးအစဎွၩလဖၪ လၧၦအံၫစရ့လၭဖိၪ ဖ့ၬခွံၬဝ့ၫ, ဒဲမၩန့အခးလဖၪလၧယီၫဒၫ့ဝါလခီၫ, လၧမု ထၪ့လခီၫလၧထံၫမိၡါအၫနၫ့ဖိး လၧခိၪလၩ့ဟၧမၧၫ့,",
			"2": "<sup>2</sup> ဒဲဆၧပျၩ့ထၧၫ့ဘံၪ့ယၫ လၧမုထၪ့လခီၫ,- ၦအၫမိၫဖိၪ အစဎွၩစဲဟၫ့ လၧအအီၪဝ့ၫလၧဟ့ၭၡဘၫ့အဖၧၩ့, ဒဲ ပၧၩ့ဆၧလၧအရိအၫ, လၧအအီၪလၧထံၫမိၡါအၫနၫ့ အနဲၩ့ထံၭ, ဒဲဆၧအီၪဝ့ၫလၧထံၫချိၬအၥၭကျၩလၧဂံလ အၭဖိၭဖၫ့, ဒဲဖိးလၧထံၫယၫဘီၭလၧအအီၪဝ့ၫလၧၦ",
			"3": "<sup>3</sup> အၫမိၫဖိၪအခးနဲၩ့,- ဒဲဆၧပျၩ့ဖိးလၧမၫဆမံၭခံၫ့နရ့ၭ လၧမုထၪ့လခီၫ, ဒဲဖိးလၧဆၧပျၩ့ အမၫဆမံၭ, မၫဆ မံၭထံၫလၪ လၧမုထၪ့လခီၫ, ဖၧၩ့ၥၭဘ့ၭၥယ့ၭစမိၭ,",
			"4": "<sup>4</sup> ဒဲလၧမုခံၫ့လၧအၭၡဒီၭပံစဂၫအခၪ့ထံၭလီၫ.- ဒဲခးအ နဲၩ့လဖၪဘၪဆဲၫ့လၧဘၫၡၫ့အစဎွၩအီၭ, လၧအအီၪ လၧၦအဆီၪ့ဖိၪလၧအအီၪလၩ့ထးအကျၩ, လၧအအီၪ လၧအၭၡတြီၭ, ဒဲအ့ဒအဲၫအဖၧၩ့လဖၪအကျၩလဂၩ",
			"5": "<sup>5</sup> နီၪလီၫ.- မွဲအပၧၩ့ဝ့ၫလၧခိၪလီၩ့ဟၧမၧၫ့ ဒဲလၧစၫလ ကၫ,ဒဲလၧဘၫၡၫ့ထၧၫ့ဘံၪ့ယၫဖိးလၧဂ့ၭရှုၫဖိၪ, ဒဲၦ မ့ၫအကၭဖိၪ, ဒဲဂံလအၭဖိၭဖၫ့ၥံၪအခးနဲၩ့ထံၭ, ဟ့ၭၡ",
			"6": "<sup>6</sup> ဘၫ့အစဎွၩစဲဟၫ့အခးနဲၩ့ထံၭလီၫ.- အဝ့ၫၥံၪနီၪယဟိ ဝၩအခ့ၫအၡၩစမိစ့ၭ, ဒဲၦအံၫစရ့လၭဖိၪ ဖ့ၬခွံၬဝ့ၫ တၭ,ယဟိဝၩအခ့ၫအၡၩစမိစ့ၭ ဖ့ၪလၫ့အခးလၧၦရု ဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪ, ဒဲၦမနၭစ့ၫဖိၪလခီၫဒီၪ့လၧဆၧန့ၥၫ အဂးလီၫ.",
			"7": "<sup>7</sup> တၭအယီၩမွဲခးအစဎွၩလဖၪ လၧစယီရှုၫအ့ၫဒဲၦ အံၫစရ့လၭဖိၪဖ့ၬခွံၬဝ့ၫ လၧယီၫဒၫ့အမုနုၬအယီၩလခီၫ, လၧဘၫအလၭဂၬ လၧလ့ၭဘနၧၫ့အခိၪလီၩ့ဆူၭဖၧၩ့ ထီၩ့လၧခိၪလီၩ့ဟၫလၭ, လၧအလ့ၩထၪ့ လၧစံအၫး လၧစယီရှုၫအ့ၫဖ့ၪလၫ့အခး လၧၦအံၫစရ့လၭဖိၪအ ဒီၪ့လဖၪအဆၧန့ၥၫအဂး, ဘဲၫအအၪ့နၩ့ဖၭ လစီၪ့လ",
			"8": "<sup>8</sup> စီၪ့အၥိၭနီၪး- လၧခိၪလီၩ့ထိၩ့ချိၬ, ဒဲလၧခိၪလီၩ့ဆူၭ ဖၧၩ့,ဒဲလၧဆၧပျၩ့ဖၧၩ့, ဒဲလၧထံၫထၪ့ဖျိၭလဖၪ, ဒဲလၧ ၡါမုနၧၫ့ဖၫ, ဒဲလၧခးမုခံၫ့လခီၫ, ၦဟံၥၭဖိၪ,ၦအၫမိၫ ဖိၪ,ၦကၫနအၫ့ဖိၪ, ၦပံရ့ၭဖိၪ,ၦဟံဝဲၫဖိၪ,ဒဲၦယ့ဘုၫ ဖိၪလီၫ.",
			"9": "<sup>9</sup> ယ့ၫရခိၫအစဎွၩလဂၩ, ဟဲၫလၧအအီၪလၧဘ့ၥလၭ",
			"10": "<sup>10</sup> အနဲၩ့အစဎွၩလဂၩး- ယရုစလံၫ့အစဎွၩလဂၩး ဟံ",
			"11": "<sup>11</sup> ဘြၧၫ့အစဎွၩလဂၩ,- ယၫမုၫၥၫအစဎွၩလဂၩ, လၫခံၭ",
			"12": "<sup>12</sup> အစဎွၩလဂၩ,- အ့ၭဂလၫ့အစဎွၩလဂၩး ဂ့ဇၧၫအ",
			"13": "<sup>13</sup> စဎွၩလဂၩ,- ဒံဘၧၫအစဎွၩလဂၩး ဂံဒၧၫအစဎွၩ",
			"14": "<sup>14</sup> လဂၩ,- ဟီမၫအစဎွၩလဂၩး အၫရၭအစဎွၩလဂၩး",
			"15": "<sup>15</sup> လံဘနၫ အစဎွၩလဂၩ, အဒၧလၫ့ အစဎွၩလဂၩး",
			"16": "<sup>16</sup> မၭကံဒၫအစဎွၩလဂၩး ဘ့ၥလၭအစဎွၩလဂၩး",
			"17": "<sup>17</sup> တၭပုၫအၫအစဎွၩလဂၩး ဟံဖၧၫအစဎွၩလဂၩး",
			"18": "<sup>18</sup> အၫဖ့ၭအစဎွၩလဂၩး လၭၡရၧၫ့ အစဎွၩလဂၩး",
			"19": "<sup>19</sup> မၫဒၧၫ့ အစဎွၩလဂၩး ဟၫဇၧၫ အစဎွၩလဂၩး ၡံမ",
			"20": "<sup>20</sup> ရၧၫ့မံရၧၫ့အစဎွၩလဂၩး- အၭကၡၭအစဎွၩလဂၩး",
			"21": "<sup>21</sup> တအၫနၭအစဎွၩလဂၩး မဂံဒိၫအစဎွၩလဂၩး ကၫ",
			"22": "<sup>22</sup> ဒ့ၭအစဎွၩလဂၩး- ယီၭနံၫအၫ့လၧကၫမ့ၫလၭအလီၩ့ အစဎွၩလဂၩး ဒီၫအစဎွၩ လၧဒီၫအလးထၪ့ထီၫလ",
			"23": "<sup>23</sup> ဂၩး- ဂံလဂၫလၭ အဆၨၩလဖၪ အစဎွၩလဂၩး",
			"24": "<sup>24</sup> တၧဇၫအစဎွၩလဂၩနီၪလီၫ. စဎွၩထီးအလူၬနီၪ အီၪ ဝ့ၫၥၧၫ့ဆံၫလဂၩလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> တၭစယီရှုၫအ့ၫအၥၭၡါယူၭ, ဒဲလ့ၩနုၬယူၭလၧနံၪ့လ ဖၪအကျၩလီၫ. တၭယဟိဝၩစံၭအဝ့ၫဒၪ, နၥၭၡါယူၭ တၭ,ဂၪ့ခိၪလၧၦမိဘၪမၩန့ဒံၭဝ့ၫနီၪ, အီၪဒံၭအၪအၪ လ့ၬလီၫ.",
			"2": "<sup>2</sup> တၭဂၪ့ခိၪလၧအအီၪဒံၭနီၪ, မွဲအယီၩး- ၦ ဖလံၡၫဖိၪအခးနဲၩ့ထံၭထီးအလူၬ, ဒဲၦဂ့ၭရှုရဲၫအခး ထၧၫ့ဘံၪ့ယၫ, လၧစဲဟီၫလၧအအီၪလၧအံဇံၭအမ့ၬ ယၫဖိးလၧအ့ၭကြၧၫ့အခးနဲၩ့ထံၭ လၧမုဖၩလခီၫ,လၧ ဆၧအီၪက့ၪလၧၦကၫနအၫ့ဖိၪအဂး, ဖလံၡၫဖိၪအၦဒိၪ ယဲဂၩအခး ၦဂၫဇၫဖိၪအခး, ဒဲၦအၭစဒီၭဖိၪအခး, ၦ အ့ၡကၫလၧၫ့ဖိၪအခး, ၦဂံၭတဲၭဖိၪအခး ဒဲၦအၫဝဲၫ",
			"4": "<sup>4</sup> ဖိၪအခးဆ့လီၫ.- လၧမုခံၫ့လခီၫနီၪ ၦကၫနအၫ့ဖိၪအခး ထၧၫ့ဘံၪ့ယၫ, ဒဲမံရၫလၧအအီၪလၧၦစဲဒၧၫ့ဖိၪ အခး နဲၩ့ထံၭဖိးလၧအၫဖ့ၭ, ဖိးလၧအၫမိၫဖိၪအခးနဲၩ့ထံၭ,",
			"5": "<sup>5</sup> ဒဲၦဂံၭဘျဲၭဖိၪအခး, ဒဲလ့ၭဘနၧၫ့လၧမုထၪ့လခီၫထၧၫ့ ဘံၪ့ယၫ, လၧဘၫအလၭဂၬအခိၪလီၩ့ ဟၧမၧၫ့အခၪ့",
			"6": "<sup>6</sup> ထံၭ,ဖိးလၧဆၧလ့ၩနုၬ လၧဟၫမၭလီၫ.- ကယဲခိၪလီၩ့ ဖိၪလၧလ့ၭဘနၧၫ့ဖိးလၧမံၭစၫဖီၭမ့အၧၫ့ ဒဲၦစဲဒၧၫ့ဖိၪ ထီးအလူၬနီၪ ယမိနၫ့ထၪ့ခွံၬဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ အမ့ၬယၫလီၫ. အ့ၪမွဲနဝ့ၫဒၪယီၩဖၭဆၧတၭ, အၪ့နၩ့ ဖၭဆၧနီၪ လၧအံၫစရ့လၭဖိၪလၧဆၧန့ၥၫအဂး, ဘဲၫ",
			"7": "<sup>7</sup> ယမၪလူၬနၧၩ အၥိၭနီၪဆံၭ.- မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩအၪ့နၩ့ဖၭ ထံၫၥံၪခးၥံၪယီၩ လၧဆၧန့ၥၫ အလးလၧၦခွံၫဒီၪ့, ဒဲလၧၦမနၭစ့ၫဖိၪလခီၫဒီၪ့အဂးနီၪ ဆံၭ.",
			"8": "<sup>8</sup> တၭအဝ့ၫနီၪ, ဒဲၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪနီၪန့ဘၪ ယူၭအဆၧန့ၥၫလၧစမိစ့ၭဖ့ၪလၫ့ဝ့ၫ လၧယီၫဒၫ့ဝါလ ခီၫလၧမုထၪ့လခီၫဘဲၫယဟိဝၩအခ့ၫအၡၩစမိစ့ၭဖ့ၪ",
			"9": "<sup>9</sup> လၫ့ဝ့ၫအၥိၭနီၪ,- လၧအရိအၧၫလၧအအီၪလၧအၫနၫ့ အထံၫနဲၩ့, ဒဲဒိၩ့အီၪဝ့ၫလၧထံၫချိၬအၥၭကျၩ ဒဲဆၧ",
			"10": "<sup>10</sup> ပျၩ့မ့ၭဒဘၫထၧၫ့ဘံၪ့ယၫဖိးလၧဒဲဘၫ့,- ဒဲၦအၫမိၫဖိၪ အစဎွၩစဲဟၫ့လၧအပၧၩ့ဆၧ လၧဟ့ၭၡဘၫ့အဖၧၩ့လ ဂၩအဒိၩ့လဖၪထီးအလူၬ, ဖိးလၧၦအၫမၧၫ့ဖိၪအခး",
			"11": "<sup>11</sup> နဲၩ့ထံၭး- ဒဲဂံလအၭ, ဒဲၦဂ့ၭရှုၫဖိၪ, ဒဲၦမၫအကၭဖိၪ အခးနဲၩ့ထံၭ, ဒဲခိၪလီၩ့ဟၧမၧၫ့ ထၧၫ့ခးယၫ, ဒဲဘၫ",
			"12": "<sup>12</sup> ၡၫ့ထၧၫ့ဘံၪ့ယၫဖိးလၧစၫလကၭ,- ဒဲဘၫၡၫ့အစဎွၩ အီၭလၧအပၧၩ့ဆၧလၧအၭၡတြီၭအဖၧၩ့, ဒဲလၧအ့ဒ အဲၫအဖၧၩ့လၧအအီၪလၩ့ထး လၧၦအဆီၪ့ဖိၪလၧအ အီၪလၩ့ထးအကျၩလဂၩ အဘၩ့အမုးထၧၫ့ဘံၪ့ယၫ လီၫ. တၭစမိစ့ၭဖ့ၬခွံၬ အဝ့ၫၥံၪဒဲနၫ့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"13": "<sup>13</sup> မွဲလါနၫ့ဘိၩၦအံၫစရ့လၭဖိၪ နၫ့ထၪ့ခွံၬဘၪၦဂ့ၭရှုၫ ဖိၪ,ဒဲၦမၫအကၭဖိၪအ့ၬ. အ့ၪမွဲၦဂ့ၭရှုၫဖိၪ, ဒဲၦမၫအ ကၭဖိၪအီၪဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ အကျၩထီးမုဆၫ",
			"14": "<sup>14</sup> လနံၩယီၩလီၫ.- အ့ၪမွဲၦလံဝဲၫဖိၪနီၪ မွဲအဖ့ၪလၫ့ဝ့ၫလၧ ဆၧန့ၥၫအ့ၬး ယဟိဝၩအံၫစရ့လၭအယွၩ အဆၧလု မၩလၧမ့ၪမွဲအဝ့ၫၥံၪအဆၧန့ၥၫ ဘဲၫအစံၭအဝ့ၫၥံၪအ ၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> တၭစမိစ့ၭဖ့ၪလၫ့ဆၧလၧ ၦရုဘံၫ့ဖိၪလဒီၪ့ဘဲၫအဂံၪ့",
			"16": "<sup>16</sup> ဒီၪ့လဖၪအၥိၭနီၪလီၫ.- တၭအခးနဲၩ့ထံၭနီၪမွဲလၧအ ရိအၧၫလၧအအီၪလၧထံၫမိၡါအၫနၫ့အနဲၩ့, ဒဲဒိၩ့အီၪ ဝ့ၫလၧထံၫချိၬအၥၭကျၩ, ဒဲဆၧပျၩ့ထၧၫ့ဘံၪ့ယၫလၧ",
			"17": "<sup>17</sup> မ့ၭဒဘၫအနဲၩ့ထံၭ, ဟ့ၭၡဘၫ့,- ဒဲအဒိၩ့ထီးအလူၬ လၧအအီၪဝ့ၫလၧဆၧပျၩ့ဖၧၩ့, ဒဲဘၫ့,ဒဲဘၫမိၭဘၫအ",
			"18": "<sup>18</sup> လၭ,ဒဲဘ့ၭၥဘၫအလၭမံအၧၫ့,- ဒဲယၭဟၫဇၫ,ဒဲကၫ",
			"19": "<sup>19</sup> ဒ့ၭမိၭ,ဒဲမံၫဖ့လၭ,- ဒဲကၧၫယၭၥအံၫ့, ဒဲစံဘမၫ,ဒဲဇ့ၭ",
			"20": "<sup>20</sup> ရ့ၭၡၫဟၫ လၧခိၪလီၩ့အဆူၭအခိၪလီၩ့.- ဒဲဘ့ၭၥပံ",
			"21": "<sup>21</sup> အီၫ,ဒဲအၭၡဒီၭ, ဖံစဂၫ, ဒဲဘ့ၭယ့စမီၭ,- ဒဲဆၧပျၩ့အဒိၩ့ ၥံၪထီးအလူၬ, ဒဲၦအၫမိၫဖိၪအစဎွၩစဲဟၫ့လၧအပၧၩ့ ဆၧလၧဟ့ၭၡဘၫ့အဖၧၩ့ လဂၩအဘၩ့အမုးထၧၫ့ဘံၪ့ ယၫ,ၦလၧစမိစ့ၭ ဖ့ၬခွံၬလၧမံဒအၫ့ အၦဒိၪလဖၪအ ၥိၭ,စအံဝဲၫ,ဒဲစရံကံၫ့, ဒဲစဇၧၫ့,ဒဲစဟၧၫ,ဒဲစရံဘၫ,လၧ အမွဲစဲဟၫ့အၦဒိၪလဖၪ, အီၪဝ့ၫလၧထံၫၥံၪခးၥံၪအ",
			"22": "<sup>22</sup> ဖၧၩ့နီၪလီၫ.- စဘံအီၫအဖိၪခွၫမီၪစဘၫလၫ့နီၪ ၦအံၫ စရ့လၭဖိၪမၩၥံၫလၧနၭ လၧၦလၧအဘၪဆၧမၩၥံၫဝ့ၫ",
			"23": "<sup>23</sup> လၧအကျၩနီၪလီၫ.- တၭၦရုဘံၫ့ဖိၪအခးနဲၩ့ထံၭနီၪမွဲ ထံၫယီၫဒၫ့ဒဲအနဲၩ့ထံၭလီၫ. အနီၪမွဲၦရုဘံၫ့ဖိၪအဆၧ န့ၥၫ,ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, ဒိၩ့လဖၪ,ဒဲအတဝၫ့ လဖၪနီၪလီၫ.",
			"24": "<sup>24</sup> တၭစမိစ့ၭဖ့ၪလၫ့ဆၧလၧဂၭလဒီၪ့နီၪ, ဘဲၫၦဂၭဖိၪ",
			"25": "<sup>25</sup> အဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.- တၭအဝ့ၫၥံၪအခးနဲၩ့ ထံၭနီၪမွဲယ့ၫဇၧၫဒဲဂံလအၭအဒိၩ့ထီးအလူၬ, ဒဲၦအၫ မၧၫ့ဖိၪအခးဖိၭဖၫ့ခး ဖိးလၧအရိအၧၫလၧအအီၪလၧ",
			"26": "<sup>26</sup> ရၭဘၫအမ့ၬယၫ,- ဒဲလၧဟ့ၭၡဘၫ့ဖိးလၧရၫမၭမံၭ ဇပၫ,ဒဲဘ့ၭတနံၫ့ ဒဲလၧဖ့ၫဟန့အံၫ့ဖိးလၧဒံဘၧၫအခး",
			"27": "<sup>27</sup> နဲၩ့ထံၭ,- တၭအီၪဝ့ၫလၧခိၪလီၩ့ဆူၭအဖၧၩ့နီၪ, ဘ့ၭ ၥရၫ့ဒဲဘ့ၭၥနံၫ့မၫ, ဒဲစၧကီၭ, ဒဲဇၫဖၫ့, ဆၧအီၪလၩ့ ထးလၧဟ့ၭၡဘၫ့အစဎွၩ စဲဟၫ့ အဘၩ့အမုး, ထံၫ ယီၫဒၫ့ဒဲအနဲၩ့ထံၭဖိးလၧ မၫဆမံၭခံၫ့နရ့ၭအနဲၩ့ထံၭ",
			"28": "<sup>28</sup> လၧယီၫဒၫ့ဝါလခီၫလၧမုထၪ့လခီၫလီၫ.- အဝ့ၫနီၪမွဲၦ ဂၭဖိၪအဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, ဒိၩ့လ ဖၪဒဲအတဝၫ့လဖၪဆ့လီၫ.",
			"29": "<sup>29</sup> စမိစ့ၭဖ့ၪလၫ့ဆၧလၧၦမနၭစ့ၫဖိၪ လခီၫဒီၪ့တၭ,အ ယီၩမွဲၦမနၭစ့ၫဖိၪလခီၫဒီၪ့အဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့",
			"30": "<sup>30</sup> လဖၪအၥိၭနီၪလီၫ.- အခးနဲၩ့ထံၭအီၪဝ့ၫ လၧမၫဟ နၫအံၫ့, ဘၫၡၫ့ထၧၫ့ဘံၪ့ယၫ, ဘၫၡၫ့အစဎွၩအီၭအ ဘၩ့အမုးထၧၫ့ဘံၪ့ယၫ, ဒဲယၫအၧၫအဒိၩ့လၧအအီၪ",
			"31": "<sup>31</sup> လၧဘၫၡၫ့အဖၧၩ့ထီးအလူၬ, ဒိၩ့ဎူၫဆံၫလီၫ.- ဒဲဂံလ အၭဖိၭဖၫ့,ဒဲအၭၡတြီၭ, ဒဲအ့ဒအဲၫ,ဒိၩ့လဖၪအီၪလၧ စအီၭအဘၩ့အမုးအဖၧၩ့ လၧဘၫၡၫ့ဘၪဆဲၫ့လၧစမ နၭစ့ၫအဖိၪခွၫ, စမၫခၧၫအဖိၪ, လၧစမၫခၧၫအဖိၪဖိၭ",
			"32": "<sup>32</sup> ဖၫ့ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.- အနီၪမွဲဆၧလၧ စမိစ့ၭဖ့ၪအၪ့နၩ့ဖၭလၧဆၧန့ၥၫအဂး လၧမိအၭအဆၧ ပျၩ့ဖၧၩ့လၧယီၫဒၫ့ဝါလခီၫ ဆဲၫဎၩ့လၧယ့ၫရခိၫလၧမု",
			"33": "<sup>33</sup> ထၪ့လခီၫနီၪလီၫ.- အ့ၪမွဲလၧၦလံဝဲၫဖိၪလဒီၪ့နီၪ စမိ စ့ၭဖ့ၪလၫ့အဆၧန့ၥၫအ့ၬ. ယဟိဝၩ အံၫစရ့လၭအ ယွၩမွဲအဝ့ၫၥံၪအဆၧန့ၥၫ ဘဲၫအစံၭဝဲၩဝ့ၫ အၥိၭနီၪ လီၫ."
		},
		"14": {
			"1": "<sup>1</sup> တၭအနီၪမွဲဆၧလၧၦအံၫစရ့လၭဖိၪ န့ၥၫလၧခးကၫ နအၫ့အဖၧၩ့, လၧၦလုဆၧစအံၫလအ့ဇၫလဂၩ,ဒဲစနိၫ့ အဖိၪခွၫစယီရှုၫအ့ၫ, ဒဲၦအံၫစရ့လၭဖိၪအဒီၪ့အဖါလ ဖၪအခိၪၥံၪဖ့ၪလၫ့ အၪ့နၩ့ဖၭန့ဝ့ၫ လၧဆၧန့ၥၫအဂး",
			"2": "<sup>2</sup> လီၫ.- လၧအဖၭဆၧအကၠီၩ့တၭ န့ဘၪအဆၧန့ၥၫဘဲၫ ယဟိဝၩမၪလူၬဝ့ၫလၧစမိစ့ၭ အစူၪဖၧၩ့အၥိၭ, လၧၦ ခွံၫဒီၪ့ဒဲလခီၫဒီၪ့အဂးလီၫ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ စမိစ့ၭဖ့ၪလၫ့ယူၭၦနံၫဒီၪ့ ဒဲလခီၫဒီၪ့ အဆၧန့ၥၫ လၧယီၫဒၫ့ဝါလခီၫလီၫ. အ့ၪမွဲၦလံဝဲၫဖိၪ",
			"4": "<sup>4</sup> နီၪဖ့ၪလၫ့ဝ့ၫလၧအဆၧန့ၥၫလၧအကျၩအ့ၬ.- (အဂဲး ဘဲၫယီၩစယိၥၭအဖိၪမွဲၦနံၫဒီၪ့, စမနၭစ့ၫ, ဒဲစအံဖံၫ့ လီၫ.) မၩအၥၭဘဲၫနီၪတၭ အဝ့ၫၥံၪဖ့ၪလၫ့ဆၧအဂး လၧၦလံဝဲၫဖိၪ လၧထံၫၥံၪခးၥံၪ အဖၧၩ့အ့ၬ. မွဲအဖ့ၪ လၫ့န့ၫဒိၩ့လဖၪလၧအမိအီၪလၧအဖၧၩ့, ဒဲဆၧအၪ့အ ဆၪအလးဝၬဖီၩ့ဝ့ၫ လၧအဆၧဖိၪဆၧဎါအဒိၩ့အဂး, ဒဲလၧအဆၧဖိၪဆၧလံၩအဂးလီၫ.",
			"5": "<sup>5</sup> ဘဲၫယဟိဝၩမၪလူၬစမိစ့ၭအၥိၭနီၪ, ၦအံၫစရ့လၭ ဖိၪမၩဝ့ၫဘဲၫနီၪအၥိၭ, ဒဲအၪ့နၩ့ဖၭ ထံၫၥံၪခးၥံၪအ ဆၧၫ့နီၪလီၫ.",
			"6": "<sup>6</sup> တၭၦယုဒၫဖိၪဂဲၫလၧစယီရှုၫအ့ၫအအီၪ လၧဂံလဂၫ လၭအဖၧၩ့း ဒဲၦကံနၭဖိၪ, စယဖၧၫနံၫအဖိၪခွၫစကၫ လ့ၭ,စံၭအဝ့ၫဒၪ, ဆၧလၧယဟိဝၩစံၭယွၩအခ့ၫအၡၩ စမိစ့ၭလၧအဂဲးအကၠီၪ့, ဒဲနဂဲးနကၠီၪ့လၧကၫဒ့ၭဘၫန့",
			"7": "<sup>7</sup> အၫအဖၧၩ့နီၪ, နၥ့ၪယၫလီၫ.- လၧယဟိဝၩအခ့ၫအ ၡၩစမိစ့ၭအၪ့မၧၫ့လၩ့ယၧၩ လၧကၫဒ့ၭဘၫန့အၫဘဲၫ ၥိၭယမိယိၥူၪထံၫၥံၪခးၥံၪနီၪ ယၥၭၡါအနံၪ့လံဆံၫ, တၭယဂဲၫထဲၩ့ဆိၬဆၧချဲၩ့ လၧအအီၪလၧယၥၭခံဖၧၩ့",
			"8": "<sup>8</sup> နီၪလီၫ.- မွဲလါနၫ့တၭ ယထၧၫ့ဖုဝဲလၧအလ့ၩထၪ့လၧ ယၥိၭလဖၪနီၪမၩဖံၪထၪ့ၦခမျၧးအၥၭလီၫ. အ့ၪမွဲယ ဝ့ၫဒၪယီၩ ယလီၩ့ဖိၬယဟိဝၩယယွၩအခဲၫ့ လၧၫ့လၧၫ့",
			"9": "<sup>9</sup> ဎွ့ၩဎွ့ၩလီၫ.- တၭဆၧလၧမုလနံၩ စမိစ့ၭဆိၪလၩ့အၥၭ တၭစံၭဝ့ၫဒၪ, မွဲမၬခးလၧနယဲးလၩ့ဝ့ၫ မိကဲၪထၪ့နဆၧ န့ၥၫအလး, ဒဲလၧနဖိၪနလံၩအလး လၩ့ဆိၩလၩ့ကၠၪ လီၫ. အဂဲးဘဲၫယီၩ နဖိၬယူၭယဟိဝၩယယွၩအဖၧၩ့",
			"10": "<sup>10</sup> ၥၭလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩယူၭလီၫ.- ဘိၩ့နဲၪ့ယီၩ, ယိခွါ, ယဟိဝၩဒုၭမၧၫ့ဒံၭယၧၩ, ဘဲၫအစံၭဝ့ၫအၥိၭနီၪ, လံ ဆံၫယဲနံၪ့ယီၩ, လၧယဟိဝၩ ချဲၩ့ဆၧချဲၩ့လထံၪနီၪ, လၧစမိစ့ၭလံၩလံၩ, လၧၦအံၫစရ့လၭဖိၪ စဲၪ့ဝံၩ့ဝၩ့လၧ ၡါမုနၧၫ့ဖၫအဘိၩ့ဘၭနီၪး တၭဘိၩ့နဲၪ့ယီၩ, ယိခွါ, ဆၧလၧမုဆၫလနံၩယီၩ ယၥၭၡါယူၭ ဎိၭဆံၫယဲနံၪ့",
			"11": "<sup>11</sup> လီၫ.- မွဲလါနၫ့ယဂဲးဆီၪ့ယဘၭဆီၪ့ လၧမုဆၫလနံၩ ယီၩ, ဘဲၫလၧအနံၩလၧစမိစ့ၭအၪ့မၧၫ့လၩ့ယၧၩအၥိၭ နီၪ,ဘဲၫယဂဲးယဘၭ အီၪအထီထီးနီၪအၥိၭ, ယဂဲးယ ဘၭအီၪဝ့ၫဘိၩ့နဲၪ့ယီၩ ဘဲၫနီၪအၥိၭဆ့, လၧဆၧဒုၭ ၥုၭအဂး, လၧစဲၪ့ထၪ့အဂး, ဒဲလၧဂဲၫနုၬအဂးဆ့လီၫ.",
			"12": "<sup>12</sup> တၭဘိၩ့နဲၪ့ယီၩ ဖ့ၪလၫ့ယၧၩ လၧခိၪလီၩ့လဖျိၪ့နီၪ, လၧယဟိဝၩ ချဲၩ့ဆၧလၧအဂဲးအကၠီၪ့ လၧမုလနံၩနီၪ ဆံၭ. အဂဲးဘဲၫယီၩ နနါဂၧၫ့လၧမုဆၫလနံၩနီၪလၧၦ အၫနၭဖိၪအီၪဝ့ၫတၭ, ဒိၩ့လဖၪနီၪဒိၪဝ့ၫ ဒဲအီၪလၧအ ခိၪဒၧၩ့နီၪလီၫ. ယဟိဝၩအ့ၪအီၪလၧယၥိၭတၭ, ယမိနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ ဘဲၫယဟိဝၩစံၭဝ့ၫအၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> စယီရှုၫအ့ၫဆိၪဂ့ၩအဝ့ၫဒၪ, ဒဲဖ့ၪလၫ့ စယဖၧၫနံၫ အဖိၪခွၫ စကၫလ့ၭ လၧဟံဘြၧၫ့ လၧအဆၧန့ၥၫနီၪ",
			"14": "<sup>14</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဟံဘြၧၫ့ကဲၪထၪ့ၦကံနၭ ဖိၪစယဖၧၫနံၫအဖိၪခွၫ စကၫလ့ၭအဆၧန့ၥၫခီးမုဆၫ လနံၩယီၩလီၫ. အဂဲးဘဲၫယီၩ မွဲအဖိၬယဟိဝၩ အံၫ စရ့လၭအယွၩအဖၧၩ့ၥၭ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩအကၠီၩ့",
			"15": "<sup>15</sup> နီၪလီၫ.- တၭလၧအခၪ့ထံၭနီၪ ဟံဘြၧၫ့အမံၩ့မွဲကၧၫ ယၭအၫဘၫလီၫ. အနီၪမွဲၦဒိၪလဂၩ လၧအၫနၭဖိၪအ ကျၩလီၫ. တၭထံၫၥံၪခးၥံၪအီၪပွံၭဝ့ၫ လၧဆၧဒုၭၥုၭ နီၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> အယီၩမွဲၦယုဒၫဖိၪလဒီၪ့အဂး ဘဲၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪ, ဖိးလၧအံဒိၫ့အခးနဲၩ့ထံၭ, ၡါမုနၧၫ့ဖၫဇံၫ့",
			"2": "<sup>2</sup> လၧမုခံၫ့လခီၫနီၪ မွဲခးလၧမုခံၫ့အနဲၩ့ထံၭအထုၬ,-တၭ အခးနဲၩ့ထံၭလၧမုခံၫ့နီၪ, အီၪလၧမၫဆမံၭ ထံၫလၪ",
			"3": "<sup>3</sup> အဆၧဒူၩ့ကဲၪ့ လၧအတီၩလၧမုခံၫ့လခီၫ,- တၭလ့ၩ ဆၧလၧမုခံၫ့ဖိးလၧ မအၫလ့ၫအၭကြၫ့ဘံၫ့, ဒဲလ့ၩဝ့ၫ လၧဇံၫ့တၭ, လ့ၩထၪ့လၧမုခံၫ့ဖိးလၧကၫဒ့ၭဘၫန့အၫ ဒဲလ့ၩဆၧထီၩ့ လၧဟ့ဇရၧၫ့, ဒဲလ့ၩထၪ့လၧအၫဒၫ, ဒဲ",
			"4": "<sup>4</sup> လ့ၩဎဲၪ့ဆၧဖိးလၧကၫကအၫ,- တၭလ့ၩဝ့ၫလၧအၭဇ မၧၫ့တၭစဲၪ့ထၪ့ဝ့ၫလၧအံဇံၭ အထံၫမိၡါတၭအခးနဲၩ့ စဲၪ့ထၪ့ခွံၬဝ့ၫ ထီးမၫဆမံၭနဲၩ့ထံၭနီၪလီၫ. အနီၪမွဲန ၥံၪအခးနဲၩ့ထံၭလၧမုခံၫ့လခီၫလီၫ.",
			"5": "<sup>5</sup> ခးအနဲၩ့ထံၭလၧမုထၪ့လခီၫနီၪ မွဲမၫဆမံၭထံၫလၪ ဖိးလၧယီၫဒၫ့အထုၬတၭ, ခးအနဲၩ့ထံၭလၧမုဖၩလခီၫ နီၪမွဲလၧမၫဆမံၭ အဆၧဒူၩ့ကဲၪ့ လၧယီၫဒၫ့အထုၬ",
			"6": "<sup>6</sup> လီၫ.- တၭခးအနဲၩ့ထံၭနီၪ လ့ၩဆၧလၧဘ့ၭၥဟီၭလၫ, ဒဲလ့ၩဝ့ၫလၧဘ့ၭၥၫရဘၫ လၧမုဖၩလခီၫး ဒဲခးအနဲၩ့ ထံၭနီၪလ့ၩထၪ့ဝ့ၫလၧစရုဘံၫ့အဖိၪခွၫ စဘိဟၫ့အလိး",
			"7": "<sup>7</sup> လဖျိၪ့,- တၭခးအနဲၩ့ထံၭနီၪ လ့ၩထၪ့ဝ့ၫလၧဒံဘၧၫအ ခိၪလီၩ့ဆူၭအၫကီၫ, ဒဲလၧမုဖၩလခီၫ တီၩဝ့ၫလၧဂံလ ဂၫလၭလၧအအီၪဝ့ၫလၧဆၧလ့ၩထၪ့ လၧအဒၧမံၫ့အ မ့ၬယၫ, လၧအအီၪဝ့ၫလၧထံၫချိၬလၧမုခံၫ့လခီၫ, ဒဲခး အနဲၩ့ထံၭနီၪလ့ၩဝ့ၫလၧ အံၪ့ၡၫမ့ၬအထံၫတၭ, အစဲၪ့",
			"8": "<sup>8</sup> ထၪ့ဝ့ၫနီၪမွဲထီးအံၪ့ရိဂလၭး- တၭခးအနဲၩ့နီၪလ့ၩထၪ့ လၧစဟံၪ့နၧၫ့အဖိၪခွၫ အခိၪလီၩ့ဆူၭ, လၧယဘူစဲၭ လၧမုခံၫ့လခီၫ, အဝ့ၫနီၪမွဲယရုစလံၫ့လီၫ. တၭခးအ နဲၩ့ထံၭနီၪလ့ၩထၪ့ဘၭခိၪလီၩ့ဒၩ့ခိၪ လၧအအီၪလၧ ခိၪလီၩ့ဆူၭဟံၪ့နၧၫ့အမ့ၬယၫ လၧမုနုၬလခီၫ ၦဆီၪ့",
			"9": "<sup>9</sup> ဖိၪအခိၪလီၩ့ဆူၭအထုၬလၧမုဖၩလခီၫလီၫ.- ဆၧထိၪ ခးအနဲၩ့ထံၭလၧခိၪလီၩ့ဒၩ့ခိၪဖိးလၧထံၫန့ၭဖၥိၫအၫ အထံၫထၪ့ဖျိၭတၭ, လ့ၩဝ့ၫလၧခိၪလီၩ့ အံဖၧၫအဒိၩ့ လဖၪ,တၭဆၧထိၪခးအနဲၩ့နီၪ လၧဘၫအလၫလၧအ",
			"10": "<sup>10</sup> မွဲကၧၫယၭယအရံၫ့.- တၭခးအနဲၩ့နီၪလ့ၩဎဲၪ့ဆၧလၧ ဘၫအလၫအမုနုၬလခီၫ လၧခိၪလီၩ့စံအၫ, ဒဲလ့ၩဆၧ လၧခိၪလီၩ့ ယ့အရံၫ့အပၪ, အဝ့ၫနီၪမွဲခ့ၭစလၧၫ့လၧမု ဖၩလခီၫတၭ, လ့ၩလၩ့လၧဘ့ၭၥၡ့မ့ၭတၭ, လ့ၩဆၧ",
			"11": "<sup>11</sup> လၧတံမနၫ,- ခးအနဲၩ့နီၪစဲၪ့ထၪ့လၧအ့ၭကြၧၫ့အနဲၩ့ လၧမုဖၩလခီၫတၭ, ဆၧထိၪခးအနဲၩ့နီၪ လၧၡဲကြၧၫ့ တၭ,လ့ၩဝ့ၫလၧခိၪလီၩ့ဘၫအလၫတၭ, စဲၪ့ထၪ့ဝ့ၫလၧ ယၭဘနံၫလၭတၭ, ခးအနဲၩ့စဲၪ့ထၪ့ခွံၬ ထီးမၫဆမံၭ နဲၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> တၭခးအနဲၩ့လၧမုနုၬလခီၫနီၪ မွဲမၫဆမံၭဖၭဒိၪ, ဒဲအနဲၩ့ထံၭနီၪလီၫ. အနီၪမွဲယုဒၫဖိၪ အခးနဲၩ့ဝၬဖီၩ့ ဝ့ၫ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> တၭအဝ့ၫဖ့ၪလၫ့စယဖၧၫနံၫအဖိၪခွၫ စကၫလ့ၭအ ဂးလၧၦယုဒၫဖိၪအကျၩ, ဘဲၫယဟိဝၩမၪလူၬ စယီရှုၫ အ့ၫအၥိၭနီၪ, စအၫနၭအဖါစအၫဘၫအဒိၩ့ လၧအမွဲ",
			"14": "<sup>14</sup> ဟံဘြၧၫ့နီၪလီၫ.- တၭစကၫလ့ၭနီၪနၫ့ထၪ့ခွံၬစအၫနၭ အဖိၪခွၫၥၧၫ့ဂၩ, စၡံၡဲၫ, ဒဲစအၫဟဲမၫ့, ဒဲစတၫလမ့ၫ,",
			"15": "<sup>15</sup> စအၫနၭအဖိၪခွၫလဖၪ လၧအလးထီးနီၪလီၫ.- တၭမွဲ အလ့ၩထၪ့ဝ့ၫထီးနီၪ, လၧၦဒံဘၧၫဖိၪအအီၪလီၫ. တၭ",
			"16": "<sup>16</sup> လၧၥၫ့နီၪဒံဘၧၫအမံၩ့ မွဲကၧၫယၭစံဖၧၫလီၫ.- တၭ စကၫလ့ၭစံၭဝ့ၫဒၪ, ၦလၧအဖ့ၬခွံၬကၧၫယၭစံဖၧၫ ဒဲ မၩန့ဝ့ၫလဂၩနီၪ, ယမိဖ့ၪလၫ့ယဝ့ၫ လၧယဖိၪမုၪ နး အၭစၫလၧအမၫအဂးလီၫ.",
			"17": "<sup>17</sup> တၭစကၫလ့ၭအထၧၫ့ဖုဝဲစကံနၭအဖိၪခွၫ စအီၫၥၫ နအ့လၭလဂၩနီၪ မၩန့ဝ့ၫတၭ, အဝ့ၫဒၪဖ့ၪလၫ့ဝ့ၫလၧ",
			"18": "<sup>18</sup> အဖိၪမုၪနးအၭစၫလၧအမၫအဂးလီၫ.- တၭၦမုၪဂဲၫ ထီၩ့နီၪဆၧမၩအၥၭလၧအထိၪဂဲၩ အဝ့ၫဒၪဘဲၫၥိၭအ မိအၪ့ကံၩ့ ဂၪ့ခိၪလဝၩ့လၧအဖါလီၫ. တၭၦမုၪနီၪစဲၪ့ လၩ့ခွံၬလၧကၥ့ၪယီၩ့ခိၪလီၫ. တၭစကၫလ့ၭစံၭအဝ့ၫ,",
			"19": "<sup>19</sup> ဘၪနၥၭလၧဆၧနီၪလမံၩ့လဲၪ.- တၭၦမုၪနီၪစံၭဆၧၫ့ ဝ့ၫ,ဖ့ၪလၫ့ယၧၩလၧဆၧဆိၪဂ့ၩဘီၪး အဂဲးဘဲၫယီၩ နဖ့ၪလၫ့ယူၭယၧၩ လၧခးမုခံၫ့လခီၫယူၭ, ဖ့ၪလၫ့လါ ဆ့ယၧၩလၧထံၫထၪ့ဖျိၭလဖၪနီၪဆံၭ. တၭအဆၧဖ့ၪ လၫ့ဝ့ၫလၧထံၫထၪ့ဖျိၭ လၧထၭလခီၫ, ဒဲထံၫထၪ့ဖျိၭ လၧလၬလခီၫနီၪလီၫ.",
			"20": "<sup>20</sup> အယီၩမွဲၦယုဒၫဖိၪလဒီၪ့အဆၧန့ၥၫ ဘဲၫအဂံၪ့လဖၪ အၥိၭနီၪလီၫ.",
			"21": "<sup>21</sup> တၭၦယုဒၫဖိၪလဒီၪ့အဒိၩ့လဖၪ လၧအယဲၩ့ထုၬတီၩ လၧခးအံဒၧၫ့အနဲၩ့ လၧမုခံၫ့လခီၫနီၪ မွဲကၭတဇံၫအ့",
			"22": "<sup>22</sup> လၭ,ဒဲအံဒၫ,ဒဲယၫဂၧၫ,- ဒဲကဲနၫ,ဒဲဒမိနၫ,ဒဲအၭဒဒၫ, ဒဲက့ၭဒ့ၭ,ဒဲဟၫဇၧၫ,ဒဲအံၥနၫ့,",
			"23": "<sup>23</sup> ဇံဖၭ,ဒဲတံလံၫ့,",
			"25": "<sup>25</sup> ဒဲတံအလီၭ,- ဒဲဟၫဇၧၫ,ဟဒၭတၫ,ဒဲက့ၫရအီၭ,ဒဲယ့",
			"26": "<sup>26</sup> ဇရၧၫ့တၭ, အနီၪမွဲဟၫဇၧၫ့,- အၫမၩ့, ဒဲၡံမၫ, ဒဲမီ",
			"27": "<sup>27</sup> လဒၪ,- ဒဲဟၫဇၫဂၭဒၫ, ဒဲဟ့ၡမၩ့, ဒဲဘ့ၭၥပၫလ့ၭ,",
			"28": "<sup>28</sup> ဒဲဟၫဇၫရှူၫအ့လၭ, ဒဲဘံအၧၫၡံၫဘၫ, ဒဲဘ့ၭစယီၫ",
			"29": "<sup>29</sup> ၥယၫ,- ဘၫအလၫ,ဒဲအဲအံၫ့,ဒဲအ့ဇံၫ့,ဒဲအ့လတိလၭ,",
			"30": "<sup>30</sup> ဒဲခံၫစ့လၭ,ဒဲဟီမၫ,- ဒဲဇံၭလၭ,ဒဲမၭဒမၫနၫ,ဒဲစၫ့စၫ့",
			"31": "<sup>31</sup> နၫ့,- ဒဲလဘၫအီၭ, ဒဲၡံလဟံၫ့, ဒဲအၫအံၩ့, ဒဲရံမၧၫ့",
			"32": "<sup>32</sup> လီၫ.-ဒိၩ့ထီးအလူၬနီၪမွဲနံၫဆံၫခွံၫဒိၩ့ အီၪလၧအတ ဝၫ့လဖၪလီၫ.",
			"33": "<sup>33</sup> လၧခိၪလီၩ့ဆူၭအ့ၭၡတ့ၫအီလၭ, ဒဲဇိရံအၫ, ဒဲအၭ",
			"34": "<sup>34</sup> ၡနၫ,- ဒဲဇၫ့အိအၫ,အံၫ့ဂၪ့နံၫ့, တၫပုအၫ,ဒဲအံနၫ့, ယၫမုၫၥၫ,ဒဲအဒၧလၫ့,စိကိၫ,ဒဲအဇံကၫ,",
			"35": "<sup>35</sup> ဒဲၡရၫ အံၫ့,ဒဲအဒံၭၥံၫ့,ဒဲကဒံရၫ,ဂံၫဒရီၭၥံၫ့လီၫ. ဒိၩ့လဆံၫ",
			"37": "<sup>37</sup> လံဖျိၪ့အီၪလၧအတဝၫ့လဖၪလီၫ.- ဇံနၫ့,ဒဲဟၭဒၡၫ,",
			"38": "<sup>38</sup> ဒဲမံၭဂဒၫလၭဂၭ,- ဒဲဒံလအၫ့, ဒဲမံဇပၫ, ဒဲယီၭၥအ့",
			"39": "<sup>39</sup> လၭ,- လၫခံၭ, ဒဲဘီဇကၭ, ဒဲအ့ၭဂလၫ့, ဒဲကၭဘၩ့,",
			"40": "<sup>40</sup> ဒဲလၫမၩ့,ဒဲတံၭၥလံၭ,- ဒဲဂဒံရီၭ,ဒဲဘ့ၭၥဒၫဂၧၫ့,ဒဲနၫ",
			"41": "<sup>41</sup> အမၫ,ဒဲမၭကံဒၫနီၪလီၫ.- မွဲဒိၩ့လဆံၫဎူၫဒိၩ့အီၪလၧ",
			"42": "<sup>42</sup> အတဝၫ့လဖၪလီၫ.- လံဘနၫ, ဒဲအံၥၧၫ့, ဒဲအၫၡၫ့, ယ့ၭဖတၫ,ဒဲအၭၡနၫ,ဒဲနံဇံၭ,",
			"43": "<sup>43</sup> ကဲၪလၫ,ဒဲအၭဇံၭ, ဒဲမၫရၡၫလီၫ. ဒိၩ့ခွံၫဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ. အ့ၭကြၩ့,ဒဲအဒိၩ့လဖၪဒဲအတဝၫ့လဖၪလီၫ.",
			"45": "<sup>45</sup> လၧ အ့ၭကြၩ့ထီၩ့လၧမၫဆမံၭနီၪကယဲဒိၩ့အအီၪဘူၭလၧ",
			"47": "<sup>47</sup> အၭၡဒီၭ,ဒဲအတဝၫ့လဖၪ,- အၭၡဒီၭ, ဒဲအဒိၩ့လ ဖၪဒဲအတဝၫ့လဖၪ, ဂၫဇၫ,ဒဲအဒိၩ့လဖၪ, ဒဲအတဝၫ့ လဖၪ,ဖိးလၧအံဇံၭ အထံၫမိၡါ, ဒဲမၫဆမံၭဖၭဒိၪအ နဲၩ့ထံၭနီၪလီၫ.",
			"48": "<sup>48</sup> တၭလၧခိၪလီၩ့အလီၩ့နီၪ ၡၫမၧၫ,ဒဲယၭတၧၫ,ဒဲဝိ",
			"49": "<sup>49</sup> ကိၫ,- ဒဲဒၫ့နၫ, ဒဲကၧၫယၭစၫနၫ, အနီၪမွဲဒံဘၧၫ, အၫနၭ, ဒဲအ့ၭၡတံၫမီၭ,ဒဲအနံၩ့,",
			"50": "<sup>50</sup> ဒဲဂိၡံၫ့,ဒဲဟိလၫ့ ဒဲဂဲလိၫလီၫ. ဒိၩ့လဆံၫလဒိၩ့အီၪလၧအတဝၫ့လဖၪ လီၫ. အၫရၭ, ဒဲဒုမၫ, ဒဲအ့ၭၡအၫ့,",
			"52": "<sup>52</sup> ဒဲယၫနၧၫ့, ဒဲဘ့ၭၥ",
			"54": "<sup>54</sup> တၭပုအၫ, ဒဲအဖဲကၫ,- ဒဲဟုမတၫ, ဒဲကၧၫယၭအၫ ဘၫ,အနီၪမွဲဟံဘြၧၫ့, ဒဲဇဲအီၫလီၫ. ဒိၩ့ခွံၫဒိၩ့အီၪလၧ",
			"55": "<sup>55</sup> အတဝၫ့လဖၪလီၫ.- မ့အၧၫ့, ဒဲကၫမလၭ, ဒဲဇံဖၭ,ဒဲ",
			"56": "<sup>56</sup> ယၧၭတၫ,- ဒဲယ့ၭစအ့လၭ, ဒဲယီၭဒံအၫ့, ဒဲဇၫ့အိ",
			"57": "<sup>57</sup> အၫ,- ကံၫ့,ဂံဘအၫ,ဒဲတံမနၫနီၪလီၫ. ဒိၩ့လဆံၫအီၪ",
			"58": "<sup>58</sup> လၧအတဝၫ့လဖၪလီၫ.- ဟၫလဟၧလၭ, ဘ့ၥဇၧၫ,",
			"59": "<sup>59</sup> ဒဲစ့ဒၧၫ,- ဒဲမၫအရၭ,ဒဲဘ့ၭၥနီၭ, ဒဲအ့လတံၫကၫ့လီၫ. ဒိၩ့ဎူၫဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ.",
			"60": "<sup>60</sup> ကၧယၭဘၫအလၭ, အနီၪမွဲကၧၫယၭယ့အရံၫ့,ဒဲ ရၭဘၫနီၪလီၫ. ဒိၩ့နံၫဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ.",
			"61": "<sup>61</sup> တၭလၧၡါမုနၧၫ့ဖၫနီၪဘ့ၭၥၫရဘၫ, မံၭဒံၫ့,ဒဲစံၫကၫ",
			"62": "<sup>62</sup> ကၫ,- ဒဲနံၭဘၡၫ့, ဒဲထံၫလၪအဒိၩ့, ဒဲအံၪ့ဂံၫဒဲၫနီၪ",
			"63": "<sup>63</sup> လီၫ. ဒိၩ့ဎူၫဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ.- အ့ၪမွဲၦ ယ့ဘုၫဖိၪ,ယရုစလံၫ့ဖိၪနီၪ, ၦယုဒၫဖိၪနၫ့ထၪ့ခွံၬဝ့ၫၥ့ၪ အ့ၬ. တၭၦယ့ဘုၫဖိၪအီၪဝ့ၫလၧ ၦယုဒၫဖိၪအကျၩ လၧယရုစလံၫ့အဖၧၩ့ ထီးမုဆၫလနံၩယီၩလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> စယိၥၭအဖိၪအဆၧဖၭန့နီၪ လၩ့ဘၪလၧယီၫဒၫ့လၧ ယ့ၫရခိၫအနဲၩ့ထံၭထီၩ့လၧထံၫယ့ၫရခိၫ, လၧမုထၪ့လ ခီၫဖိးလၧၡါမုနၧၫ့ဖၫ လၧအလ့ၩထၪ့ခွံၬဝ့ၫ လၧယ့ၫရ",
			"2": "<sup>2</sup> ခိၫဖိးလၧခိၪလီၩ့ ဘ့ၥလၭထၧၫ့ဖျိၪ့ယၫ,- ဒဲလ့ၩထၪ့ ခွံၬလၧဘ့ၥလၭဖိးလၧလုဇၭတၭ, လ့ၩဆၧလၧအၫခဲၫ",
			"3": "<sup>3</sup> အနဲၩ့ထံၭဖိးလၧအၭတရီၭ,- တၭလ့ၩလၩ့လၧမုနုၬ လခီၫလၧယၭဖျံၫတဲၫဖိးလၧ ဘ့ၭၥဟိရၧၫ့လၧလၬလ ခီၫဒဲဂ့ဇၧၫတၭ, စဲၪ့ထၪ့ဝ့ၫထီးနီၪ လၧမၫဆမံၭနဲၩ့",
			"4": "<sup>4</sup> လီၫ.- တၭစယိၥၭအဖိၪခွၫ, စမနၭစ့ၫ,ဒဲစအံဖြံၫ့မၩန့ ဝ့ၫအဆၧန့ၥၫလီၫ.",
			"5": "<sup>5</sup> တၭအယီၩမွဲ စအံဖြံၫ့အဖိၪအခးနဲၩ့ထံၭ, ဘဲၫအ ဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, အဆၧန့ၥၫအနဲၩ့ထံၭလၧမုထၪ့ လခီၫနီၪ မွဲအၭတရီၭအၫဒၫ ဖိးလၧဘ့ၥဟိရၧၫ့လၧ",
			"6": "<sup>6</sup> ထၭလခီၫ,- တၭခးအနဲၩ့ထံၭနီၪ စဲၪ့ထၪ့လၧမၫဆမံၭ နဲၩ့ထံၭ, လၧမံၭမံၫၥၫလၧ မုဖၩလခီၫတၭ, ခးအနဲၩ့ ထံၭနီၪကၠၪအၥၭ လၧမုထၪ့လခီၫ လၧတၫနၭၡဲလိၫ တၭ,လ့ၩဖီၩ့ခွံၬဝ့ၫ လၧမုထၪ့လခီၫ လၧယၫ့အိအၫ.",
			"7": "<sup>7</sup> တၭလ့ၩလၩ့ခွံၬလၧ ယၫ့အိအၫထီၩ့လၧအၭတရီၭ,ဒဲ လၧနၫအရၭ, ဒဲဘၪလၧယ့ၫရခိၫတၭ, စဲၪ့ထၪ့ခွံၬလၧ",
			"8": "<sup>8</sup> ယီၫဒၫ့နီၪလီၫ.- ခးအနဲၩ့ထံၭနီၪ စဲၪ့ထၪ့ခွံၬလၧတၭ ပုၫအၫလၧမုနုၬလခီၫ ထီၩ့လၧထံၫချိၬကၫနၫတၭ, စဲၪ့ ထၪ့ခွံၬဝ့ၫထီးနီၪထီၩ့မၫဆမံၭနဲၩ့ထံၭလီၫ. အနီၪမွဲၦ အံဖြံၫ့ဖိၪလဒီၪ့အဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭ",
			"9": "<sup>9</sup> နီၪလီၫ.- တၭဒိၩ့လၧအလၩ့ဖၭလၧအံဖြံၫ့ဖိၪအဂးနီၪ အီၪဝ့ၫလၧစမနၭစ့ၫဖိၪအဆၧန့ၥၫအဖၧၩ့နီၪ, ဒိၩ့ထီး အလူၬဒဲအတဝၫ့လဖၪဆ့လီၫ.- တၭအဝ့ၫၥံၪ နၫ့ထၪ့",
			"10": "<sup>10</sup> ခွံၬၦကၫနအၫ့ဖိၪလၧအအီၪဝ့ၫလၧ ဂ့ဇၧၫအဖၧၩ့အ့ၬး တၭၦကၫနအၫ့ဖိၪအီၪဝ့ၫ လၧၦအံဖြံၫ့ဖိၪအကျၩထီးမု ဆၫလနံၩယီၩလီၫ. တၭမၩအဝ့ၫၥံၪအဆၧ ဒဲဖ့ၪလၫ့ အခီၫ့လီၫ."
		},
		"17": {
			"1": "<sup>1</sup> တၭဆၧဖၭန့အီၪဝ့ၫ လၧစမနၭစ့ၫလဒီၪ့အဂးလီၫ. အဂဲးဘဲၫယီၩမွဲဝ့ၫလၧစယိၥၭအဖိၪဝဲၡါလီၫ. အီၪဝ့ၫ လၧစမနၭစ့ၫအဖိၪဝဲၡါ စမၫခၧၫ, စဂံလအၭအဖါလ ဂၩနီၪအဂးလီၫ. အဂဲးဘဲၫယီၩ မွဲၦၡၩဒုၭၥုၭအကၠီၩ့",
			"2": "<sup>2</sup> တၭ,ဂံလအၭဒဲဘၫၡၫ့နီၪ အီၪဝ့ၫလၧအဂးလီၫ.- တၭ ဆၧဖၭန့အီၪဝ့ၫလၧစမနၭစ့ၫအဖိၪ လၧအအီၪလၩ့ထး လဖၪအဂး, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ လၧစအၭဘ အံဇၧၫအဖိၪအဂး, ဒဲလၧစဟံလ့ၭအဖိၪအဂး, ဒဲလၧစ အၫစြံၫအ့လၭ အဖိၪအဂး, ဒဲလၧစၡ့ကံၫ့အဖိၪအဂး နီၪ,ဒဲလၧစဟံဖၧၫအဖိၪအဂး, ဒဲလၧၡမဲဒၫအဖိၪအဂး လီၫ. အဝ့ၫၥံၪနီၪမွဲစယိၥၭအဖိၪခွၫ စမနၭစ့ၫအဖိၪခွၫ ၥံၪ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> အ့ၪမွဲစဇံၫလိဖဟၭ, စဟံဖၧၫအဖိၪခွၫ,စဂံလအၭ အဖိၪခွၫ, စမၫခၧၫအဖိၪခွၫ, စမနၭစ့ၫအဖိၪခွၫနီၪအ ဖိၪခွၫၥံၪအီၪအ့ၬး အီၪန့ၫအဖိၪမုၪလဖၪလီၫ. တၭအ ဖိၪမုၪၥံၪအမံၩ့နီၪမွဲအယီၩ, နးမၫလၫ, နးနိအၫ, နး",
			"4": "<sup>4</sup> ဟီၭလၫ,ဒဲနးမံလကၫ,ဒဲနးတၧဇၫလီၫ.- တၭအဝ့ၫၥံၪ နီၪၥုၭဘူၭအၥၭလၧ ၦလုဆၧစအံၫလအ့ဇၧၫအအီၪ,ဒဲ စနိၫ့အဖိၪခွၫစယီရှုၫအ့ၫအအီၪ, ဒဲၦဒိၪလဖၪအအီၪ တၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩမၪလူၬစမိစ့ၭဘဲၫၥိၭအမိဖ့ၪ လၫ့ပၧၩလၧဆၧန့ၥၫလၧပထၧၫ့ဖုဝဲအကျၩလီၫ. တၭ ဘဲၫယွၩအဆၧမၪလူၬ အၥိၭနီၪ ဆၧဖ့ၪလၫ့အဝ့ၫၥံၪ လၧဆၧန့ၥၫလၧအဖါအထၧၫ့ဖုဝဲအကျၩလီၫ.",
			"5": "<sup>5</sup> တၭလၧခးဂံလအၭဒဲဘၫၡၫ့လၧ ယီၫဒၫ့ဝါလခီၫအ မ့ၬယၫနီၪ, ဆၧလၩ့ဘၪလၧစမနၭစ့ၫအဂးနီၪ, မွဲဆံၫ",
			"6": "<sup>6</sup> ပိၩ့လီၫ.- အဂဲးဘဲၫယီၩ စမနၭစ့ၫအဖိၪမုၪလဖၪနီၪန့ ဘၪဆၧန့ၥၫ လၧအဖိၪခွၫအကျၩ, ဒဲအဖိၪခွၫလၧအ အီၪလၩ့ထးလဖၪနီၪ န့ဘၪခးဂံလအၭလီၫ.",
			"7": "<sup>7</sup> စမနၭစ့ၫအခးနဲၩ့ထံၭနီၪ အီၪဝ့ၫလၧအၭၡၧၫဖိးလၧ မံၭမံၫၥၫလၧအအီၪဝ့ၫ လၧၡံခံၫ့အမ့ၬယၫတၭ, ခးအ နဲၩ့ထံၭလ့ၩဆၧလၧစူၪထွ့ၪလၧ ၦအံၪ့တၭပုၫအၫဖိၪ",
			"8": "<sup>8</sup> အအီၪလီၫ.- စမနၭစ့ၫန့ဘၪခးတၭပုၫအၫလီၫ. အ့ၪမွဲ တၭပုၫအၫအီၪဝ့ၫလၧ စမနၭစ့ၫအခးနဲၩ့ထံၭနီၪ,ၦအံ",
			"9": "<sup>9</sup> ဖြံၫ့ဖိၪန့ဘၪဝ့ၫလီၫ.- တၭခးအနဲၩ့ထံၭနီၪ လ့ၩလၩ့ ဖိးလၧထံၫချိၬကၫနၫ, ထံၫချိၬလၧမုခံၫ့လခီၫလီၫ. စအံ ဖြံၫ့အဒိၩ့လဖၪနီၪ အီၪဝ့ၫလၧစမနၭစ့ၫအဒိၩ့လဖၪအ ကျၩလီၫ. စမနၭစ့ၫအခးနဲၩ့ထံၭနီၪ, အီၪဝ့ၫလၧထံၫချိၬ လၧမုဖၩလခီၫ, ဒဲအစဲၪ့ထၪ့ခွံၬဝ့ၫနီၪ မွဲလၧမၫဆမံၭ",
			"10": "<sup>10</sup> နဲၩ့ထံၭလီၫ.- လၧမုခံၫ့လခီၫမွဲစအံဖြံၫ့အဆၧ, ဒဲလၧ မုဖၩလခီၫနီၪမွဲစမနၭစ့ၫအဆၧတၭ, မၫဆမံၭနီၪမွဲအ ခးနဲၩ့ထံၭလီၫ. တၭအဝ့ၫၥံၪဘုၭဎုၬလိၬအၥၭနီၪလၧ မုဖၩလခီၫမွဲလၧအၭၡၧၫအဖၧၩ့, ဒဲလၧမုထၪ့လခီၫလၧ အံစခၫအဖၧၩ့လီၫ.",
			"11": "<sup>11</sup> တၭလၧအံစခၫအဖၧၩ့, ဒဲလၧအၭၡၧၫအဖၧၩ့နီၪစ မနၭစ့ၫအီၪလၧဘ့ၭၥၡံအၫ့ဒဲအတဝၫ့လဖၪ, ဒဲအံၭဘျံၭ အၫ့ဒဲအတဝၫ့လဖၪ, ဒဲၦဒီၫဖိၪဒဲအတဝၫ့လဖၪ,ဒဲၦအံၪ့ ဒီၫဖိၪဒဲအတဝၫ့လဖၪ, ဒဲၦတၫအနၭဖိၪ ဒဲအတဝၫ့လ ဖၪ,ဒဲၦမဂံၭဒိၫဖိၪဒဲအတဝၫ့လဖၪ, အခးၥၧၫ့ဘံၪ့လီၫ.",
			"12": "<sup>12</sup> မွဲလါနၫ့တၭ ၦမနၭစ့ၫဖိၪလဖၪ နၫ့ထၪ့ခွံၬ ၦဒိၩ့ဖိၪၥ့ၪ အ့ၬ. အ့ၪမွဲၦကၫနအၫ့ဖိၪ အီၪဒၪဆၧလၧခးဖၧၩ့နီၪ",
			"13": "<sup>13</sup> လီၫ.- ၦအံၫစရ့လၭဖိၪဆီၪ့ထၪ့တၭ ဆၧမၩအၥၭလၧ အအၪ့မၧၫ့ ၦကၫနအၫ့ဖိၪ ဖ့ၪလၫ့အခီၫ့လီၫ. အ့ၪမွဲနၫ့ ထၪ့ခွံၬဝ့ၫတၡါအ့ၬ.",
			"14": "<sup>14</sup> စယိၥၭအဖိၪလဖၪနီၪ ချဲၩ့ဆၧလၧစယီရှုၫအ့ၫတၭ, စံၭဝ့ၫဒၪ, မွဲနဖ့ၪလၫ့ယၧၩလၧဆၧဖၭန့, န့ၫလမံၩ့ဒဲလ ပိၩ့လၧယမိန့ၥၫနီၪမွဲဘၪလဲၪး ယမွဲၦခမျၧးဖၭဒိၪလီၫ. အဂဲးဘဲၫယီၩ ခီးဘိၩ့နဲၪ့ယီၩ ယဟိဝၩဆိၪဂ့ၩယၧၩ",
			"15": "<sup>15</sup> လီၫ.- စယီရှုၫအ့ၫစံၭဆၧၫ့ဝ့ၫဒၪ, နအ့ၪမွဲၦခမျၧးဖၭဒိၪ တၭ,ခိၪလီၩ့အံဖြံၫ့ အ့ၪအံၪ့လါကဲၪကၩ လၧနဂးနီၪ, လ့ၩထၪ့လၧၥံၪ့ကျၩတၭခူၬလၩ့ခွံၬ လၧနဂးဒၪနဝ့ၫထီး",
			"16": "<sup>16</sup> နီၪလၧၦပံရ့ၭဖိၪ, ဒဲၦဂဲးဆီၪ့ဖိၪအခးဖၧၩ့နီၪဆံၭ.- တၭ စယိၥၭအဖိၪလဖၪစံၭဝ့ၫဒၪ, ခိၪလီၩ့လဖျိၪ့နီၪ လၧၫ့ လၧပဂးအ့ၬး အဂဲးဘဲၫယီၩ ၦကၫနအၫ့ဖိၪလၧအအီၪ လၧခိၪလီၩ့ဆူၭအဖၧၩ့နီၪ အီၪဝ့ၫလၧလဲၪ့ၥုၭထၭၥံၪ ၦၡၩလၧဘ့ၭၥၡံအၫ့, ဒဲအတဝၫ့လဖၪ, ဒဲၦလၧယ့ၭ",
			"17": "<sup>17</sup> စအ့လၭအခိၪလီၩ့ဆူၭဖၧၩ့နီၪလီၫ.- တၭစယီရှုၫအ့ၫ ချဲၩ့ဆၧလၧစယိၥၭ အၡၩဂံၪ့ဖိၪ, ဒဲစအံဖြံၫ့ ဒဲစမနၭ စ့ၫတၭ, စံၭဝ့ၫဒၪ, နမွဲၦခမျၧးဖၭဒိၪတၭ, နစီၩ့နမၩ့",
			"18": "<sup>18</sup> ဒိၪဝ့ၫလီၫ. နမိန့ဘၪန့ၫဆၧဖၭန့လမံၩ့မွဲအ့ၬ.- တၭခိၪ လီၩ့လဖျိၪ့နီၪမိကဲၪထၪ့နဆၧလီၫ. အဂဲးဘဲၫယီၩမွဲၥံၪ့ အလးလီၫ. တၭနမိဘၪခူၬလၩ့ခွံၬဝ့ၫတၭ, အထုၬလ ဖၪနီၪမိကဲၪထၪ့နဆၧလီၫ. အဂဲးဘဲၫယီၩ ၦကၫနအၫ့ ဖိၪအီၪလၧလဲၪ့ၥုၭထၭ, ဒဲအဂဲးဆီၪ့အဘၭဆီၪ့လါနၫ့ တၭနမိနၫ့ထၪ့ခွံၬနဝ့ၫလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအလူၬနီၪအီၪ ကိၩ့အီၪကီၪ့ထီးၡဲလိၫနီၪတၭ, မၩထၪ့ဆၧအီၪကီၪ့အ တဲၩဆံၫ့ဎံၪထီးနီၪတၭ, ၦခးဖိၪနီၪစၪဝ့ၫ လၧအဝ့ၫၥံၪ အမ့ၬယၫလီၫ.",
			"2": "<sup>2</sup> တၭၦလၧအလန့ဒံၭဘၪဆၧန့ၥၫနီၪ ၦနွ့ၫဒီၪ့အီၪလၩ့ ထးဝ့ၫလၧၦအံၫစရ့လၭဖိၪအကျၩလီၫ.",
			"3": "<sup>3</sup> တၭစယီရှုၫအ့ၫစံၭ ၦအံၫစရ့လၭဖိၪလဖၪနီၪ, ဘဲၫ ၥိၭနၥံၪလမၩန့ဒံၭဘၪ ထံၫၥံၪခးၥံၪ လၧယဟိဝၩနၥံၪ အဖါလဖၪအယွၩဖ့ၪလၫ့နၥံၪ, မွဲနၥံၪမိအီၪက့ၪဆါန",
			"4": "<sup>4</sup> ၥံၪအဂဲးအဘၭဆံၭယံၬလဲၪ.- လၧနၥံၪအကျၩနီၪ, ဖ့ၪ လၫ့လၧလဒီၪ့ၦၥၧၫ့ဂၩ, လဒီၪ့ၦၥၧၫ့ဂၩ ဆုၬဆုၬဆံၭ. ယမိအၪ့မၧၫ့လၩ့အဝ့ၫၥံၪတၭ, မွဲအမိဂဲထုၪ့တၭ,လ့ၩ ဆၧလၧခးထၧၫ့ဘံၪ့ယၫအဖၧၩ့, ဒဲကွ့ၭဆၧလၧအဂဲး အကၠီၪ့ဘဲၫအဆၧန့ၥၫအၥိၭတၭ, မိဘၪဂဲၫထဲၩ့ထဲၩ့",
			"5": "<sup>5</sup> လၧယအီၪလီၫ.- တၭအဝ့ၫၥံၪမိဘၪအၪ့နၩ့ဖၭဝ့ၫလၧ နွ့ၫဝၩ့လီၫ. စယုဒၫအီၪလၧအနဲၩ့ထံၭလၧမုခံၫ့လခီၫ, စယိၥၭအၡၩဂံၪ့ဖိၪဘၪအီၪလၧအနဲၩ့ထံၭ လၧမုဖၩ",
			"6": "<sup>6</sup> လခီၫနီၪလီၫ.- တၭနၥံၪမိဘၪကွ့ၭဆၧလၧခးအဂဲးအ ကၠီၪ့လၧနွ့ၫဝၩ့ဒဲဂဲၫထဲၩ့ဆိၬ လၧယအီၪထီးယီၩတၭ, ယမိဖၭဆၧထီးယီၩ, လၧနၥံၪအဂးလၧယဟိဝၩပယွၩ",
			"7": "<sup>7</sup> အမ့ၬယၫလီၫ.- အ့ၪမွဲၦလံဝဲၫဖိၪအဂးအီၪလၧနၥံၪအ ကျၩအ့ၬ. အဂဲးဘဲၫယီၩယဟိဝၩအၡၩလုဆၧအလး နီၪမွဲအဝ့ၫၥံၪအဆၧန့ၥၫလီၫ. ဒဲစဂၭ,ဒဲစရုဘံၫ့, ဒဲစမ နၭစ့ၫအလခီၫဒီၪ့နီၪ, န့ဘၪယူၭအဆၧန့ၥၫ လၧယီဒၫ့ အဝါလၧမုထၪ့လခီၫ, လၧယဟိဝၩအခ့ၫအၡၩစမိစ့ၭ ဖ့ၪလၫ့ဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ၦလဖၪနီၪဂဲထုၪ့တၭ, လ့ၩဆၧတၭ,စယီရှုၫအ့ၫမၪ လူၬဝဲၩၦလၧအလ့ၩဆၧလဖၪ, လၧအမိဘၪကွ့ၭဂၪ့ခိၪ အဂဲးအကၠီၪ့တၭ, စံၭဝ့ၫဒၪ,လ့ၩစဲၪ့ဝံၩ့ဝၩ့လၧထံၫၥံၪ ခးၥံၪအဖၧၩ့, ဒဲကွ့ၭဆၧလၧအဂဲးအကၠီၪ့တၭ, ဂဲၫထဲၩ့ ထဲၩ့လၧယအီၪဆံၭး တၭယမိဖၭဆၧထီးယီၩလၧနၥံၪ အဂး လၧယဟိဝၩအမ့ၬယၫ လၧၡဲလိၫအဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ၦလဖၪနီၪ လ့ၩဆၧဒဲခၫ့ဂၬ ထံၫၥံၪခးၥံၪတၭ, ကွ့ၭဝ့ၫ လၧလံၬဖၧၩ့ ဘဲၫအဒိၩ့လဖၪ အီၪဝ့ၫအၥိၭ လၧနွ့ၫဝၩ့ နီၪ,ဂဲၫထဲၩ့ထဲၩ့လၧစယီရှုၫအ့ၫအအီၪ လၧၦၥုၪ့တဲၩအ",
			"10": "<sup>10</sup> လးလၧၡဲလိၫအဖၧၩ့နီၪလီၫ.- တၭစယီရှုၫအ့ၫဖၭ ဆၧလၧအဝ့ၫၥံၪအဂး လၧၡဲလိၫအဖၧၩ့လၧယဟိဝၩ အမ့ၬယၫလီၫ. တၭစယီရှုၫအ့ၫ အၪ့နၩ့ဖၭထံၫၥံၪခး ၥံၪလၧၦအံၫစရ့လၭဖိၪအဂး ဘဲၫအဆၧအၪ့နၩ့ဖၭအ ၥိၭနီၪလီၫ.",
			"11": "<sup>11</sup> ၦဘံၪ့ယမံၫ့ဖိၪလဒီၪ့အဆၧဖၭန့ လၧအဂးနီၪဂဲၫထၪ့ ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, အဆၧဖၭ လၧအခးနဲၩ့ ထံၭနီၪဂဲၫထၪ့လၧစယုဒၫအဖိၪ, ဒဲစယိၥၭ အဖိၪအ",
			"12": "<sup>12</sup> ဘိၩ့ဆၧၩ့နီၪလီၫ.- တၭအဝ့ၫၥံၪ အခးနဲၩ့ထံၭလၧမု ဖၩလခီၫအီၪဝ့ၫလၧယီၫဒၫ့, ဒဲခးအနဲၩ့ထံၭနီၪလ့ၩထၪ့ လၧယ့ၫရခိၫအနဲၩ့ထံၭ လၧမုဖၩလခီၫ, လ့ၩထၪ့ဖျီၫ့ ခိၪလီၩ့ဖိးလၧမုနုၬလခီၫတၭ, စဲၪ့ထၪ့ခွံၬနီၪထီးၡါမု",
			"13": "<sup>13</sup> နၧၫ့ဖၫဘ့ၭၥအ့ဝံၫ့လီၫ.- တၭခးအနဲၩ့ထံၭနီၪခၫ့ဂၬ ဆၧထီးနီၪတီၩလၧလုဇၭ, လၧလုဇၭအနဲၩ့ထံၭလၧမု ခံၫ့လခီၫ, အနီၪမွဲဘ့ၥလၭတၭ, ခးအနဲၩ့ထံၭနီၪလ့ၩ လၩ့လၧအၭတရီၭအၫဒၧၫ, ဘူၭလၧခိၪလီၩ့လဖျိၪ့အီၪ လၧဘ့ၭၥဟိရၧၫ့လၧလၬလခီၫ လၧဒိၩ့အမုခံၫ့လခီၫ.",
			"14": "<sup>14</sup> ဆၧထိၪခးအနဲၩ့ထံၭတၭ, လ့ၩဎဲၪ့မၫဆမံၭအနိၪ့လၧ မုခံၫ့လခီၫလၧခိၪလီၩ့လဖျိၪ့ လၧအအီၪလၧဘ့ၭၥဟိ ရၧၫ့အမ့ၬယၫ လၧမုခံၫ့လခီၫ, ဒဲစဲၪ့ထၪ့ခွံၬဝ့ၫနီၪထီး ကၧၫယၭဘၫအလၭ, အနီၪမွဲကၧၫယၭယ့အရံၫ့, ၦယု ဒၫဖိၪလဖၪအဒိၩ့လဒိၩ့လီၫ. အနီၪမွဲအနဲၩ့ထံၭမုနုၬ လခီၫလီၫ.",
			"15": "<sup>15</sup> အမုခံၫ့လခီၫအီၪဝ့ၫလၧကၧၫယၭယ့အရံၫ့ အထုၬ တၭ,ခးအနဲၩ့နီၪ စဲၪ့ထၪ့ခွံၬလၧမုနုၬလခီၫတၭ, လ့ၩ",
			"16": "<sup>16</sup> ဆၧလၧန့ၭဖၥိၫအၫအထံၫထၪ့ဖျိၭအဖၧၩ့အအီၪ,- တၭ ခးအနဲၩ့ထံၭနီၪ လ့ၩလၩ့လၧခိၪလီၩ့လဖျိၪ့အထုၬလၧ အအီၪဝ့ၫလၧစဟံၪ့နၧၫ့အဖိၪခွၫ အခိၪလီၩ့ဆူၭအမ့ၬ ယၫ,လၧအအီၪလၧၦဂဲးဆီၪ့ဖိၪအခိၪလီၩ့ဆူၭအဖၧၩ့ လၧမုဖၩလခီၫတၭ, လ့ၩလၩ့လၧခိၪလီၩ့ဆူၭဟံၪ့နၧၫ့, လၧယဘုစဲၫအနဲၩ့ လၧမုခံၫ့လခီၫတၭ, လ့ၩလၩ့လၧ",
			"17": "<sup>17</sup> အံၫ့ရိဂလၭ,- ဆၧထိၪလၧမုဖၩလခီၫတၭ, လ့ၩထၪ့ဝ့ၫ လၧအံၪ့ၡံၫမ့ၭတၭ, လ့ၩထၪ့လၧဂ့လလီၭ, လၧအအီၪ ဆဲၫဎၩ့လၧအလ့ၩထၪ့လၧအဒၧမံၫ့တၭ, လ့ၩလၩ့လၧ",
			"18": "<sup>18</sup> စရုဘံၫ့အဖိၪခွၫ စဘိဟၫ့အလိးလဖျိၪ့အအီၪ,- တၭ လ့ၩဆၧလၧအနဲၩ့ထံၭ လၧအအီၪ ဆဲၫဎၩ့ လၧအၫရ",
			"19": "<sup>19</sup> ဘၫလၧမုဖၩလခီၫတၭ, လ့ၩလၩ့လၧအၫရဘၫ,- တၭ ခးအနဲၩ့ထံၭနီၪ လ့ၩဆၧလၧဘ့ၭၥဟီၭလၫအနဲၩ့လၧ မုဖၩလခီၫတၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪ ထီၩ့မၫဆမံၭထံၫ လၪအဆၧဒူၩ့ကဲၪ့ဖၧၩ့ လၧမုဖၩလစီၪ့လၧယီၫဒၫ့မုခံၫ့ လခီၫလီၫ. အနီၪမွဲခးအနဲၩ့ထံၭ လၧမုခံၫ့လခီၫလီၫ.",
			"20": "<sup>20</sup> တၭယီၫဒၫ့မွဲခးအနဲၩ့လၧမုထၪ့လခီၫလီၫ. အနီၪမွဲ ၦဘံၪ့ယမံၫ့ဖိၪလဖၪ အဆၧန့ၥၫ, ဘဲၫအခးနဲၩ့လဖၪ အီၪဝၬဖီၩ့ဝ့ၫအၥိၭ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.",
			"21": "<sup>21</sup> တၭၦဘံၪ့ယမံၫ့ဖိၪ လဒီၪ့အဒိၩ့လဖၪ ဘဲၫအဂံၪ့ဒီၪ့ လဖၪအၥိၭနီၪ, မွဲယ့ၫရခိၫ, ဒဲဘ့ၭၥဟီၭလၫ, ဒဲကံဇံၭ",
			"22": "<sup>22</sup> အခိၪလီၩ့ဆူၭ.- ဒဲဘ့ၭၥအၫရဘၫ, ဒဲဇံၫ့မရံၫ့, ဒဲဘ့ၥ",
			"23": "<sup>23</sup> လၭ.- ဒဲအၫဝံၫ့, ဒဲဖၫရၫ,ဒဲအီဖၩ.- ဒဲခံဖၫဟၫအၫမ",
			"24": "<sup>24</sup> န့ၫ,ဒဲအီဖနဲၫ,ဒဲဂၫဘၫလီၫ.- ဒိၩ့လဆံၫနံၫဒိၩ့အီၪလၧ",
			"25": "<sup>25</sup> အတဝၫ့လဖၪလီၫ.- ဂံဘအၧၫ့, ဒဲရၫမၫ, ဒဲဘံရီၭ. ဒဲမံဇပၫ,ဒဲခ့ၭဖဲရၫ,ဒဲမိဇၫ,",
			"26": "<sup>26</sup> ဒဲရံကံၫ့,ဒဲအၧၫပံၫအ့",
			"28": "<sup>28</sup> လၭ,ဒဲတၫရလၫ.- ဒဲဇံလၫ,ဒဲအ့လ့ၭ, ဒဲယဘုစဲၫ,အ နီၪမွဲယရုစလံၫ့, ဂံဘံၫအၭ, ဒဲကၧၫယၭနီၪလီၫ ဒိၩ့လ ဆံၫလံဒိၩ့ အီၪလၧအတဝၫ့လဖၪလီၫ. အနီၪမွဲၦဘံၪ့ ယမံၫ့ဖိၪအဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ဆၧဖၭန့နံၫမံၩ့လမံၩ့နီၪ ဂဲၫထၪ့လၧစစံမအၧၫ့အဂး, လၧစစံမအၧၫ့ဖိၪလဒီၪ့အဂး, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭ နီၪလီၫ. တၭအဝ့ၫၥံၪအဆၧန့ၥၫအီၪဝ့ၫလၧၦယုဒၫဖိၪ",
			"2": "<sup>2</sup> အဆၧန့ၥၫအဖၧၩ့လီၫ.- တၭလၧအဆၧန့ၥၫအကျၩ",
			"3": "<sup>3</sup> နီၪအီၪဝ့ၫလၧဘံၫအၧၫၡံဘၫဒဲၡံဘၫ, ဒဲမိလဒၫ,- ဒဲဟၫ",
			"4": "<sup>4</sup> ဇၫရှုၫအ့လၭ,ဒဲဘၫလၫ,ဒဲအၫဇံၫ့,- ဒဲအ့လတိၫလၭ,",
			"5": "<sup>5</sup> ဒဲဘ့ၫၥူၫအ့လၭ, ဒဲဟီၫမၫ,- ဒဲဇံၭလၭ,ဒဲဘ့ၭၥမၫက",
			"6": "<sup>6</sup> ဘီၭ,ဒဲဟၫဇၫရှုၫစၫ,- ဒဲဘ့ၭၥလ့ၭဘအီၭ,ဒဲၡရုဟံၫ့,",
			"7": "<sup>7</sup> ဒိၩ့လဆံၫၥၧၫ့ဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ.- အၫအံၫ့, ရ့မၧၫ့, ဒဲအံၫၥၧၫ ဒဲအၫၡၫ့း ဒိၩ့လံဒိၩ့အီၪလၧအတ",
			"8": "<sup>8</sup> ဝၫ့လဖၪလီၫ.- တၭကယဲတဝၫ့လၧအအီၪဝၬဖီၩ့ဒိၩ့လ ဖၪဖိးလၧဘၫအလၭဘံအၧၫ, ရၫမၭလၧမုခံၫ့ လခီၫ လီၫ. အဝ့ၫနီၪမွဲၦစံမအၧၫ့ဖိၪအဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့",
			"9": "<sup>9</sup> လဖၪအၥိၭနီၪလီၫ.- ဆၧမၩန့ၦစံမအၧၫ့ဖိၪအဆၧန့ ၥၫလၧၦယုဒၫဖိၪ အဆၧန့ၥၫအကျၩလီၫ. အဂဲးဘဲၫ ယီၩၦယုဒၫဖိၪအဂးနီၪ အၪလါကဲၪကၩလၧအဂးလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ၦစံမအၧၫ့ဖိၪန့ဘၪ အဆၧန့ၥၫ လၧအဝ့ၫၥံၪအဆၧန့ၥၫအကျၩလီၫ,",
			"10": "<sup>10</sup> တၭဆၧဖၭန့ၥၧၫ့မံၩ့လမံၩ့နီၪ ဂဲၫထၪ့လၧၦဇ့ၭဘ လၧၫ့ဖိၪအဂးဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪတၭ, အဝ့ၫၥံၪ",
			"11": "<sup>11</sup> အဆၧန့ၥၫအနဲၩ့ထံၭနီၪ အီၪဝ့ၫလၧစၫရံၭ,- တၭအ နဲၩ့ထံၭနီၪလ့ၩထၪ့လၧမၫဆမံၭနဲၩ့, ဒဲမၫရလၫ, ဒဲထီၩ့ လၧဒၭဘၡ့ၭတၭ, ထီၩ့လၧထံၫချိၬ အီၪလၧယီၭနံၫ",
			"12": "<sup>12</sup> အၫ့အမ့ၬယၫ,- ကၠၪအၥၭလၧစၫရံၭလၧမုထၪ့လခီၫဖိး လၧခံစလီၭတၫဘၧၫအနဲၩ့ထံၭတၭ, ထီးနီၪလဖၧၫ့စဲၪ့ ထၪ့ခွံၬဝ့ၫလၧဒၪဘရၭ, ဒဲလ့ၩထၪ့ဝ့ၫလၧယၫဖဲအၫ,",
			"13": "<sup>13</sup> လ့ၩထၪ့ခွံၬဝ့ၫထီးနီၪဖိးလၧမုထၪ့လခီၫ, ထီၩ့လၧဂံတၫ ဟံဖၧၫ,လၧအံတၫကၭဇံၫ့တၭ, စဲၪ့ထၪ့ဝ့ၫလၧရ့ၫမၧၫ့",
			"14": "<sup>14</sup> မ့ၭၥိအၫ,ထီၩ့လၧန့အၫတၭ,- အနဲၩ့ထံၭလၧမုဖၩလ ခီၫနီၪလ့ၩဎဲၪ့ဆၧလၧဟၫ့နၫၥၫ့တၭ, စဲၪ့ထၪ့ခွံၬထီး",
			"15": "<sup>15</sup> နီၪထီးခိၪလီၩ့ဆူၭယံဖၥၫအ့လၭ,- ဒဲကၭတၫ ဒဲနဟၫ လလၭ,ဒဲၡံမရၧၫ့,ဒဲအံဒလၫ, ဒဲဘ့ၭၥလံၫဟံၫ့လီၫ. ဒိၩ့",
			"16": "<sup>16</sup> လဆံၫနံၫဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ. အဝ့ၫယီၩမွဲ ၦဇ့ၭဘလၧၫ့ဖိၪလဒီၪ့ လၧအဆၧန့ၥၫဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, ဒိၩ့လဖၪနီၪအီၪလၧအတဝၫ့လဖၪလီၫ.",
			"17": "<sup>17</sup> တၭဆၧဖၭန့လံမံၩ့လမံၩ့ ဂဲၫထၪ့လၧစအံစခၫအဂး, လၧၦအံစခၫဖိၪအဂးဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.",
			"18": "<sup>18</sup> တၭအဝ့ၫၥံၪအနဲၩ့ထံၭနီၪ, အီၪဝ့ၫလၧယ့ၫစအ့လၭ,",
			"19": "<sup>19</sup> ဒဲခစၧၫလီၭ,ဒဲရှုနံၫ့,- ဒဲဟၭဖရ့အံၫ့, ဒဲၡဲဟီၫ့,ဒဲအၫန ဟၫရ့ၭ.",
			"20": "<sup>20</sup> ဒဲရၫဘံၭ, ဒဲကံၭၡအၧၫ့,ဒဲအၫဘ့ၭ.- ဒဲရံ",
			"22": "<sup>22</sup> မ့ၭ,ဒဲအံၫ့ဂၪ့နံၫ့, ဒဲအံၫ့ဟၭဒၫ,ဒဲဘ့ၭၥပၭဇ့ၭ,- ဒဲအ နဲၩ့ထံၭနီၪထီၩ့လၧတၫဘီၫ, ဒဲၡဟၭဇမၭ,ဒဲဘ့ၭၥၡ့ မ့ၭတၭ, အနဲၩ့ထံၭနီၪစဲၪ့ထၪ့ထီးနီၪ, ထီၩ့လၧယီၫဒၫ့",
			"23": "<sup>23</sup> လီၫ. ဒိၩ့လဆံၫဎူၫဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ.- အ နီၪမွဲၦအံစခၫဖိၪလဒီၪ့အဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪ, ဒိၩ့လဖၪနီၪအီၪလၧ အတဝၫ့လဖၪလီၫ.",
			"24": "<sup>24</sup> တၭဆၧဖၭန့ ယဲမံၩ့လမံၩ့နီၪ ဂဲၫထၪ့လၧၦအၭၡၧၫ ဖိၪလဒီၪ့အဂး, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.",
			"25": "<sup>25</sup> တၭအဝ့ၫၥံၪအနဲၩ့ထံၭနီၪ မွဲဟ့လကၭ,ဒဲဟၫလဲၫ,",
			"26": "<sup>26</sup> ဒဲဘံတံၫ,ဒဲအၪကၡၭ.- ဒဲအလၫ့မလ့ၭ,ဒဲအၫမၭ,ဒဲမၡံ အ့လၭ, ဒဲထီၩ့လၧကၫမလၭမုနုၬလခီၫ, ဒဲဖိးလၧၡဲၫ",
			"27": "<sup>27</sup> ဟီၫလံၭဘနၫ,- တၭကၠၪအၥၭလၧမုထၪ့, လၧဘ့ၭၥဒၫ ဂၫ့,ဒဲထီၩ့လၧဇ့ၭဘလၧၫ့, ဒဲဖိးလၧခိၪလီၩ့ဆူၭယံၭဖ ၥၫအ့လၭလီၩ့လၧဘ့ၭၥံၫမ့ၭ, ဒဲနံၫအ့လၭလၧမုဖၩလ ခီၫတၭ, စဲၪ့ထၪ့ဝ့ၫလၧကၫဘုလၭလၧစူၪစ့ၪလခီၫ,",
			"28": "<sup>28</sup> ဒဲဟံဘြၧၫ့,ဒဲရံဟီၭ,ဒဲဟၫမၫ့, ဒဲကၫနၫ,ဖိးလၧဇဲဒၧၫ့",
			"29": "<sup>29</sup> ဖၭဒိၪ.- တၭအနဲၩ့ထံၭနီၪကၠၪအၥၭလၧရၫမၫ, ဒဲလၧ ဒိၩ့ဂုးခၧၫ့တဲအၫး ဒဲအနဲၩ့ထံၭနီၪ ကၠၪအၥၭလၧဟိ စၫတၭး စဲၪ့ထၪ့ဝ့ၫနီၪ မွဲထီၩ့မၫဆမံၭနဲၩ့, လၧအနဲၩ့",
			"30": "<sup>30</sup> ထံၭနီၪထီၩ့လၧအၭဇံၭ, ဒဲအၧၫမၫ,ဒဲအၫဖ့ၭ, ဒဲရံဟီၭ နီၪလီၫ. ဒိၩ့နံၫဆံၫနံၫဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ.",
			"31": "<sup>31</sup> အနီၪမွဲၦအၭၡၧၫဖိၪလဒီၪ့ အဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့ လဖၪအၥိၭနီၪ, ဒိၩ့လဖၪနီၪ အီၪလၧအတဝၫ့လဖၪ လီၫ.",
			"32": "<sup>32</sup> တၭဆၧဖၭန့ဎူၫမံၩ့လမံၩ့နီၪ ဂဲၫထၪ့လၧၦနၭၥလဲၫ ဖိၪအဂး,လၧၦနၭၥလဲၫဖိၪအဂး ဘဲၫအဂံၪ့ဒီၪ့လဖၪအ",
			"33": "<sup>33</sup> ၥိၭနီၪလီၫ.- တၭအဝ့ၫၥံၪအနဲၩ့ထံၭနီၪ စဲၪ့ထၪ့ခွံၬဝ့ၫ လၧဟ့လ့ၭ, လၧအၫလၫ့ထီၩ့လၧဇၫအနၫနံၫ့, ဒဲအၫဒ မံၫ,ဒဲနံက့ၭ, ဒဲယၭဘနံၫလၭဖိးလၧလၫကၧၫ့တၭ, စဲၪ့",
			"34": "<sup>34</sup> ထၪ့ခွံၬဝ့ၫနီၪမွဲထီၩ့ယီၫဒၫ့,- တၭအနဲၩ့ထံၭနီၪကၠၪအ ၥၭလၧမုနုၬလခီၫ, လၧအၭဇနီၭတၫဘီၫတၭ, စဲၪ့ထၪ့ ဝ့ၫထီးနီၪ လၧဟၧၭကီတၭ, ထီၩ့လၧဇ့ၭဘလၧၫ့လၧ မုခံၫ့လခီၫ, ဒဲထီၩ့လၧအၭၡၧၫလၧမုနုၬလခီၫတၭ, ဖိး လၧယုဒၫလၧယီၫဒၫ့အနဲၩ့လီၩ့ လၧမုထၪ့လခီၫနီၪလီၫ.",
			"35": "<sup>35</sup> တၭဒိၩ့အီၪလၧအခိၪဒၧၩ့နီၪ မွဲဇံၭဒံၫ့, ဒဲဇၧၫ,ဒဲဟၫ",
			"36": "<sup>36</sup> မၭ,ရၭကၭ,ဒဲခံၫ့နရ့ၭ,- အၫဒမၫ,ဒဲရၫမၫ,ဒဲဟၫဇၧၫ, ဒဲက့ဒ့ၭ,ဒဲအ့ဒအဲၫ, ဒဲအံၪ့ဟၫဇၧၫ,",
			"37": "<sup>37</sup> ဒဲအဲရၧၫ့, ဒဲမံၭဒလ့လၭ,ဒဲဟိရံၫ့, ဒဲဘ့ၭၥၫနၭ, ဒဲဘ့ၭၥၡံမ့ၭလီၫ.",
			"39": "<sup>39</sup> ဒိၩ့လဆံၫခွံၫဒိၩ့အီၪလၧအတဝၫ့လဖၪလီၫ.- အနီၪမွဲ ၦနၭၥလဲၫဖိၪလဒီၪ့အဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအ ၥိၭနီၪ, ဒိၩ့လဖၪနီၪအီၪလၧ အတဝၫ့လဖၪလီၫ.",
			"40": "<sup>40</sup> တၭဆၧဖၭန့နွ့ၫမံၩ့လမံၩ့နီၪ ဂဲၫထၪ့ဝ့ၫလၧၦဒၫ့ဖိၪ",
			"41": "<sup>41</sup> လဒီၪ့အဂး, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.- တၭအ ဆၧန့ၥၫအနဲၩ့ထံၭနီၪ, မွဲဇိရၫ, ဒဲအ့ၭၡတ့ၫအီလၭ,ဒဲ",
			"42": "<sup>42</sup> အၧၫၡံမ့ၭ,- ဒဲၡၫအၫလဘံၫ့, ဒဲအၭဇလၧၫ့, ဒဲယံၭၥ လၫ,",
			"43": "<sup>43</sup> ဒဲအံလၧၫ့, ဒဲတံၫ့မန့ၥၭ,ဒဲအ့ကြၧၫ့,- ဒဲအ့ၫ",
			"45": "<sup>45</sup> တံလကံၫ, ဒဲဂံၭဘံၫၥၧၫ့, ဒဲဘၫအလၭ,- ဒဲယ့ဟၧၭ,",
			"46": "<sup>46</sup> ဘံၫ့န့ၫဘံရၭ,ဒဲဂၭၥရံမၧၫ့,- ဒဲမယၫကၧၫ့,ဒဲရၫကၧၫ့ တၭ,အနဲၩ့ထံၭအီၪဝ့ၫ လၧယီၫပၫ အမ့ၬယၫလီၫ.",
			"47": "<sup>47</sup> တၭၦဒၫ့ဖိၪအခးနဲၩ့ထံၭနီၪ စဲၪ့ထၪ့ခွံၬလၧအဝ့ၫၥံၪအ ဂးလီၫ. တၭၦဒၫ့ဖိၪလ့ၩဒုၭဆၧထၫ့ဒၩလံၡံၫ့တၭ, မၩ န့ဝ့ၫတၭဖ့ၬခွံၬဝ့ၫလၧနၭအနါတၭ, မၩန့ဆီၪ့ဝ့ၫဒဲအီၪ လၧအဖၧၩ့တၭ, ဖျိၬလံၡံၫ့အမံၩ့လၧဒၫ့ဘဲၫအဖါအမံၩ့",
			"48": "<sup>48</sup> ဒၫ့အၥိၭနီၪလီၫ.- အနီၪမွဲၦဒၫ့ဖိၪလဒီၪ့ အဆၧန့ၥၫ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, ဒိၩ့လဖၪနီၪအီၪလၧအ တဝၫ့လဖၪလီၫ.",
			"49": "<sup>49</sup> ထီးအဝ့ၫၥံၪအၪ့နၩ့ဖၭခး လၧအဆၧန့ၥၫအဂးအ ဆၧၫ့, ဘဲၫခးအနဲၩ့ထံၭလဖၪအၥိၭနီၪဂီၩ့တၭ, ၦအံၫ စရ့လၭဖိၪဖ့ၪလၫ့စနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫအဆၧန့ၥၫ",
			"50": "<sup>50</sup> လၧအဝ့ၫၥံၪအကျၩ,- ဘဲၫဆၧလၧယဟိဝၩ အလူအ ၥိၭနီၪအဝ့ၫၥံၪဖ့ၪလၫ့ဒိၩ့လဒိၩ့ လၧအအၪ့ကံၩ့ဝ့ၫ,တံၫ မနၭစံရၫလၧခိၪလီၩ့ အံဖြံၫ့အလီၩ့လီၫ. တၭအဝ့ၫဒၪ မၩကဲၪထၪ့ဒိၩ့နီၪ, အီၪဝ့ၫထီးနီၪလီၫ.",
			"51": "<sup>51</sup> အဝ့ၫၥံၪနီၪ မွဲဆၧန့ၥၫလဖၪ လၧၦလုဆၧစအံၫလ အ့ဇၧၫ, ဒဲစနိၫ့အဖိၪခွၫစယီရှုၫအ့ၫ, ဒဲၦအံၫစရ့လၭဖိၪ အဒီၪ့အဖါအခိၪလဖၪ ဖၭဆၧအကၠီၩ့တၭ, အၪ့နၩ့ဖၭ ဝ့ၫလၧဆၧန့ၥၫအဂး လၧၡဲလိၫအဖၧၩ့လၧယဟိဝၩအ မ့ၬယၫ, ထီးဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့နီၪ လီၫ. တၭအဝ့ၫၥံၪအၪ့နၩ့ဖၭ ထံၫၥံၪခးၥံၪအဆၧၫ့ဂီၩ့ ဝ့ၫဒၪဘဲၫနီၪလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧ စယီရှုၫအ့ၫတၭ, စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ, အီၪက့ၪဒိၩ့ဖ လ့ၬလၧနၥံၪအဂး ဘဲၫလၧယချဲၩ့ဆၧလၧနၥံၪလၧစမိ",
			"3": "<sup>3</sup> စ့ၭအစူၪဖၧၩ့လၧအဂဲးအကၠီၪ့,- ဘဲၫၥိၭၦလၧအမၩ ၥံၫခွံၬၦလဂၩ လၧအမၩၥံၫရှုၭဆၧအကၠီၩ့တၭ လၥ့ၪ ယၫဘၪဝ့ၫနီၪမိစဲၪ့လၧအအီၪတၭ, မိကဲၪထၪ့ဆၧဖီၩ့ ဖျ့ၭလၧနၥံၪအဂး လၧၦအၪ့ဎၬဆၧၥွံၪလဂၩနီၪလီၫ.",
			"4": "<sup>4</sup> တၭထီးၦလၧအစဲၪ့ဆၧလၧဒိၩ့နီၪ လဖျိၪ့ဖျိၪ့မိဆၧၫ့ ထုၪ့လၧဒိၩ့အတရၫ့တၭ, မိချဲၩ့ဆၧလၧဒိၩ့အၦၥုၪ့က့ၭ ၥၭၡါအနါဖၧၩ့တၭ, အဝ့ၫၥံၪမိဘၪမၩန့ဝ့ၫ လၧဒိၩ့ ဖၧၩ့လၧအအီၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧအလး, ဘဲၫၥိၭအမိ",
			"5": "<sup>5</sup> အီၪက့ၪဝ့ၫလၧအကျၩလီၫ.- တၭၦအၪ့ဎၬဆၧၥွံၪလ ဂၩနီၪအ့ၪလီၩ့ဆီးဝ့ၫတၭ အဝ့ၫၥံၪထီးဖ့ၪလၫ့ခွံၬၦမၩ ၥံၫဆၧလၧအဝ့ၫဒၪ အစူၪဖၧၩ့လဂ့ၩ. အဂဲးဘဲၫယီၩ မွဲအလၥ့ၪယၫဘၪဝ့ၫတၭ, ဖ့ၬဘၪၦလၧအနဲၩ့ထံၭတၭ,",
			"6": "<sup>6</sup> မ့ၬလဲၩဝ့ၫဒၪလၧအခီၩနီၪအ့ၬ.- မွဲအမိဘၪအီၪလၧဒိၩ့ ဖၧၩ့နီၪထီးအဆၧၫ့ထုၪ့လၧဆၧအီၪကီၪ့ အမ့ၬယၫလၧ ဆၧစ့ၩရၫ့အဂး, ဒဲထီးၦလုဆၧအခိၪလၧအအီၪလၧမု နံၩလဖၪနီၪၥံၫဝ့ၫလီၫ. ထီးနီၪလဖၧၫ့ၦမၩၥံၫဆၧမိဂဲၫ ထဲၩ့ထဲၩ့ဝ့ၫလၧအဒိၩ့ဒၪဝ့ၫနီၪ ဒဲလၧအဂံၪ့ဒၪဝ့ၫ,လၧဒိၩ့",
			"7": "<sup>7</sup> လဖျိၪ့လၧအစဲၪ့ထၪ့ခွံၬဝ့ၫလၧအဖၧၩ့လီၫ.- တၭအဝ့ၫ ၥံၪအီၪက့ၪလၩ့ဝ့ၫ လၧကၫဒ့ၭ လၧဂၫလလံၫအဖၧၩ့, လၧခိၪလီၩ့နၭၥလဲၫအလီၩ့, ဒဲၡံခံၫ့လၧခိၪလီၩ့အံဖြံၫ့ အလီၩ့, ဒဲကၧၫယၭအၫဘၫ, အနီၪမွဲဟံဘြၧၫ့လၧခိၪ",
			"8": "<sup>8</sup> လီၩ့ယုဒၫအလီၩ့လီၫ.- တၭလၧယီၫဒၫ့ဝါလခီၫ, ဆဲၫ ဎၩ့လၧယ့ၫရခိၫ လၧမုထၪ့လခီၫနီၪ အဝ့ၫၥံၪအီၪက့ၪ လၩ့ဝ့ၫလၧဘံဇၧၫ, လၧၡါမုနၧၫ့ဖၫ လၧဆၧပျၩ့ဖၧၩ့ လၧစရုဘံၫ့လဒီၪ့အကျၩ, ဒဲရၫမီၭလၧဂံလအၭအဖၧၩ့ လၧစဂၭလဒီၪ့အကျၩ, ဒဲဂိလၫ့လၧဘၫၡၫ့အဖၧၩ့လၧစ မနၭစ့ၫလဒီၪ့အကျၩလီၫ.",
			"9": "<sup>9</sup> တၭအဝ့ၫၥံၪနီၪ မွဲဒိၩ့လၧအဘၪဆၧအီၪက့ၪလၩ့ဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ ထီးအလူၬအဂး, ဒဲလၧၦလခီၫ ဘၩ့မုးဖိၪလၧအအီၪဝ့ၫလၧအကျၩအဂး, ဘဲၫၥိၭထီး ဒၪၦလၧအမၩၥံၫရှုၭၦလဂၩ လၧအလၥ့ၪယၫဘၪဆၧ အကၠီၩ့လဂၩဂၩနီၪ မိစဲၪ့ဝ့ၫထီးနီၪတၭ, ဘိၩ့အလ ချႃၭဆၧၫ့ထုၪ့ဒံၭဘၪ လၧဆၧအီၪကီၪ့ အမ့ၬယၫနီၪ, လမိၥံၫဘၪ လၧၦအၪ့ဎၬ ဆၧၥွံၪလဂၩ အစူၪဖၧၩ့လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> တၭၦလံဝဲၫဖိၪအဖါအခိၪလဖၪ ၥုၭဘူၭအၥၭလၧၦ လုဆၧစအံၫလအ့ဇၧၫ, ဒဲစနိၫ့အဖိၪခွၫစယီရှုၫအ့ၫ,ဒဲ လၧၦအံၫစရ့လၭဖိၪ အဒီၪ့လဖၪအဖါၥံၪ အခိၪလဖၪ",
			"2": "<sup>2</sup> အအီၪ,- တၭချဲၩ့ဆၧလၧအဝ့ၫၥံၪ လၧၡဲလိၫလၧကၫန အၫ့အဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩ မၪလူၬဆၧလၧ စမိစ့ၭအစူၪဖၧၩ့ လၧအမိဖ့ၪလၫ့ပၧၩ လၧဒိၩ့လဖၪ, ဘဲၫၥိၭပမိအီၪလၧအဖၧၩ့, ဒဲအဆၧအၪ့အဆၪအလး လဖၪလၧပဆၧဖိၪဆၧဎါ အဒိၩ့လဖၪ အဂးလီၫ.",
			"3": "<sup>3</sup> တၭၦအံၫစရ့လၭဖိၪဖ့ၪလၫ့ ၦလံဝဲၫဖိၪအဆၧန့ၥၫလၧ အကျၩ ဘဲၫယဟိဝၩ အဆၧမၪလူၬအၥိၭနီၪ, ဒိၩ့လ ဖၪယီၩ, ဒဲအဆၧအၪ့အဆၪအလးလဖၪနီၪလီၫ.",
			"4": "<sup>4</sup> တၭဆၧဖၭန့နီၪ ဂဲၫထၪ့လၧၦကိဟၭဖိၪအဂံၪ့ဒီၪ့ လဖၪအဂး ဒဲၦလုဆၧစအၫရၧၫ့အဖိၪလၧၦလံဝဲၫဖိၪ အကျၩနီၪဖၭဆၧတၭ, န့ဒိၩ့လဆံၫၥၧၫ့ဒိၩ့လၧစယုဒၫ လဒီၪ့အကျၩ, ဒဲလၧစစံမအၧၫ့လဒီၪ့အကျၩ, ဒဲလၧစ ဘံၪ့ယမံၫ့လဒီၪ့အကျၩနီၪလီၫ.",
			"5": "<sup>5</sup> တၭၦကိဟၭဖိၪ လၧအအီၪလၩ့ထးလဖၪနီၪဖၭဆၧ တၭ,န့ဘၪဆံၫဒိၩ့လၧ စအံဖြံၫ့လဒီၪ့အဂံၪ့ဒီၪ့လဖၪအ ကျၩ,ဒဲလၧစဒၫ့လဒီၪ့အကျၩ, ဒဲလၧစမနၭစ့ၫလခီၫဒီၪ့ အကျၩလီၫ.",
			"6": "<sup>6</sup> ၦဂၧၡၧၫ့ဖိၪနီၪ ဖၭဆၧတၭ, န့ဘၪဒိၩ့လဆံၫၥၧၫ့ ဒိၩ့,လၧစအံစခၫ လဒီၪ့အဂံၪ့ဒီၪ့လဖၪအကျၩ, ဒဲလၧ စအၭၡၧၫလဒီၪ့အကျၩ, လၧစနၭၥလဲၫလဒီၪ့အကျၩ ဒဲလၧစမနၭစ့ၫလခီၫဒီၪ့အကျၩ လၧဘၫၡၫ့အဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> တၭၦမရၫရဲၫဖိၪ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪန့ဘၪ ဒိၩ့လဆံၫနံၫဒိၩ့, လၧစရုဘံၫ့လဒီၪ့အကျၩ, ဒဲလၧစဂၭ လဒီၪ့အကျၩ, ဒဲလၧစဇ့ၭဘလၧၫ့လဒီၪ့အကျၩလီၫ.",
			"8": "<sup>8</sup> တၭၦအံၫစရ့လၭဖိၪဖၭဆၧတၭ, ဖ့ၪလၫ့ၦလံဝဲၫဖိၪ လၧဒိၩ့လဖၪနီၪ, ဒဲအဆၧအၪ့အဆၪအလးလဖၪ,ဘဲၫ ယဟိဝၩမၪလူၬ ဆၧလၧစမိစ့ၭ အစူၪဖၧၩ့ အၥိၭနီၪ လီၫ.",
			"9": "<sup>9</sup> တၭလၧၦယုဒၫဖိၪလဒီၪ့အကျၩ, ဒဲၦစံမအၧၫ့ဖိၪ လဒီၪ့အကျၩနီၪ, အဝ့ၫၥံၪဖ့ၪလၫ့ဝ့ၫလၧ ဒိၩ့လဖၪယီၩ",
			"10": "<sup>10</sup> လၧၦကိၭအမံၩ့ဘဲၫယီၩ,- လၧစအၫရၧၫ့အဖိၪ, လၧၦ ကိဟၭဖိၪအဂံၪ့ဒီၪ့လဖၪအကျၩ, လၧၦလံဝဲၫဖိၪအ",
			"11": "<sup>11</sup> ကျၩနီၪန့ဘၪဆၧဖၭန့ လၧအခၪ့ထံၭလမံၩ့,- တၭအ ဝ့ၫၥံၪဖ့ၪလၫ့ဝ့ၫလၧ စအၫဘၫအဒိၩ့, စအၫနၭအဖါ, အဝ့ၫနီၪမွဲဟံဘြၧၫ့ အီၪဝ့ၫလၧယုဒၫ အခိၪလီၩ့ထိၩ့ ချိၬ,အီၪလၧအဆၧအၪ့အဆၪအလး ဝၬဖီၩ့ဝ့ၫလီၫ.",
			"12": "<sup>12</sup> အ့ၪမွဲဂၪ့ခိၪအဝၩ့လဖၪ ဘၪဆဲၫ့လၧဒိၩ့နီၪ, ဒဲအတဝၫ့ လဖၪ,ဖ့ၪလၫ့ဝ့ၫလၧ စယဖၧၫနံၫအဖိၪခွၫစကၫလ့ၭလၧ",
			"13": "<sup>13</sup> အဆၧန့ၥၫအဂးလီၫ.- တၭအဝ့ၫၥံၪ ဖ့ၪလၫ့ဝ့ၫလၧၦ လုဆၧစအၫရၧၫ့အဖိၪ လၧဟံဘြၧၫ့အီၪလၧအဆၧအၪ့ အဆၪအလး, ဒိၩ့ဖလ့ၬလၧၦမၩၥံၫဆၧအဂး, ဒဲလံၭ",
			"14": "<sup>14</sup> ဘနၫအီၪလၧအဆၧအၪ့အဆၪအလး,- ဒဲယၭတၧၫ, ဒဲအဆၧအၪ့အဆၪအလး, ဒဲအ့ၡတ့ၫမိအၫ, ဒဲအဆၧ",
			"15": "<sup>15</sup> အၪ့အဆၪအလး,- ဒဲဟိလၧၫ့ ဒဲအဆၧအၪ့အဆၪအ",
			"16": "<sup>16</sup> လး,ဒဲဒံဘၧၫ ဒဲအဆၧအၪ့အဆၪအလး,- ဒဲအၫအံၫ့ ဒဲအဆၧအၪ့အဆၪအလး, ဒဲယၧၭတၫဒဲအဆၧအၪ့အ ဆၪအလး, ဒဲဘ့ၭၥၡံမ့ၭ ဒဲအဆၧအၪ့အဆၪအလး,",
			"17": "<sup>17</sup> ဒိၩ့ခွံၫဒိၩ့လၧၦနံၫဒီၪ့နီၪအကျၩလီၫ.- တၭလၧစဘံၪ့ ယမံၫ့လဒီၪ့အကျၩနီၪ, ဂံဘအၧၫ့ဒဲအဆၧအၪ့အဆၪ",
			"18": "<sup>18</sup> အလး, ဒဲဂ့ဘၫဒဲအဆၧအၪ့အဆၪအလး,- အၫ့နၥီၭ ဒဲအဆၧအၪ့အဆၪအလး, အၫလမၧၫ့ဒဲအဆၧအၪ့အ",
			"19": "<sup>19</sup> ဆၪအလး, ဒိၩ့လံဒိၩ့လီၫ.- ၦလုဆၧစအၫရၧၫ့အဖိၪ ၥံၪအဒိၩ့ထီးအလူၬနီၪ မွဲဒိၩ့လဆံၫၥၧၫ့ဒိၩ့အီၪလၧအ ဆၧအၪ့အဆၪအလးလဖၪလီၫ.",
			"20": "<sup>20</sup> တၭၦကိဟၭဖိၪၥံၪအဂံၪ့ဒီၪ့လဖၪ, ၦလံဝဲၫဖိၪလၧ အအီၪလၩ့ထး လၧၦကိဟၭဖိၪအကျၩနီၪ, အဝ့ၫၥံၪန့ ဘၪအဆၧဖၭ အဒိၩ့လဖၪလၧစအံဖြံၫ့လဒီၪ့အကျၩ",
			"21": "<sup>21</sup> လီၫ.- တၭအဝ့ၫၥံၪဖ့ၪလၫ့ဝ့ၫလၧ ၡံခံၫ့ဒဲအဆၧအၪ့အ ဆၪအလး လၧခိၪလီၩ့အံဖြံၫ့အလီၩ့, ဒိၩ့ဖလ့ၬလၧၦ မၩၥံၫဆၧအဂး, ဒဲဂ့ဇၧၫဒဲအဆၧအၪ့အဆၪအလး,",
			"22": "<sup>22</sup> ကံၭဘဇ့ၭအံၫ့ဒဲအဆၧအၪ့အဆၪအလး, ဒဲဘ့ၭၥဟိ",
			"23": "<sup>23</sup> ရၧၫ့ဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့လံဒိၩ့လီၫ.- တၭ လၧစဒၫ့လဒီၪ့အကျၩနီၪ အ့ၫလတံက့ၫဒဲအဆၧအၪ့အ",
			"24": "<sup>24</sup> ဆၪအလး, ဂံဘၥၧၫ့ဒဲအဆၧအၪ့အဆၪအလး,- အၭ ဇလၧၫ့ဒဲအဆၧအၪ့အဆၪအလး, ဂၭၥရံမၧၫ့ဒဲအဆၧ",
			"25": "<sup>25</sup> အၪ့အဆၪအလး, ဒိၩ့လံဒိၩ့လီၫ.- တၭလၧစမနၭစ့ၫ အလခီၫဒီၪ့အကျၩနီၪ တၫနၭ ဒဲအဆၧအၪ့အဆၪအ လး,ဒဲဂၭၥရံမၧၫ့ ဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့နံၫဒိၩ့",
			"26": "<sup>26</sup> လီၫ.- ဒိၩ့ထီးအလူၬအီၪလၧ အဆၧအၪ့အဆၪအလး လဖၪလၧၦကိဟၭဖိၪအဂံၪ့ဒီၪ့လဖၪ လၧအအီၪလၩ့ ထးအဂးနီၪဆံၫဒိၩ့လီၫ.",
			"27": "<sup>27</sup> တၭၦဂၧၡၧၫ့ဖိၪၥံၪအဂံၪ့ဒီၪ့လဖၪ လၧၦလံဝဲၫဖိၪအ ကျၩနီၪ, န့ဘၪကိလၫ့ ဒဲအဆၧအၪ့အဆၪအလးလၧ ဘၫၡၫ့အဖၧၩ့, ဒိၩ့ဖလ့ၬလၧၦမၩၥံၫဆၧအဂး ဒဲဘံၫ ၡတ့ရၫဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့နံၫဒိၩ့လၧစမနၭ",
			"28": "<sup>28</sup> စ့ၫအလခီၫဒီၪ့အကျၩလီၫ.- တၭလၧအံစခၫလဒီၪ့အ ကျၩနီၪကံၡၧၫ့ ဒဲအဆၧအၪ့အဆၪအလး, ဒဲဒၫဘရံၫ",
			"29": "<sup>29</sup> ဒဲအဆၧအၪ့အဆၪအလး,- ယၫမုၫၥၫဒဲအဆၧအၪ့အ ဆၪအလး, အံၪ့ဂၫ့နံၫ့ဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့",
			"30": "<sup>30</sup> လံဒိၩ့လီၫ.- တၭလၧအၭၡၧၫလဒီၪ့အကျၩနီၪမဲၡလၭ ဒဲအဆၧအၪ့အဆၪအလး, ဒဲအၭဘဒၫ့ဒဲအဆၧအၪ့အ",
			"31": "<sup>31</sup> ဆၪအလး,- ဟ့လကၭဒဲအဆၧအၪ့အဆၪအလး,ဒဲရ့",
			"32": "<sup>32</sup> ဟီၭဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့လံဒိၩ့လီၫ.- တၭ လၧနၭၥလဲၫလဒီၪ့အကျၩနီၪ ကၫဒ့ၭလၧဂၫလလံၫအ ဖၧၩ့ဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့ဖလ့ၬလၧၦမၩၥံၫ ဆၧအဂး, ဒဲဟၫမီၭဒီၫဒဲအဆၧအၪ့အဆၪအလး, ဒဲ ကၫတၫ့ဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့ၥၧၫ့ဒိၩ့လီၫ.",
			"33": "<sup>33</sup> ၦဂၧၡၧၫ့ဖိၪအဒိၩ့ထီးအလူၬ ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭ နီၪမွဲဒိၩ့လဆံၫၥၧၫ့ဒိၩ့ အီၪလၧအဆၧအၪ့အဆၪအ လးလဖၪလီၫ.",
			"34": "<sup>34</sup> တၭၦမရၫရဲၫဖိၪၥံၪအဂံၪ့ဒီၪ့လဖၪ, ၦလံဝဲၫဖိၪလၧ အအီၪလၩ့ထးလၧစဇ့ၭဘလၧၫ့အဒီၪ့အကျၩလဖၪနီၪ န့ဘၪယီၭနံၫအၫ့ဒဲအဆၧအၪ့အဆၪအလး, ဒဲကၫတၫ",
			"35": "<sup>35</sup> ဒဲအဆၧအၪ့အဆၪအလး,- ဒံၫမနၫဒဲအဆၧအၪ့အဆၪ အလး,နဟၫလအ့လၭဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့",
			"36": "<sup>36</sup> လံဒိၩ့လီၫ.- တၭလၧစရုဘံၫ့လဒီၪ့အကျၩနီၪ, ဘံဇၧၫ ဒဲအဆၧအၪ့အဆၪအလး, ဒဲယဟၫဇၫ, ဒဲအဆၧအၪ့",
			"37": "<sup>37</sup> အဆၪအလး,- က့ဒမီၭဒဲအဆၧအၪ့အဆၪအလး,ဒဲမံၫ",
			"38": "<sup>38</sup> ဖၫအၭဒဲအဆၧအၪ့အဆၪအလး, ဒိၩ့လံဒိၩ့လီၫ.-တၭ လၧစဂၭလဒီၪ့အကျၩနီၪ ရၫမီၭဒဲအဆၧအၪ့အဆၪအ လး,လၧဂံလအၭအဖၧၩ့, ဒိၩ့ဖလ့ၬလၧၦမၩၥံၫဆၧအ",
			"39": "<sup>39</sup> ဂး,ဒဲမၫဟန့အံၫ့ဒဲအဆၧအၪ့အဆၪအလး,- ဟ့ၭၡ ဘၫ့ဒဲအဆၧအၪ့အဆၪအလး, ဒဲယၫဇၧၫဒဲအဆၧအၪ့",
			"40": "<sup>40</sup> အဆၪအလး, ဒိၩ့ထီးအလူၬမွဲဒိၩ့လံဒိၩ့လီၫ.- တၭၦ မရၫရဲၫဖိၪၥံၪဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭ, လၧအအီၪလၩ့ ထးလၧၦလံဝဲၫဖိၪအဂံၪ့ဒီၪ့လဖၪအကျၩနီၪ အဆၧဖၭ န့အဒိၩ့ထီးအလူၬ မွဲဒိၩ့လဆံၫနံၫဒိၩ့လီၫ.",
			"41": "<sup>41</sup> တၭၦလံဝဲၫဖိၪအဒိၩ့ထီးအလူၬ လၧအအီၪဝ့ၫလၧ ၦအံၫစရ့လၭဖိၪအဆၧန့ၥၫအကျၩနီၪ မွဲဒိၩ့လံဆံၫဎိၭ",
			"42": "<sup>42</sup> ဒိၩ့အီၪလၧအဆၧအၪ့အဆၪအလးလဖၪလီၫ.- ဒိၩ့ လဖၪနီၪမွဲလဒိၩ့လၧအဆၧအၪ့အဆၪအလးဝၬဖီၩ့ဝ့ၫ, လဒိၩ့အီၪလၧအဆၧအၪ့အဆၪအလး ဝၬဖီၩ့ဝ့ၫဆုၬ ဆုၬလီၫ. ဒိၩ့ထီးအလူၬနီၪအီၪဘဲၫနီၪလီၫ.",
			"43": "<sup>43</sup> တၭယဟိဝၩဖ့ၪလၫ့အံၫစရ့လၭ လၧထံၫၥံၪခးၥံၪ ထၧၫ့ဘံၪ့ယၫဘဲၫအဆိၪလၩ့အၥၭ လၧအဖါလဖၪအ ၥိၭလၧအမိဖ့ၪလၫ့ဝ့ၫတၭ, အဝ့ၫၥံၪမၩန့ဝ့ၫတၭ, အီၪ",
			"44": "<sup>44</sup> ဝ့ၫလၧအဖၧၩ့လီၫ.- တၭယဟိဝၩဖ့ၪလၫ့ဝ့ၫလၧဆၧ အီၪပွံၭဝၬဖီၩ့ဝ့ၫ, ဘဲၫကယဲဆၧလၧအဆိၪလၩ့အၥၭ လၧအဖါလဖၪအၥိၭနီၪတၭ, ၦလၧအဒုၪအဒၩအကျၩ နီၪဆၧၫ့ထုၪ့ဘၪလၧအမ့ၬယၫနီၪနးဂၩအ့ၬ. ယဟိဝၩ ဖ့ၪလၫ့ခွံၬအဒုၪအဒၩထီးအလူၬ လၧအစူၪဖၧၩ့လီၫ.",
			"45": "<sup>45</sup> လၧကယဲဆၧချဲၩ့အဂ့ၩအကျၩ လၧယဟိဝၩလီၩဘၪ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪနီၪ လၩ့မါနးထံၪအ့ၬ, လၧၫ့ ထၪ့ဎွ့ၩထၪ့ဝ့ၫထီးအလူၬလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စယီရှုၫအ့ၫကိၭန့ၦရုဘံၫ့ဖိၪ ဒဲၦဂၭ",
			"2": "<sup>2</sup> ဖိၪ,ဒဲၦမနၭစ့ၫဖိၪအလခီၫဒီၪ့,- တၭစံၭအဝ့ၫၥံၪ,နၥံၪ ထီးန့ယူၭကယဲဆၧလၧယဟိဝၩ အခ့ၫအၡၩစမိစ့ၭမၪ လူၬနၥံၪတၭ, နၥံၪခိၭနၪယူၭယလူ လၧကယဲဆၧလၧ",
			"3": "<sup>3</sup> ယမၪလူၬနၥံၪယူၭ.- အၪနံၩအၪၥၫ့ ထီးမုဆၫလနံၩ ယီၩ,နၥံၪလ့ၩဒၪနၥံၪအထၧၫ့ဖုဝဲအ့ၬ. နၥံၪထီးန့ယူၭ ဆၧအလူဘၪဆဲၫ့ လၧယဟိဝၩ နၥံၪအယွၩအဆၧမၪ",
			"4": "<sup>4</sup> လူၬလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ယဟိဝၩနၥံၪအယွၩဖ့ၪ လၫ့ယူၭဆၧအီၪပွံၭ လၧနၥံၪအထၧၫ့ဖုဝဲယူၭ, ဘဲၫအ ချဲၩ့ဝဲၩဆၧလၧ အဝ့ၫၥံၪအၥိၭနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ ထဲၩ့ထဲၩ့နၥံၪဝ့ၫလၧနၥံၪအတဲၩဖၧၩ့, လၧနၥံၪန့ၥၫဝ့ၫ နီၪလၧယဟိဝၩအခ့ၫအၡၩ စမိစ့ၭဖ့ၪလၫ့နၥံၪလၧယီၫ",
			"5": "<sup>5</sup> ဒၫ့ဝါလခီၫနီၪဆံၭ.- တၭထီးလၩ့နၥံၪအၥၭတၡါဘဲၫ ၥိၭနၥံၪမိထီးန့ဆၧမၪလူၬ, ဒဲဆၧၥီၪ့ဆၧၥၫ့လၧယဟိ ဝၩအခ့ၫအၡၩစမိစ့ၭ မၪလူၬနၥံၪလၧနၥံၪမိဘၪအဲၪ ယဟိဝၩနၥံၪအယွၩ ဒဲဖိၬအဖၧၩ့ၥၭထီးအလူၬ,ဒဲထီး န့အဆၧမၪလူၬ, ဒဲဖီၪ့ထၬအဝ့ၫဒၪဒဲမၩအဆၧလၧနၥံၪ အၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲနၥံၪအၥၭၡီၩ့ထီးအလူၬနီၪဆံၭ.",
			"6": "<sup>6</sup> စယီရှုၫအ့ၫဆိၪဂ့ၩဆိၪဘွၩအဝ့ၫၥံၪနီၪ, ကွဲၪဖျါခွံၬ ဝ့ၫတၭ,အဝ့ၫၥံၪထဲၩ့ထဲၩ့ လၧအတဲၩလဖၪ အဖၧၩ့",
			"7": "<sup>7</sup> လီၫ.- တၭစမိစ့ၭဖ့ၪလၫ့ယူၭဆၧလၧ စမနၭစ့ၫအလခီၫ ဒီၪ့လၧဘၫၡၫ့အဖၧၩ့, ဒဲစယီရှုၫအ့ၫဖ့ၪလၫ့ဆၧလၧအ လခီၫဒၪလၧအထၧၫ့ဖုဝဲအကျၩ လၧယီၫဒၫ့အမုနုၬလၧ ယီၩလခီၫလီၫ. ထီးစယီရှုၫအ့ၫကွဲၪဖျါခွံၬအဝ့ၫၥံၪဆ့ ဘဲၫၥိၭအမိလ့ၩလၧအတဲၩဖၧၩ့တၭ, မွဲအဆိၪဂ့ၩဆိၪ",
			"8": "<sup>8</sup> ဘွၩဝ့ၫလီၫ.- တၭချဲၩ့ဆၧလၧအဝ့ၫၥံၪတၭ, စံၭဝ့ၫဒၪ, ထဲၩ့ထဲၩ့လၧနၥံၪအတဲၩဖၧၩ့ အီၪလၧဆၧစူၪလးခၪ့ ခိၪလၧအအၪ, ဒဲဆၧဖိၪဆၧဎါအဒိၩ့ အၪအၪလ့ၬ, ဒဲ ကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫၥံၪ, ဒဲထီးၥံၪၡၬၥံၪ, ဒဲထၭ, ဒဲဆၧအကီၩ့အၥိၭအၪအၪလ့ၬနီၪဆံၭ, ဆၧအၪ့ဂူၬန့ လၧနၥံၪအဒုၪအဒၩနီၪ အၪ့နၩ့ဖၭလၧနၥံၪအထၧၫ့ဖုဝဲ လဖၪနီၪဆံၭ.",
			"9": "<sup>9</sup> တၭၦရုဘံၫ့ဖိၪ,ဒဲၦဂၭဖိၪ, ဒဲၦမနၭစ့ၫအလခီၫဒီၪ့နီၪ ထဲၩ့ထဲၩ့ဝ့ၫတၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫလၧၦအံၫစရ့လၭဖိၪအ အီၪလၧၡဲလိၫအဖၧၩ့ လၧအအီၪလၧခးကၫနအၫ့အ ဖၧၩ့,ဘဲၫၥိၭအမိလ့ၩထၪ့လၧခးဂံလအၭ အဆၧန့ၥၫ အဂၪ့ခိၪလၧအန့ဘၪဝ့ၫ ဘဲၫယဟိဝၩအဆၧမၪလူၬ လၧစမိစ့ၭအစူၪဖၧၩ့အၥိၭနီၪလီၫ.",
			"10": "<sup>10</sup> ထီးအဂဲၫထီၩ့လၧယီၫဒၫ့အနဲၩ့ လၧခးကၫနအၫ့အ ဖၧၩ့နီၪတၭ, ၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪ ဒဲၦမနၭစ့ၫဖိၪအလ ခီၫဒီၪ့နီၪမၩထၪ့ဆၧလုလးလၧ ယီၫဒၫ့အနဲၩ့ထံၭ,ဆၧ လုလးဖျီၪဖၭဒိၪလဖျိၪ့လီၫ.",
			"11": "<sup>11</sup> တၭၦအံၫစရ့လၭဖိၪနါဂၧၫ့ၦစံၭဝ့ၫ, ယိခွါ,ၦရုဘံၫ့ ဖိၪ,ဒဲၦဂၭဖိၪ, ဒဲၦမနၭစ့ၫဖိၪအလခီၫဒီၪ့ မၩထၪ့ဆၧ လုလးဆဲၫဎၩ့ လၧခးကၫနအၫ့ လၧယီၫဒၫ့ အနဲၩ့ထံၭ",
			"12": "<sup>12</sup> ထီးၦအံၫစရ့လၭဖိၪခၫ့ဂၬဆၧအလးနီၪလီၫ.- တၭထီး ၦအံၫစရ့လၭဖိၪနါဂၧၫ့ဝ့ၫတၭ, ၦအံၫစရ့လၭဖိၪအဆၧ အီၪကီၪ့ထီးအလူၬနီၪ အီၪကီၪ့လၧၡဲလိၫအဖၧၩ့ဘဲၫ",
			"13": "<sup>13</sup> ၥိၭအမိလ့ၩဒုၭၥုၭထၫ့ဒၩအဝ့ၫၥံၪလီၫ.- တၭၦအံၫစရ့ လၭဖိၪအၪ့မၧၫ့လၩ့ၦလုဆၧ စအံၫလအ့ဇၧၫအဖိၪခွၫ စဖံနအၭလဂၩ, လၧၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪ,ဒဲၦမနၭစ့ၫ ဖိၪအလခီၫဒီၪ့ လၧအအီၪလၧခးဂံလအၭအဖၧၩ့,",
			"14": "<sup>14</sup> တၭလၧအဝ့ၫဒၪအၥိၭနီၪၦဒိၪဆံၫဂၩ, လဂံၪ့အခိၪလ ဂၩ,လဂံၪ့အခိၪလဂၩ, လၧအံၫစရ့လၭအဒီၪ့ထီးအ လူၬအကျၩတၭ, လဂၩမွဲအဖါအဂံၪ့ခိၪ, လဂၩအဖါ အဂံၪ့ခိၪ လၧအံၫစရ့လၭအထီၫ့လဖၪအကျၩနီၪ ဆုၬ ဆုၬလီၫ.",
			"15": "<sup>15</sup> တၭအဝ့ၫၥံၪဂဲၫဝ့ၫလၧၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪ,ဒဲၦမ နၭစ့ၫဖိၪအလခီၫဒီၪ့အအီၪ, လၧဂံလအၭတၭ, ချဲၩ့",
			"16": "<sup>16</sup> ဆၧလၧအဝ့ၫၥံၪတၭ,စံၭဝ့ၫဒၪ,- ယဟိဝၩအဆၧအီၪ ကီၪ့ထီးအလူၬစံၭဘဲၫယီၩ, ဆၧမၩလၧနၥံၪမၩမၪဘၪ အံၫစရ့လၭအယွၩယီၩ မွဲဘဲၫၥ့ၪလဲၪး လၧနၥံၪကၠၪခွံၬ နၥံၪအၥၭလၧဆၧဖိၬ ယဟိဝၩအခဲၫ့ လၧမုဆၫလနံၩ ယီၩ,လၧနၥံၪမၩထၪ့ဆၧလုလးဘဲၫၥိၭနၥံၪမိပိၩ့ထၪ့",
			"17": "<sup>17</sup> ယဟိဝၩ လၧမုဆၫလနံၩယီၩမၬလဲၪ.- ပံအီၫအဆၧ အၧၩ့လၧပလဆံၫ့ထၪ့ဒံၭဘၪ ခီးမုဆၫလနံၩယီၩ,မွဲ ဆံၭခိၬဖိၪလၧပဂးဆ့ဧၪ. ဆၧၥံၫဖျဲၪအီၪထၪ့လၧယဟိ",
			"18": "<sup>18</sup> ဝၩအဆၧအီၪကီၪ့လါနၫ့တၭ,- နၥံၪမိကၠၪခွံၬ နၥံၪအ ၥၭလၧဆၧဖိၬ ယဟိဝၩအခဲၫ့ လၧမုဆၫလနံၩယီၩဆ့ ဧၪ.တၭဆၧမိမၩအၥၭ လၧနၥံၪမိပိၩ့ထၪ့ ယဟိဝၩ လၧမုဆၫလနံၩယီၩတၭ, ကဲဂီၩလနံၩနီၪ အဝ့ၫဒၪ မိၥၭထၪ့ဘၪအံၫစရ့လၭ အဆၧအီၪကီၪ့ထီးအလူၬ",
			"19": "<sup>19</sup> လီၫ.- မွဲလါနၫ့နၥံၪအဆၧဖီၪ့ထၬ အခးအ့ၪလဆံၫ့ဘၪ တၭ,ခၫ့ဂၬလၧယဟိဝၩအဆၧန့ၥၫအခးဖၧၩ့, ထီးယ ဟိဝၩအတဲၩဆံၫ့ဎံၪနီၪအီၪဝ့ၫတၭ, မၩန့ဆၧလၧပ ကျၩဆံၭ. အ့ၪမွဲနၥံၪမၩဆၧလုလးလၧယဟိဝၩပယွၩ အဆၧလုလးအဖၫ့ခိၪတၭ, မွဲနၥံၪထီး ပိၩ့ထၪ့ဘၪယ",
			"20": "<sup>20</sup> ဟိဝၩလဂ့ၩ, ဒဲမွဲနၥံၪထီးပိၩ့ထၪ့ပၧၩလဂ့ၩ,- စဇံရၫ အဖိၪခွၫစအၫခၫ့မၩမၪဆၧလၧဆၧဆိၪအၧၩ့, ဒဲဆၧ ၥၭထၪ့လၩ့ဘၪ လၧအံၫစရ့လၭ အဆၧအီၪကီၪ့ထီး အလူၬအဖၫ့ခိၪနီၪမွဲအ့ၬဧၪ. တၭၦလဂၩနီၪဂၭဂီၩ့လ ဂၩဎးလၧအဆၧအၧၩ့အဖၧၩ့အ့ၬ.",
			"21": "<sup>21</sup> ထီးနီၪလဖၧၫ့ၦရုဘံၫ့ဖိၪ,ဒဲၦဂၭဖိၪ, ဒဲၦမနၭစ့ၫဖိၪ အလခီၫဒီၪ့ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအံၫစရ့လၭအထီၫ့ၥံၪ",
			"22": "<sup>22</sup> အခိၪလဖၪ.- ယဟိဝၩ,ယွၩလဖၪအယွၩး ယဟိဝၩ ယွၩလဖၪအယွၩ, အဝ့ၫဒၪနီၪၥ့ၪယၫဝ့ၫ, ဒဲအံၫစရ့လၭ မိၥ့ၪယၫဆ့လီၫ. အ့ၪမွဲဆၧပိၩ့ထၪ့,ဒဲဆၧမၩမၪဘၪယ ဟိဝၩတၭ,ထီးမၩဖီၩ့မၩဖျ့ၭပၧၩ လၧမုဆၫလနံၩယီၩ",
			"23": "<sup>23</sup> လဂ့ၩ.- ပအ့ၪမၩထၪ့ဆၧလုလးယီၩ, ဘဲၫၥိၭပမိကၠၪ ခွံၬပၥၭလၧဆၧဖိၬယဟိဝၩအခဲၫ့မွဲဂ့ၩ, ဘဲၫၥိၭမိလုထၪ့ ဆၧလုမ့ၪမွဲဂ့ၩ, ဆၧမၩဘိၪ့ကိၪမုၬမွဲဂ့ၩ, လၧအဖၫ့ခိၪ, အ့ၪမွဲဘဲၫပမိလုထၪ့ဆၧလုဘၪလိၬအိၭလိၬ လၧအဖၫ့ ခိၪမွဲဂ့ၩတၭ, မွဲယဟိဝၩအနၫ့ဆါဒၪဝ့ၫ အၪ့ဎၬဆၧ",
			"24": "<sup>24</sup> ဆံၭ.- တၭမွဲပမၩလၧပအၪ့ယိၪဆၧယီၩအကၠီၩ့, ကဲခိၬ နီၪနၥံၪအဖိၪအလံၩမိချဲၩ့ဆၧ လၧပဖိၪပလံၩတၭ,မိစံၭ, နၥံၪမၩဆၧလၧယဟိဝၩ အံၫစရ့လၭအယွၩ ဘဲၫၥ့ၪ",
			"25": "<sup>25</sup> လဲၪး- တၭယဟိဝၩအီၪက့ၪယီၫဒၫ့လၧဆၧအနဲၩ့အ ဎီၩ့လၧနၥံၪဒဲပၧၩအဘိၩ့ဆၧၩ့, ၦရုဘံၫ့ဖိၪ,ဒဲၦဂၭဖိၪ ၥံၪဧ့, နၥံၪအဂးအီၪလၧယဟိဝၩအဖၧၩ့ နးစီၪ့အ့ၬ.ဘဲၫ နီၪၥိၭတၭနၥံၪအဖိၪအလံၩမိဒုၭ မၩဂၭဂီၩ့ပဖိၪပလံၩ",
			"26": "<sup>26</sup> လၧအဆၧၥၭမဲၪယဟိဝၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ ပစံၭ, မွဲပတဲၩ့ဝဲၩပၥၭမၩဆၧလုလးဆံၭ. ဘဲၫၥိၭပမိ မၩထၪ့ဆၧလုလး လၧဆၧလုမ့ၪအဂးမွဲအ့ၬ,လၧၦလု",
			"27": "<sup>27</sup> ထၪ့ဆၧအဂးမွဲအ့ၬ.- မွဲဘဲၫၥိၭအမိကဲၪထၪ့ ဆၧထိး အၥၭလၧပဘိၩ့ဆၧၩ့, ဒဲနၥံၪအဘိၩ့ဆၧၩ့,ဒဲလၧပဆၨၩ ပဆၬၥံၪလၧပလးခဲၫ့အဂး, ဘဲၫၥိၭပမိမၩယဟိဝၩအ ဆၧလၧအမ့ၬယၫဒဲပဆၧလုမ့ၪ, ဒဲပဆၧလုထၪ့လဖၪ, ဒဲပဆၧလုဘၪလိၬအိၭလိၬ, ဘဲၫၥိၭကဲခိၬနီၪ, နၥံၪအဖိၪ အလံၩထီးစံၭပဖိၪပလံၩ, နၥံၪအဂးလအီၪဘၪလၧယ",
			"28": "<sup>28</sup> ဟိဝၩအဖၧၩ့နီၪ, လဂ့ၩ.- မၩအၥၭဘဲၫနီၪတၭ ပစံၭ, ကဲခိၬနီၪထီးအစံၭဆၧလၧပၧၩမွဲဂ့ၩ, လၧပဆၨၩပဆၬ မွဲဂ့ၩတၭ, ဆၧမၩအၥၭလၧပမိစံၭပဝ့ၫ,ယိခွါ,ယဟိဝၩ အဆၧလုလးအဂၩ့လၧပဖါလဖၪ မၩဝ့ၫလၧဆၧလု မ့ၪအဂးမွဲအ့ၬ. ဒဲလၧလုထၪ့ဆၧအဂးမွဲအ့ၬး အ့ၪမွဲဆၧ",
			"29": "<sup>29</sup> ထိးအၥၭလၧနၥံၪဒဲပၧၩအဘိၩ့ဆၧၩ့လီၫ.- လၧယဟိ ဝၩပယွၩအဆၧလုလး လၧအအီၪဝ့ၫလၧတဲၩဆံၫ့ဎံၪ အမ့ၬယၫနီၪ, ဆၧလုလးလၧဆၧလုမ့ၪအဂးမွဲဂ့ၩ,လၧ ဆၧမၩဘိၪ့ကိၪမုၬအဂးမွဲဂ့ၩ, လၧလုထၪ့ဆၧအဂးမွဲ ဂ့ၩ,မွဲပထီးမၩထၪ့ဝ့ၫဒဲပိၩ့ထၪ့ဘၪယဟိဝၩ, ဒဲကၠၪခွံၬ ပၥၭလၧဆၧဖိၬယွၩအခဲၫ့လၧမုဆၫလနံၩယီၩလဂ့ၩ.",
			"30": "<sup>30</sup> တၭၦလုဆၧစဖံနအၭ, ဒဲဆၧအီၪကီၪ့အၦဒိၪ,ဒဲ အံၫစရ့လၭအထီၫ့ၥံၪအခိၪလဖၪ လၧအအီၪဝ့ၫလၧအ ဝ့ၫဒၪအၥိၭနီၪ နါဂၧၫ့ဆၧချဲၩ့လၧၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪ, ဒဲၦမနၭစ့ၫဖိၪချဲၩ့ဝ့ၫနီၪ, ဂ့ၩဝ့ၫလၧအဝ့ၫၥံၪအမ့ၬယၫ",
			"31": "<sup>31</sup> လီၫ.- တၭၦလုဆၧစအံၫလအ့ဇၧၫအဖိၪခွၫစဖံနအၭ နီၪစံၭၦရုဘံၫ့ဖိၪ,ဒဲၦဂၭဖိၪ, ဒဲၦမနၭစ့ၫဖိၪ, ဆၧလၧမု ဆၫလနံၩယီၩပၥ့ၪယၫလၧယဟိဝၩ အီၪဝ့ၫလၧပကျၩ လီၫ. အဂဲးဘဲၫယီၩ နၥံၪမၩမၪယဟိဝၩလၧဆၧမၩ ယီၩအ့ၬး မွဲနၥံၪမၩဖီၩ့မၩဖျ့ၭယူၭ ၦအံၫစရ့လၭဖိၪ လၧယဟိဝၩအစူၪဖၧၩ့ယူၭ.",
			"32": "<sup>32</sup> တၭၦလုဆၧစအံၫလအ့ဇၧၫ အဖိၪခွၫစဖံနအၭဒဲ ၦဒိၪၥံၪနီၪစဲၪ့ထၪ့ခွံၬ လၧၦရုဘံၫ့ဖိၪ, ဒဲလၧၦဂၭဖိၪအ အီၪလၧဂံလအၭအဖၧၩ့, ထဲၩ့ဝ့ၫထီၩ့လၧခးကၫနအၫ့ အဖၧၩ့လၧၦအံၫစရ့လၭဖိၪအအီၪတၭ, ထဲၩ့ဆိၬဝ့ၫ",
			"33": "<sup>33</sup> လၧဆၧချဲၩ့နီၪလီၫ.- မွဲအဂ့ၩဝ့ၫလၧၦအံၫစရ့လၭဖိၪ အမ့ၬယၫတၭ, ၦအံၫစရ့လၭဖိၪစံၭထၪ့အၪ့အူၭယွၩ တၭ,စံၭလၧအမိလ့ၩဒုၭၥုၭဘဲၫၥိၭအမိမၩဂၭဂီၩ့ထံၫ ၥံၪခးၥံၪထီးၦရုဘံၫ့ဖိၪ ဒဲၦဂၭဖိၪအီၪဝ့ၫလၧအဖၧၩ့နီၪ အ့ၬ.",
			"34": "<sup>34</sup> တၭၦရုဘံၫ့ဖိၪ,ဒဲၦဂၭဖိၪ, ကိၭဆၧလုလးနီၪအမံၩ့ ဆၧထိးအၥၭလီၫ. အဂဲးဘဲၫယီၩ မွဲဆၧထိးအၥၭလၧ ပဘိၩ့ဆၧၩ့လၧယဟိဝၩမွဲယွၩလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> လၧယဟိဝၩဒုၭအီၪပွံၭအံၫစရ့လၭ လၧအဒုၪအ ဒၩအီၪဝၬဖီၩ့ဝ့ၫအလးခဲၫ့ ယံၬယံၬတၭ, ဆၧမၩအၥၭ လၧစယီရှုၫအ့ၫအၥၭၡါယူၭ, ဒဲလ့ၩနုၬယူၭလၧမုနံၩ",
			"2": "<sup>2</sup> လဖၪအကျၩလီၫ.- တၭစယီရှုၫအ့ၫကိၭန့ ၦအံၫစရ့ လၭထီးအလူၬ, အၡၩၥုၪ့က့ၭၥၭၡါ, ဒဲအခိၪလဖၪ, ဒဲအၡၩစ့ၩရၫ့ခွးလဖၪ, ဒဲအၦဒိၪလဖၪတၭ, စံၭအဝ့ၫ, ၥံၪ,ယၥၭၡါဖီၩ, ယလ့ၩနုၬ လၧမုနံၩလဖၪ အကျၩ",
			"3": "<sup>3</sup> ယူၭ.- တၭနၥံၪဒၪဘၪယူၭကယဲဆၧလၧ ယဟိဝၩနၥံၪ အယွၩမၩၦဆၨၩလဖၪယီၩ လၧနၥံၪအကၠီၩ့ယူၭ, အ ဂဲးဘဲၫယီၩယဟိဝၩနၥံၪအယွၩ မွဲၦလၧအဒုၭဆၧလၧ",
			"4": "<sup>4</sup> နၥံၪအဂးလီၫ.- ယိခွါ, လၧဖၭဆၧအကၠီၩ့တၭ ယအၪ့ နၩ့ဖၭယူၭၦဆၨၩလဖၪ လၧအအီၪလၩ့ထး လၧဆၧန့ ၥၫလၧနၥံၪအဒီၪ့လဖၪအဂး, လၧယီၫဒၫ့ဒဲကယဲၦဆၨၩ ထီးအလူၬလၧယဒၪ့ထ့ၬခွံၬဝ့ၫ ဖိးလၧမၫဆမံၭဖၭဒိၪ လၧမုနုၬလခီၫယူၭ.",
			"5": "<sup>5</sup> တၭယဟိဝၩနၥံၪအယွၩနီၪ မိဒုၭစဲၪ့ထၪ့ခွံၬအဝ့ၫ ၥံၪလၧနၥံၪအမ့ၬယၫ, ဒဲမိနၫ့ထၪ့ခွံၬဝ့ၫထီးနၥံၪလဒၪ ဘၪတၭ, နၥံၪမိန့ၥၫအခး, ဘဲၫယဟိဝၩနၥံၪအယွၩ",
			"6": "<sup>6</sup> ချဲၩ့ဝဲၩဆၧလၧနၥံၪအၥိၭနီၪလီၫ.- တၭအီၪက့ၪဆီၪ့န ၥံၪအၥၭတၡါဘဲၫၥိၭနၥံၪမိထီးန့ ဒဲမၩကယဲဆၧကွ့ၭ အၥၭလၧစမိစ့ၭအလံၬဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့, ဘဲၫၥိၭအ စူၪထွ့ၪမွဲဂ့ၩ,အစူၪစ့ၪမွဲဂ့ၩ, နၥံၪထီးကၠၪပဲၩဝ့ၫလဂ့ၩ,",
			"7": "<sup>7</sup> ဘဲၫၥိၭနၥံၪထီးလ့ၩလၧၦဆၨၩ လၧအအီၪလၩ့ထးလ ဖၪအကျၩ, ဒဲနၥံၪထီးကိၭထၪ့အယွၩလဖၪအမံၩ့,ဒဲန ၥံၪထီးဒုၭဆိၪလၩ့နၥံၪအၥၭလၧအမ့ၬယၫ, ဒဲနၥံၪထီး မၩအဆၧ, ဒဲနၥံၪထီးဘိၪ့ထၪ့ဘၩထၪ့အဝ့ၫၥံၪနီၪလဂ့ၩ",
			"8": "<sup>8</sup> လီၫ.- အ့ၪမွဲနၥံၪဘၪဖီၪ့ထၬယဟိဝၩနၥံၪအယွၩဘဲၫ",
			"9": "<sup>9</sup> နၥံၪမၩယူၭခီးမုဆၫလနံၩယီၩအၥိၭနီၪလီၫ.- တၭယ ဟိဝၩနၫ့ထၪ့ခွံၬၦဆၨၩလဖၪအဒိၪဝ့ၫ, ဒဲဆီၪ့ဝ့ၫလၧန ၥံၪအမ့ၬယၫလီၫ. အ့ၪမွဲနၥံၪဝ့ၫလဖၪယီၩခီးမုဆၫလ နံၩယီၩၦၡၩဆၧၫ့ထုၪ့ လၧနၥံၪအမ့ၬယၫၥ့ၪနီၪအီၪနး",
			"10": "<sup>10</sup> ဂၩအ့ၬ.- ၦလၧနၥံၪအကျၩလဂၩနီၪ မိဒုၭစဲၪ့ၦလထီၫ့ လီၫ. အဂဲးဘဲၫယီၩယဟိဝၩနၥံၪအယွၩ မွဲၦလၧအဒုၭ ဆၧလၧနၥံၪအဂး, ဘဲၫအချဲၩ့ဝဲၩလၧနၥံၪအဂးအၥိၭ နီၪလီၫ.",
			"11": "<sup>11</sup> ထီးလၩ့တၡါနၥံၪအၥၭဘဲၫၥိၭနၥံၪမိအဲၪယဟိဝၩ",
			"12": "<sup>12</sup> နၥံၪအယွၩဆံၭ.- အ့ၪမွဲနၥံၪအ့ၪထဲၩ့ထဲၩ့တၭ, ဖီၪ့ထၬ ၦဆၨၩလဖၪလၧအအီၪလၩ့ထး လၧနၥံၪအကျၩ,ဒဲဖျၫ့ လိၬနၥံၪအၥၭလၧအဝ့ၫၥံၪ, ဒဲလ့ၩနုၬလၧအဝ့ၫၥံၪအ",
			"13": "<sup>13</sup> အီၪ,အဝ့ၫၥံၪနီၪဂဲၫနုၬလၧ နၥံၪအအီၪတၭ,- ၥ့ၪယၫ တၡါလၧယဟိဝၩ, နၥံၪအယွၩ မိနၫ့ထၪ့ခွံၬလၧၩ့ၦ ဆၨၩလဖၪနီၪလၧနၥံၪအမ့ၬယၫအ့ၬး တၭအဝ့ၫၥံၪမိ ကဲၪထၪ့ဖျံၩခွၩ့, ဒဲချီၩ့ၥံၪလၧနၥံၪအဂး ဒဲနိၪဖျ့ၪလၧန ၥံၪအဂုၭပၪအလီၩ့, ဒဲဆၧဆူၪလဖၪလၧနၥံၪအမ့ၬၥၪ ဖၧၩ့ထီးနၥံၪထီၩ့လၧဆၧဂၭဂီၩ့ လၧခးဂ့ၩလဘံၪ့ယီၩ အဖၧၩ့လၧယဟိဝၩနၥံၪအယွၩ ဖ့ၪလၫ့ယူၭနၥံၪလီၫ.",
			"14": "<sup>14</sup> ယိခွါ, လၧမုဆၫလနံၩယီၩယမိဖိၬၦဂၪ့ခိၪဖိၪထီး အလူၬ,အဖၧၩ့ၥၭတၭ, နၥံၪၥ့ၪယၫလၧနၥံၪအၥၭထီး အလူၬ,ဒဲလၧနၥံၪအၥၭၡီၩ့ထီးအလူၬအဖၧၩ့, လၧက ယဲဆၧဂ့ၩအကျၩ လၧယဟိဝၩနၥံၪအယွၩ ချဲၩ့ဆၧ လၧနၥံၪအဂဲးအကၠီၪ့နီၪ ဆၧလၩ့မါဘၪဝ့ၫနးမံၩ့အ့ၬ. ကယဲဆၧထီးအလူၬနီၪ မၩအၥၭလၧနၥံၪအဂးတၭ, လၩ့မါဘၪလၧအကျၩနီၪနးမံၩ့အ့ၬ.",
			"15": "<sup>15</sup> မၩအၥၭဘဲၫနီၪတၭ ဘဲၫယဟိဝၩဒုၭကဲၪထၪ့လၧန ၥံၪအဂးလၧကယဲဆၧအဂ့ၩလဖၪ လၧယဟိဝၩနၥံၪ အယွၩချဲၩ့ဝဲၩလၧအမိဖ့ၪလၫ့နၥံၪနီၪ, ဘဲၫနီၪၥိၭဆ့, ဆၧမိမၩအၥၭလၧယဟိဝၩ မိဒုၭကဲၪထၪ့လၧနၥံၪအ ဂးလၧကယဲဆၧအၧၩ့လမံၩ့လါလါ, ထီးအမၩဂၭဂီၩ့ ခွံၬနၥံၪလၧခးလဘံၪ့ယီၩအဖၧၩ့ လၧယဟိဝၩနၥံၪအ",
			"16": "<sup>16</sup> ယွၩဖ့ၪလၫ့ယူၭနၥံၪယူၭလီၫ.- ထီးနၥံၪလၨၪခၫ့ဖၬ ယဟိဝၩနၥံၪအယွၩ အဆၧအုၩ့လၩ့ လၧအမၪလူၬန ၥံၪ,ဒဲလ့ၩမၩယွၩအဂူၫဂၩလဖၪအဆၧ ဒဲဘိၪ့ထၪ့ဘၩ ထၪ့အဝ့ၫၥံၪတၭ, ယဟိဝၩအၥၭထၪ့မိခဲၩထၪ့ထၫ့ဒၩ နၥံၪတၭ, နၥံၪမိဂၭဂီၩ့ခွံၬချဲၫ့ချံၭ လၧခးဂ့ၩလၧအဖ့ၪ လၫ့ယူၭနၥံၪလဘံၪ့ယီၩအဖၧၩ့လီၫ."
		},
		"24": {
			"1": "<sup>1</sup> စယီရှုၫအ့ၫဒုၭအီၪကိၩ့အီၪကီၪ့ ကယဲၦအံၫစရ့လၭ အဒီၪ့လဖၪလၧၡံခံၫ့တၭ, ကိၭန့ၦအံၫစရ့လၭအၡၩ ၥုၪ့က့ၭၥၭၡါ,ဒဲအခိၪဒဲအၡၩစ့ၩရၫ့ခွး ဒဲအၦဒိၪလဖၪ နီၪတၭ,အဝ့ၫၥံၪအီၪက့ၪလၩ့ အနၫ့ဆါဒၪဝ့ၫလၧယ ဟိဝၩအမ့ၬယၫလီၫ.",
			"2": "<sup>2</sup> တၭစယီရှုၫအ့ၫစံၭၦခမျၧးနီၪ, ယဟိဝၩအံၫစရ့ လၭအယွၩစံၭဘဲၫယီၩ, လၧဖျိၩ့လံၩလံၩနီၪ, နၥံၪအ ဖါလဖၪအီၪဝ့ၫလၧထံၫမိၡါဝါလခီၫ, စအၫဘြဟၫ့အ ဖါ,ဒဲစနၫဟီၫအဖါစတံရၫတၭ, အဝ့ၫၥံၪမၩဝ့ၫလၧယွၩ",
			"3": "<sup>3</sup> အဂူၫဂၩလဖၪအဆၧလီၫ.- တၭယမၩန့နၥံၪအဖါစ အၫဘြဟၫ့လၧထံၫမိၡါဝါလခီၫ, ဒဲဒုၭလ့ၩဝံၩ့ဝၩ့အ ဝ့ၫလၧခးကၫနအၫ့ ထၧၫ့ခးယၫအဖၧၩ့, ဒဲမၩအၪထၪ့",
			"4": "<sup>4</sup> အချံၫအၥၪ, ဒဲယဖ့ၪလၫ့ဝ့ၫလၧစအံစၭလီၫ.- တၭယ ဖ့ၪလၫ့စအံစၭနီၪလၧစယၫကူၭ, ဒဲစအံစီၫတၭ, ယဖ့ၪ လၫ့စအံစီၫနီၪလၧခိၪလီၩ့စံအၫ လၧဆၧန့ၥၫအဂးလီၫ. အ့ၪမွဲစယၫကူၭ, ဒဲအဖိၪအလံၩလ့ၩလၩ့လၧအံဇံၭ",
			"5": "<sup>5</sup> အဖၧၩ့လီၫ.- တၭယအၪ့မၧၫ့လၩ့စမိစ့ၭ ဒဲစအၫရၧၫ့, ဒဲယထးၦအံဇံၭဖိၪ, ဘဲၫဆၧလၧယမၩလၧအကျၩ အၥိၭနီၪတၭ, လၧခဲၫ့ထဲၩ့ယဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪလီၫ.",
			"6": "<sup>6</sup> တၭယဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪအဖါလဖၪ လၧအံဇံၭအဖၧၩ့ တၭ,နၥံၪဂဲၫလၧမၫဆမံၭနဲၩ့တၭ, ၦအံဇံၭဖိၪလီၩ့ဆီး နၥံၪအဖါလဖၪ အီၪလၧလဲၪ့ၥုၭ, ဒဲၦထူၬကၥ့ၪလဖၪ",
			"7": "<sup>7</sup> ထီၩ့လၧမၫဆမံၭဝီၩနီၪလီၫ.- ထီးအဝ့ၫၥံၪကိၭထၪ့ ယဟိဝၩတၭ, အဝ့ၫဒၪအီၪက့ၪဆၧခံၭလၧနၥံၪ ဒဲၦအံ ဇံၭဖိၪအဘိၩ့ဆၧၩ့တၭ, ဒုၭဂဲၫမၫဆမံၭလၧအဝ့ၫၥံၪ အဖၫ့ခိၪဒဲလုၬဘံၭခွံၬ အဝ့ၫၥံၪလီၫ. တၭဆၧလၧယ မၩလၧအံဇံၭ အဖၧၩ့နီၪ နၥံၪအမ့ၬၥၪဒၪဘၪယူၭး",
			"8": "<sup>8</sup> တၭနၥံၪအီၪလၧၡါမုနၧၫ့ဖၫ အၪနံၩအၪၥၫ့လီၫ.- ယ ဒုၭဂဲၫယူၭနၥံၪလၧၦအၫမိၫဖိၪအခးဖၧၩ့ လၧအအီၪဝ့ၫ လၧယီၫဒၫ့ဝါလခီၫတၭ, အဝ့ၫၥံၪနီၪ ဒုၭဆၧထၫ့ဒၩန ၥံၪတၭ,ယဖ့ၪလၫ့အဝ့ၫၥံၪလၧနၥံၪအစူၪဖၧၩ့ ဘဲၫၥိၭ နၥံၪမိမၩန့အခးတၭ, ယမၩဂၭဂီၩ့အဝ့ၫၥံၪလၧနၥံၪအ",
			"9": "<sup>9</sup> မ့ၬယၫလီၫ.- ထီးနီၪလဖၧၫ့ စဇံၭဖီၫအဖိၪခွၫ စဘၫ လၭ,မိအၭအစဎွၩနီၪ, ဂဲထုၪ့တၭ, ဒုၭဆၧထၫ့ဒၩအံၫ စရ့လၭတၭ, အၪ့မၧၫ့လၩ့ဆၧကိၭန့စဘံအီၫအဖိၪခွၫ",
			"10": "<sup>10</sup> စဘၫလၫ့ဘဲၫၥိၭအမိဆိၪအၧၩ့နၥံၪလီၫ.- တၭယအီၪ က့ၪယၥၭလၧယမိခိၭနၪ စဘၫလၫ့အလူအ့ၬ. တၭအ ဝ့ၫဒၪဆိၪဂ့ၩနၥံၪတၡါလီၫ. တၭယမိမၩဖီၩ့မၩဖျ့ၭန",
			"11": "<sup>11</sup> ၥံၪလၧအစူၪဖၧၩ့လီၫ.- နၥံၪခၫ့ဂၬယီၫဒၫ့တၭ, ဂဲၫလၧ ယ့ၫရခိၫတၭ, ၦယ့ၫရခိၫဖိၪဒုၭဆၧထၫ့ဒၩနၥံၪ, ၦအၫ မိၫဖိၪဒဲၦပံရ့ၭဖိၪ, ဒဲၦကၫနအၫ့ဖိၪ,ဒဲၦဟံၥၭဖိၪ,ဒဲၦဂၧ ဂၡဲၭဖိၪ,ဒဲၦဟံဝဲၫဖိၪ, ဒဲၦယ့ဘုၫဖိၪနီၪ,တၭယဖ့ၪလၫ့",
			"12": "<sup>12</sup> ယူၭအဝ့ၫၥံၪ လၧနၥံၪအစူၪဖၧၩ့လီၫ.- တၭယအၪ့ မၧၫ့လၩ့ဖျိၭၥံၪဖျၧၩ့ၥံၪလ့ၩလၧနၥံၪအမ့ၬယၫ, လၧအ နၫ့ထၪ့ခွံၬယူၭၦအၫမိၫဖိၪအစဎွၩနံၫဂၩ လၧနၥံၪအမ့ၬ",
			"13": "<sup>13</sup> ယၫနီၪလီၫ. လၧနနၭနဖၩ့, လၧနချံၫနဖျါအ့ၬ.- တၭ ယဖ့ၪလၫ့ယူၭ နၥံၪအခးလဘံၪ့ လၧနၥံၪလမၩဘၪ ဆၧလၧအဖၧၩ့, ဒဲဒိၩ့ၥံၪတဝၫ့ၥံၪ လၧနၥံၪလတဲၩ့ဘၪ ဝ့ၫလဖၪနီၪ နၥံၪအီၪဘၪလၧအဖၧၩ့လီၫ. စဘံၭမုအ လးဒဲၥံၪ့အလဲအိၫ့အလး လၧနၥံၪလၥုၪ့ဘၪဝ့ၫလဖၪ နီၪနၥံၪအၪ့ဘၪဆၧလၧ အဝ့ၫၥံၪလီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ ဘိၩ့နဲၪ့ယီၩ ၥၭမဲၪယဟိဝၩ တၭ,မၩအဆၧလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ တီၩတီၩလီၩ့လီၩ့ တၭ,ၥုၭခွံၬယွၩလဖၪ လၧနၥံၪအဖါၥံၪမၩအဆၧလၧ ထံၫမိၡါဝါလခီၫ, ဒဲလၧအံဇံၭအဖၧၩ့တၭ, မၩနၥံၪဝ့ၫ",
			"15": "<sup>15</sup> ယဟိဝၩအဆၧဆံၭ.- လၧနၥံၪမိမၩ ယဟိဝၩအဆၧ နီၪ,အ့ၪမွဲဆၧအၧၩ့လၧနၥံၪအမ့ၬယၫတၭ, ယွၩလဖၪ လၧနၥံၪအဖါၥံၪ မၩအဆၧလၧအအီၪလၧ ထံၫမိၡါဝါ လခီၫမွဲဂ့ၩ, ၦအၫမိၫဖိၪ လၧနၥံၪအီၪလၧအခးဖၧၩ့အ ယွၩလဖၪမွဲဂ့ၩ, ၦလၧနၥံၪမိမၩအဆၧနီၪ, ရွံန့နၥံၪ ဝ့ၫလၧမုဆၫလနံၩယီၩဆံၭ, အ့ၪမွဲယဝ့ၫဒၪယီၩ ဒဲယ ၡၩဂံၪ့ဖိၪလဖၪ, ပမိမၩယဟိဝၩအဆၧလီၫ.",
			"16": "<sup>16</sup> ၦခမျၧးစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,မွဲပထီးစဲၪ့ဒၪခွံၬ ယဟိဝၩဘဲၫၥိၭပမိမၩယွၩအဂူၫဂၩလဖၪ အဆၧလ",
			"17": "<sup>17</sup> ဂ့ၩ.- အဂဲးဘဲၫယီၩယဟိဝၩပယွၩ မွဲၦလၧအဒုၭစဲၪ့ ထၪ့ခွံၬပၧၩ, ဒဲပဖါလဖၪလၧခးအံဇံၭအဖၧၩ့, ဒဲလၧၦ ဎီးဖိၪအဂံၪ့ဖၧၩ့, ဒဲမၩဆၧလၩ့လၭဖၭဒိၪ လၧပမ့ၬယၫ တၭ,ယိထဲၩ့ခွါထဲၩ့ပၧၩလၧဖၧၩ့ၥၭ လၧပဖိၬဝ့ၫထၧၫ့ ဘီၩ့ယၫ, ဒဲလၧကယဲၦခမျၧးအကျၩ လၧပလ့ၩခၫ့ဂၬ",
			"18": "<sup>18</sup> ဝ့ၫနီၪလီၫ.- တၭယဟိဝၩနၫ့ထၪ့ခွံၬ ၦခမျၧးထီးအလူၬ လၧပမ့ၬယၫ, ၦအၫမိၫဖိၪလၧအအီၪဝ့ၫလၧထံၫၥံၪခး ၥံၪအဖၧၩ့နီၪလီၫ. ပဝ့ၫဒၪပမိမၩဆ့ ယဟိဝၩအဆၧ လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမွဲပယွၩလီၫ.",
			"19": "<sup>19</sup> တၭစယီရှုၫအ့ၫစံၭၦခမျၧး, နၥံၪမၩယဟိဝၩအဆၧ ကဲၪအ့ၬ. အဂဲးဘဲၫယီၩ မွဲယွၩဆံၫ့ဎံၪ, ယွၩအၥၭကဲၪ့ ဆၧလီၫ. မိကွဲၪဖျါခွံၬနၥံၪအဆၧမၪ ဒဲနၥံၪအဆၧဒဲၩ",
			"20": "<sup>20</sup> ဘၭအ့ၬ.- နၥံၪအ့ၪစဲၪ့ဒၪခွံၬယဟိဝၩ, ဒဲမၩၦလခီၫ ဘၩ့မုးဖိၪအယွၩလဖၪ အဆၧတၭ, အဝ့ၫဒၪမိကၠၪအ ၥၭတၭမၩအၧၩ့နၥံၪတၭ, လၧအမၩဂ့ၩနၥံၪအလးခဲၫ့ နီၪမိမၩလူၬခွံၬနၥံၪလီၫ.",
			"21": "<sup>21</sup> တၭၦခမျၧးစံၭစယီရှုၫအ့ၫ, မွဲအ့ၬး ပမိမၩယဟိ ဝၩအဆၧလီၫ.",
			"22": "<sup>22</sup> တၭစယီရှုၫအ့ၫစံၭၦခမျၧး, နၥံၪမွဲၦထိးအၥၭထၫ့ ဒၩနၥံၪအနၫ့ဆါဒၪနၥံၪဝ့ၫ လၧနၥံၪရွံန့ယူၭ ယဟိဝၩ ဘဲၫၥိၭနၥံၪမိမၩအဆၧလီၫ. တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ပမွဲၦထိးအၥၭလီၫ.",
			"23": "<sup>23</sup> ဘိၩ့နဲၪ့ယီၩ ၥုၭခွံၬၦလခီၫဘၩ့မုးဖိၪအယွၩလဖၪ လၧအအီၪလၧနၥံၪအကျၩတၭ, အီၪက့ၪနၥံၪအၥၭလၧ",
			"24": "<sup>24</sup> ယဟိဝၩအံၫစရ့လၭအယွၩအဖၧၩ့ဆံၭ.- တၭၦခမျၧး စံၭစယီရှုၫအ့ၫ, ယဟိဝၩပယွၩနီၪပမိမၩအဆၧ, ဒဲအ လူအထၫနီၪပမိခိၭနၪလီၫ.",
			"25": "<sup>25</sup> ဆၧလၧမုလနံၩနီၪ, စယီရှုၫအ့ၫမၩဆၧအုၩ့လၩ့ လၧၦခမျၧးတၭ, အီၪက့ၪလၩ့ဆၧမၪလူၬလၧအဂး, ဒဲ",
			"26": "<sup>26</sup> ဆၧစ့ၩရၫ့လၧၡံခံၫ့အဖၧၩ့လီၫ.- စယီရှုၫအ့ၫကွ့ၭဆၧ ချဲၩ့လဖၪယီၩ လၧယွၩအဆၧၥီၪ့ဆၧၥၫ့ အလံၬဖၧၩ့တၭ, မၩန့လိးဖၭဒိၪလဖျိၪ့တၭ, ဘိၭဆၧၫ့ထုၪ့ဝ့ၫထီးနီၪလၧ ၥံၪ့ထိၭဖၫလထံၭအဖၫ့လၬ လၧအအီၪဝ့ၫလၧယဟိဝၩ",
			"27": "<sup>27</sup> အလးဆံၫ့ဎံၪအနဲၩ့ထံၭနီၪလီၫ.- တၭစယီရှုၫအ့ၫစံၭ ၦခမျၧးထီးအလူၬ, ယိခွါ,လိးလဖျိၪ့ယီၩ, မိကဲၪထၪ့ ဆၧထိးအၥၭလၧပဂးလီၫ. အဂဲးဘဲၫယီၩမွဲအနါဂၧၫ့ ဝ့ၫလၧကယဲယဟိဝၩ အဆၧချဲၩ့ လၧအချဲၩ့ဆၧလၧ ပၧၩလီၫ. တၭမိကဲၪထၪ့ဝ့ၫလၧဆၧထိးအၥၭ လၧနၥံၪ အဂး,ဘဲၫၥိၭနၥံၪထီးမီၪ့ဘံၭ နၥံၪအယွၩလဂ့ၩလီၫ.",
			"28": "<sup>28</sup> တၭစယီရှုၫအ့ၫကွဲၪဖျါခွံၬ ၦခမျၧးနီၪ,လဂၩလၧအ ဆၧန့ၥၫ, လဂၩလၧအဆၧန့ၥၫ ဆုၬဆုၬလီၫ.",
			"29": "<sup>29</sup> တၭဆၧလဖၪနီၪ အလးခဲၫ့ ယဟိဝၩအခ့ၫအၡၩ စနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫ, အၥၭၡါအနံၪ့ လယၩလ ဆံၫတၭ, ၥံၫဝ့ၫလီၫ.",
			"30": "<sup>30</sup> တၭၦလဖၪနီၪခုၪ့လၩ့ဘၧၩ့ဝ့ၫလၧအဆၧန့ၥၫအနဲၩ့ ထံၭလၧတံမနၭစံရၫ လၧအအီၪလၧခိၪလီၩ့အံဖြံၫ့အ လီၩ့လၧခိၪလီၩ့ဂၫအၭလၧ မုဖၩလခီၫနီၪလီၫ.",
			"31": "<sup>31</sup> တၭအံၫစရ့လၭမၩယဟိဝၩအဆၧ လၧစယီရှုၫအ့ၫ အမုနံၩထီးအလူၬ, ဒဲအၡၩၥုၪ့က့ၭၥၭၡါလၧအမၧၫ့ ဒံၭလၧစယီရှုၫအ့ၫအလးခဲၫ့, ဒဲၥ့ၪယၫယဟိဝၩအဆၧ မၩထီးအလူၬ, လၧအမၩယူၭ လၧအံၫစရ့လၭအဂး လဖၪလၧမုနံၩထီးအလူၬနီၪလီၫ.",
			"32": "<sup>32</sup> တၭစယိၥၭအဎွံၪ လၧၦအံၫစရ့လၭဖိၪ ဂဲၫထဲၩ့ ဆိၬထၪ့ခွံၬ လၧခးအံဇံၭအဖၧၩ့နီၪ ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧဂၪ့ခိၪလဝၩ့ လၧၡံခံၫ့အဖၧၩ့ လၧစယၫကူၭဎွ့ၩန့ လၧစၡံခံၫ့အဖါ စဟၫမီၫအဖိၪခွၫလဖၪ လၧကစံတၫ လယၩအဂးလီၫ. တၭကဲၪထၪ့ဝ့ၫလၧစယိၥၭအဖိၪ ၥံၪအဆၧန့ၥၫလီၫ.",
			"33": "<sup>33</sup> စအၫရၧၫ့အဖိၪခွၫ စအံၫလအ့ဇၧၫနီၪၥံၫဝ့ၫတၭ,ၦ ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧခိၪလီၩ့ လဖျိၪ့အလီၩ့လၧအ ဘၪဆဲၫ့လၧအဖိၪခွၫစဖံနအၭ လၧဆၧဖ့ၪလၫ့အဝ့ၫ လၧခိၪလီၩ့အံဖြံၫ့အလီၩ့နီၪလီၫ."
		}
	}
};
module.exports = book;